INSERT INTO `EntitiesRelation` VALUES (1, 'Any OnboardingFragment implementation', 'must use', 'the Theme_Leanback_Onboarding theme', 'Introducing First-time Users to Your App', 'https://developer.android.com/training/tv/playback/onboarding.html', 'Any OnboardingFragment implementation must use either the Theme_Leanback_Onboarding theme or a theme that inherits from Theme_Leanback_Onboarding.', '11276', '11276_65', '11276_65_1');
INSERT INTO `EntitiesRelation` VALUES (2, 'A Presenter', 'binds', 'objects', 'Create a Card Presenter', 'https://developer.android.com/training/tv/playback/card.html', 'A Presenter generates views and binds objects to them on demand.', '11271', '11271_12', '11271_12_2');
INSERT INTO `EntitiesRelation` VALUES (3, 'the class MyViewGroup', 'extends', 'ViewGroup', 'Managing Touch Events in a ViewGroup', 'https://developer.android.com/training/gestures/viewgroup.html', 'In the following snippet, the class MyViewGroup extends ViewGroup.', '11105', '11105_12', '11105_12_1');
INSERT INTO `EntitiesRelation` VALUES (4, 'The InputManager', 'is obtained from', 'the system Context', 'Add an Interface for Backward Compatibility', 'https://developer.android.com/training/game-controllers/compatibility.html', 'The InputManager is obtained from the system Context.', '11095', '11095_64', '11095_64_1');
INSERT INTO `EntitiesRelation` VALUES (5, 'A watch face', 'requires', 'the WAKE_LOCK permission', 'Declare permissions', 'https://developer.android.com/training/wearables/watch-faces/service.html', 'A watch face requires the WAKE_LOCK permission.', '11340', '11340_27', '11340_27_1');
INSERT INTO `EntitiesRelation` VALUES (6, 'The SQLiteOpenHelper class', 'defines', 'abstract methods', 'Create the Virtual Table', 'https://developer.android.com/training/search/search.html', 'The SQLiteOpenHelper class defines abstract methods that you must override so that your database table can be created and upgraded when necessary.', '11204', '11204_9', '11204_9_1');
INSERT INTO `EntitiesRelation` VALUES (7, 'the CardPresenter', 'is created in', 'the following code', 'Create a Card Presenter', 'https://developer.android.com/training/tv/playback/card.html', 'In the following code, the CardPresenter is created in the onLoadFinished() callback of the LoaderManager.', '11271', '11271_14', '11271_14_1');
INSERT INTO `EntitiesRelation` VALUES (8, 'The TvInputService.Session', 'notifies', 'the system TV app', 'Declare your TV input service in the manifest', 'https://developer.android.com/training/tv/tif/tvinput.html', 'The TvInputService.Session handles the onTune() event when the user selects a channel, and notifies the system TV app for changes in the content and content metadata.', '11289', '11289_89', '11289_89_3');
INSERT INTO `EntitiesRelation` VALUES (9, 'The RecyclerView class', 'simplifies', 'the display', 'Creating Lists and Cards', 'https://developer.android.com/training/material/lists-cards.html', 'The RecyclerView class simplifies the display and handling of large data sets by providing:.', '11148', '11148_8', '11148_8_1');
INSERT INTO `EntitiesRelation` VALUES (10, 'the wear.xml file', 'would include', 'a different value', 'Specifying capability names for detecting your apps', 'https://developer.android.com/training/wearables/apps/standalone-apps.html', 'For example, in your mobile module, the wear.xml file could include the following: In your wear module, the wear.xml file would include a different value for the capability name, such as the following: For more information, see Advertise capabilities.', '11307', '11307_54', '11307_54_2');
INSERT INTO `EntitiesRelation` VALUES (11, 't', 'want to apply', 'GuidedStepFragment styles', 'Adding a Guided Step', 'https://developer.android.com/training/tv/playback/guided-step.html', 'If your activity already uses a custom theme and you don t want to apply GuidedStepFragment styles to other views in the activity, add the LeanbackGuidedStepTheme_guidedStepTheme attribute to your existing custom activity theme.', '11273', '11273_76', '11273_76_2');
INSERT INTO `EntitiesRelation` VALUES (12, 'The RequestQueue', 'reading writing', 'parsing responses', 'Sending a Simple Request', 'https://developer.android.com/training/volley/simple.html', 'The RequestQueue manages worker threads for running the network operations, reading from and writing to the cache, and parsing responses.', '11295', '11295_3', '11295_3_4');
INSERT INTO `EntitiesRelation` VALUES (13, 'This List', 'is then returned by', 'the parser', 'Read the Feed', 'https://developer.android.com/training/basics/network-ops/xml.html', 'This List is then returned by the parser.', '11057', '11057_29', '11057_29_1');
INSERT INTO `EntitiesRelation` VALUES (14, 'Calling setFlags', 'is', 'the only way', 'Grant Permissions for the File', 'https://developer.android.com/training/secure-file-sharing/share-file.html', 'The following code snippet shows you how to set read permission for the file: Caution: Calling setFlags() is the only way to securely grant access to your files using temporary access permissions.', '11210', '11210_40', '11210_40_1');
INSERT INTO `EntitiesRelation` VALUES (15, 'View', 'has', 'many methods', 'Handle Layout Events', 'https://developer.android.com/training/custom-views/custom-drawing.html', 'Although View has many methods for handling measurement, most of them do not need to be overridden.', '11080', '11080_29', '11080_29_1');
INSERT INTO `EntitiesRelation` VALUES (16, 'The MotionEvent object', 'contains', 'the current position', 'Handling Controller Actions', 'https://developer.android.com/training/game-controllers/controller-input.html', 'The MotionEvent object contains the current position for each joystick axis as well as multiple historical positions for each axis.', '11096', '11096_85', '11096_85_1');
INSERT INTO `EntitiesRelation` VALUES (17, 'The UnreadConversation object', 'include', 'a RemoteInput object', 'Concepts and objects', 'https://developer.android.com/training/auto/messaging/index.html', 'The UnreadConversation object you create must also include a RemoteInput object.', '11028', '11028_110', '11028_110_1');
INSERT INTO `EntitiesRelation` VALUES (18, 'The TransitionSet class', 'extends from', 'the Transition class', 'Create a Transition', 'https://developer.android.com/training/transitions/transitions.html', 'The TransitionSet class extends from the Transition class, so you can use it with a transition manager just like any other Transition instance.', '11263', '11263_53', '11263_53_1');
INSERT INTO `EntitiesRelation` VALUES (19, 'activity layout', 'must include', 'a container View', 'Add a Fragment to an Activity at Runtime', 'https://developer.android.com/training/basics/fragments/fragment-ui.html', 'An important rule when dealing with fragments especially when adding fragments at runtime is that your activity layout must include a container View in which you can insert the fragment.', '11047', '11047_15', '11047_15_1');
INSERT INTO `EntitiesRelation` VALUES (20, 'Thumbnail', 'Add', 'a QuickContactBadge', 'Displaying the Quick Contact Badge', 'https://developer.android.com/training/contacts-provider/display-contact-badge.html', 'Add a QuickContactBadge View Set the Contact URI and Thumbnail Add a QuickContactBadge to a ListView You should also read.', '11074', '11074_1', '11074_1_2');
INSERT INTO `EntitiesRelation` VALUES (21, 'This column', 'is available in', 'the ContactsContract.Data table', 'Retrieve All Details for a Contact', 'https://developer.android.com/training/contacts-provider/retrieve-details.html', 'This column is available in the ContactsContract.Data table, because the Contacts Provider makes an implicit join between the ContactsContract.Contacts table and the ContactsContract.Data table.', '11077', '11077_11', '11077_11_1');
INSERT INTO `EntitiesRelation` VALUES (22, 'The InstrumentationTestCase', 'extends', 'TestCase', 'Verifying Results', 'https://developer.android.com/training/testing/ui-testing/uiautomator-testing.html', 'The InstrumentationTestCase extends TestCase , so you can use standard JUnit Assert methods to test that UI components in the app return the expected results.', '11255', '11255_98', '11255_98_1');
INSERT INTO `EntitiesRelation` VALUES (23, 'The service', 'uses', 'a Geocoder', 'Displaying a Location Address', 'https://developer.android.com/training/location/display-address.html', 'The service uses a Geocoder to fetch the address for the location and sends the results to the ResultReceiver.', '11136', '11136_31', '11136_31_1');
INSERT INTO `EntitiesRelation` VALUES (24, 'The GuidedStepFragment class', 'can use', 'custom themes', 'Adding a Guided Step', 'https://developer.android.com/training/tv/playback/guided-step.html', 'The GuidedStepFragment class can use custom themes that control presentation aspects such as title text formatting or step transition animations.', '11273', '11273_71', '11273_71_1');
INSERT INTO `EntitiesRelation` VALUES (25, 'The swipe-to-refresh user interface pattern', 'is implemented entirely within', 'the SwipeRefreshLayout widget', 'Adding Swipe-to-Refresh To Your App', 'https://developer.android.com/training/swipe/add-swipe-interface.html', 'The swipe-to-refresh user interface pattern is implemented entirely within the SwipeRefreshLayout widget, which detects the vertical swipe, displays a distinctive progress bar, and triggers callback methods in your app.', '11219', '11219_5', '11219_5_3');
INSERT INTO `EntitiesRelation` VALUES (26, 'app bar features', 'been added to', 'the native ActionBar', 'Setting Up the App Bar', 'https://developer.android.com/training/appbar/setting-up.html', 'However, app bar features have gradually been added to the native ActionBar over various Android releases.', '11006', '11006_7', '11006_7_1');
INSERT INTO `EntitiesRelation` VALUES (27, 'Memory barriers', 'provide', 'a way', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'Memory barriers provide a way for your code to tell the CPU that memory access ordering matters.', '11020', '11020_130', '11020_130_1');
