INSERT INTO `EntitiesRelation` VALUES (69, 'The pthread library', 'make', 'a couple', 'What to do', 'https://developer.android.com/training/articles/smp.html', 'The pthread library and VM make a couple of useful guarantees: all accesses previously performed by a thread that creates a new thread are observable by that new thread as soon as it starts, and all accesses performed by a thread that is exiting are observable when a join() on that thread returns.', '11020', '11020_468', '11020_468_1');
