INSERT INTO `EntitiesRelation` VALUES (71, 'DownloadCallback interface', 'can consist at', 'the minimum', 'Introducing Network Operations on a Separate Thread', 'https://developer.android.com/training/basics/network-ops/connecting.html', 'At the minimum, your DownloadCallback interface can consist of the following: Now, add the following implementations of the DownloadCallback interface methods to your Activity : Implementing a Headless Fragment to Encapsulate Network Operations.', '11053', '11053_19', '11053_19_1');
