INSERT INTO `EntitiesRelation` VALUES (73, 'The system', 'calls', 'the Engine.onDraw', 'Reduce the size of your bitmap assets', 'https://developer.android.com/training/wearables/watch-faces/performance.html', 'The system calls the Engine.onDraw() method every time it redraws your watch face, so you should only include operations that are strictly required to update the watch face inside this method to improve performance.', '11339', '11339_61', '11339_61_1');
INSERT INTO `EntitiesRelation` VALUES (74, 'the system', 'sends', 'a MEDIA_MOUNTED notification', 'Accessing a Directory on Removable Media', 'https://developer.android.com/training/articles/scoped-directory-access.html', 'To use Scoped Directory Access to access directories on removable media, first add a BroadcastReceiver that listens for the MEDIA_MOUNTED notification, for example: When the user mounts removable media, like an SD card, the system sends a MEDIA_MOUNTED notification.', '11014', '11014_21', '11014_21_2');
