INSERT INTO `EntitiesRelation` VALUES (77, 'the user', 'reaches', 'bottom', 'Create a custom drawer view', 'https://developer.android.com/training/wearables/ui/wear-ui-library.html', 'The action drawer peeks when the user reaches the top or bottom of the scrolling content, whether from normal scrolling or from flings.', '11330', '11330_38', '11330_38_1');
