INSERT INTO `EntitiesRelation` VALUES (79, 'Each profile', 'is defined by', 'a Target', 'Extract color profiles', 'https://developer.android.com/training/material/palette-colors.html', 'Each profile is defined by a Target , and colors extracted from the bitmap image are scored against each profile based on saturation, luminance, and population (number of pixels in the bitmap represented by the color).', '11149', '11149_39', '11149_39_1');
