INSERT INTO `EntitiesRelation` VALUES (107, 'Activity', 'is in', 'focus', 'Testing UI for Multiple Apps', 'https://developer.android.com/training/testing/ui-testing/uiautomator-testing.html', 'The UI Automator APIs let you interact with visible elements on a device, regardless of which Activity is in focus.', '11255', '11255_10', '11255_10_1');
INSERT INTO `EntitiesRelation` VALUES (108, 'LinearLayout', 'control', 'the spacial relationships', 'Use RelativeLayout', 'https://developer.android.com/training/multiscreen/screensizes.html', 'However, LinearLayout does not allow you to precisely control the spacial relationships of child views; views in a LinearLayout simply line up side-by-side.', '11170', '11170_16', '11170_16_1');
INSERT INTO `EntitiesRelation` VALUES (109, 'The BrowseFragment class', 'define', 'media items', 'Create a Media Browse Layout', 'https://developer.android.com/training/tv/playback/browse.html', 'The BrowseFragment class allows you to define and display browsable media content categories and media items from a media catalog using adapters and presenters.', '11270', '11270_50', '11270_50_2');
INSERT INTO `EntitiesRelation` VALUES (110, 'The build.gradle file', 'use', 'this version', 'Configure your app to use the correct version of Google Play Services', 'https://developer.android.com/training/wearables/apps/creating-app-china.html', 'The following example shows how to do so: The build.gradle file of your wear module must also use this version of the client library, for example: Note: If you are using any other Google Play services APIs in your wearable app, you must selectively add those Google Play service APIs into your app and explicitly specify the 10.2.0 version.', '11299', '11299_12', '11299_12_1');
INSERT INTO `EntitiesRelation` VALUES (111, 'channel metadata', 'map', 'the values', 'Register Channels in the Database', 'https://developer.android.com/training/tv/tif/channel.html', 'Pull your channel metadata (in XML, JSON, or whatever) from your backend server, and in your setup activity map the values to the system database as follows: In the example above, channel is an object which holds channel metadata from the backend server.', '11285', '11285_17', '11285_17_3');
