INSERT INTO `EntitiesRelation` VALUES (113, 'A QuickContactBadge', 'is', 'a useful addition', 'Displaying the Quick Contact Badge', 'https://developer.android.com/training/contacts-provider/display-contact-badge.html', 'A QuickContactBadge is a useful addition to a ListView that displays a list of contacts.', '11074', '11074_39', '11074_39_1');
INSERT INTO `EntitiesRelation` VALUES (114, 'the query results', 'are stored in', 'an Inventory object', 'Query Items Available for Purchase', 'https://developer.android.com/training/in-app-billing/list-iab-products.html', 'If the query is successful, the query results are stored in an Inventory object that is passed back to the listener.', '11126', '11126_30', '11126_30_1');
INSERT INTO `EntitiesRelation` VALUES (115, 'Canvas', 'provides', 'a method', 'Override onDraw()', 'https://developer.android.com/training/custom-views/custom-drawing.html', 'For instance, Canvas provides a method to draw a line, while Paint provides methods to define that line\'s color.', '11080', '11080_17', '11080_17_1');
INSERT INTO `EntitiesRelation` VALUES (116, 'AXIS_HAT_X', 'include', 'BUTTON_SELECT', 'Process Gamepad Button Presses', 'https://developer.android.com/training/game-controllers/controller-input.html', 'The callouts in the figure refer to the following: AXIS_HAT_X , AXIS_HAT_Y , DPAD_UP , DPAD_DOWN , DPAD_LEFT , DPAD_RIGHT AXIS_X , AXIS_Y , BUTTON_THUMBL AXIS_Z , AXIS_RZ , BUTTON_THUMBR BUTTON_X BUTTON_A BUTTON_Y BUTTON_B BUTTON_R1 AXIS_RTRIGGER , AXIS_THROTTLE AXIS_LTRIGGER , AXIS_BRAKE BUTTON_L1 Common key codes generated by gamepad button presses include BUTTON_A , BUTTON_B , BUTTON_SELECT , and BUTTON_START.', '11096', '11096_47', '11096_47_3');
INSERT INTO `EntitiesRelation` VALUES (117, 'Java memory model web site', 'has', 'a few test programs', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'Bill Pugh s Java memory model web site has a few test programs on it.', '11020', '11020_494', '11020_494_1');
INSERT INTO `EntitiesRelation` VALUES (118, 'the store', 'can be observed in', 'a different order', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'On x86 and ARM SMP, the store to A and the load from B in thread 1 can be  observed  in a different order by thread 2.', '11020', '11020_60', '11020_60_3');
INSERT INTO `EntitiesRelation` VALUES (119, 'mContentRect', 'represents', 'the following snippet', 'Implement Touch-Based Scrolling', 'https://developer.android.com/training/gestures/scroll.html', 'In the following snippet, mContentRect represents the rectangle coordinates within the view that the chart will be drawn into.', '11104', '11104_40', '11104_40_1');
INSERT INTO `EntitiesRelation` VALUES (120, 'the WebView class', 'has been updated to enable', 'printing HTML content', 'Printing HTML Documents', 'https://developer.android.com/training/printing/html-docs.html', 'In Android 4.4 (API level 19), the WebView class has been updated to enable printing HTML content.', '11187', '11187_3', '11187_3_1');
INSERT INTO `EntitiesRelation` VALUES (121, 'the listener', 'be called for', 'ACTION_UP string', 'Capturing touch events for a single view', 'https://developer.android.com/training/gestures/detector.html', 'If you do this, the listener will not be called for the subsequent ACTION_MOVE and ACTION_UP string of events.', '11099', '11099_31', '11099_31_2');
INSERT INTO `EntitiesRelation` VALUES (122, 'the SearchView', 'can accept', 'the user \'s query', 'Setting Up the Search Interface', 'https://developer.android.com/training/search/setup.html', 'If you run your app now, the SearchView can accept the user\'s query and start your searchable activity with the ACTION_SEARCH intent.', '11205', '11205_29', '11205_29_1');
INSERT INTO `EntitiesRelation` VALUES (123, 'the variable stickerUri', 'is', 'a Uri', 'Adding images to a MessagingStyle notification', 'https://developer.android.com/training/wearables/notifications/noti-styles.html', 'Here is the code snippet to set data of type image in a notification: In the above code snippet the variable stickerUri is a Uri that points to a publicly-accessible location, as described here.', '11320', '11320_23', '11320_23_1');
INSERT INTO `EntitiesRelation` VALUES (124, 'Headers', 'are added to', 'ListViews', 'Matching a header or footer in a list view', 'https://developer.android.com/training/testing/espresso/recipes.html', 'Headers and footers are added to ListViews using the addHeaderView() and addFooterView() methods.', '11246', '11246_39', '11246_39_5');
INSERT INTO `EntitiesRelation` VALUES (125, 'a store', 'will be observed in', 'order', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'While the architecture guarantees that loads are not reordered with respect to other loads, and stores are not reordered with respect to other stores, it does not guarantee that a store followed by a load will be observed in the expected order.', '11020', '11020_52', '11020_52_3');
INSERT INTO `EntitiesRelation` VALUES (126, 'Thread', 'are', 'basic classes', 'Specifying the Code to Run on a Thread', 'https://developer.android.com/training/multiple-threads/define-runnable.html', 'Thread and Runnable are basic classes that, on their own, have only limited power.', '11164', '11164_7', '11164_7_1');
INSERT INTO `EntitiesRelation` VALUES (127, 'Misaligned data', 'could straddle', 'a cache line', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'Misaligned data could straddle a cache line, so other cores could see the halves update independently.', '11020', '11020_245', '11020_245_1');
