INSERT INTO `EntitiesRelation` VALUES (129, 'the Spinner', 'creates', 'a ListView', 'Checking data loading in adapter views', 'https://developer.android.com/training/testing/espresso/basics.html', 'For the item selection, the Spinner creates a ListView with its contents.', '11240', '11240_88', '11240_88_1');
INSERT INTO `EntitiesRelation` VALUES (130, 'the data', 'is aligned on', 'a 32-bit boundary', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'The most fundamental operations   loading and storing 32-bit values   are inherently atomic on ARM so long as the data is aligned on a 32-bit boundary.', '11020', '11020_238', '11020_238_2');
