INSERT INTO `EntitiesRelation` VALUES (133, 'the client app', 'gets', 'a FileDescriptor object', 'Access the Requested File', 'https://developer.android.com/training/secure-file-sharing/request-file.html', 'From this object, the client app gets a FileDescriptor object, which it can then use to read the file.', '11207', '11207_18', '11207_18_1');
INSERT INTO `EntitiesRelation` VALUES (134, 'an assetlinks.json file', 'were not found at', 'https://www.example.net/.well-known/assetlinks.json', 'Create an Intent Handler for URIs', 'https://developer.android.com/training/app-links/index.html', 'For example, an app with the following intent filters would fail verification if an assetlinks.json file were not found at both https://www.example.com/.well-known/assetlinks.json and https://www.example.net/.well-known/assetlinks.json : Supporting app linking for multiple subdomains.', '11002', '11002_45', '11002_45_3');
INSERT INTO `EntitiesRelation` VALUES (135, 'details', 'view using', 'an Intent', 'Create a Details Activity', 'https://developer.android.com/training/tv/playback/details.html', 'Creating an activity for your details view, separate from the browse activity, enables you to invoke your details view using an Intent.', '11272', '11272_16', '11272_16_1');
INSERT INTO `EntitiesRelation` VALUES (136, 'An IntentService', 'has', 'a few limitations', 'Creating a Background Service', 'https://developer.android.com/training/run-background-service/create-service.html', 'Also, an IntentService isn\'t affected by most user interface lifecycle events, so it continues to run in circumstances that would shut down an AsyncTask An IntentService has a few limitations:.', '11190', '11190_6', '11190_6_1');
INSERT INTO `EntitiesRelation` VALUES (137, 'users', 'can choose to cancel', 'the print action', 'Connect to the Print Manager', 'https://developer.android.com/training/printing/custom-docs.html', 'During the printing process, users can choose to cancel the print action, so your print adapter must also listen for and react to a cancellation requests.', '11186', '11186_22', '11186_22_1');
INSERT INTO `EntitiesRelation` VALUES (138, 'FloatingActionButton', 'extends', 'ImageButton', 'Create a Floating Action Button', 'https://developer.android.com/training/material/design-library.html', 'Note that as FloatingActionButton extends ImageButton , and in turn ImageView , you can set the icon which is displayed either via android:src as illustrated in the example above, or using the setImageDrawable() method.', '11144', '11144_13', '11144_13_1');
INSERT INTO `EntitiesRelation` VALUES (139, 'the parser', 'calls', 'summary tags', 'Analyze the Feed', 'https://developer.android.com/training/basics/network-ops/xml.html', 'For the title and summary tags, the parser calls readText().', '11057', '11057_41', '11057_41_2');
INSERT INTO `EntitiesRelation` VALUES (140, 'InputManagerCompatV16', 'is', 'an implementation', 'Implement the Interface on Android 4.1 and Higher', 'https://developer.android.com/training/game-controllers/compatibility.html', 'InputManagerCompatV16 is an implementation of the InputManagerCompat interface that proxies method calls to an actual InputManager and InputManager.InputDeviceListener.', '11095', '11095_63', '11095_63_1');
INSERT INTO `EntitiesRelation` VALUES (141, 'localVar', 'hold', 'a value', 'What not to do in C', 'https://developer.android.com/training/articles/smp.html', 'It is therefore possible for localVar to hold a value from \"recycled\" memory, for example a new object created in the same location by another thread after release() is called.', '11020', '11020_375', '11020_375_1');
INSERT INTO `EntitiesRelation` VALUES (142, 'the print framework', 'generate', 'a print document', 'Connect to the Print Manager', 'https://developer.android.com/training/printing/custom-docs.html', 'As these selections are made, the print framework asks your adapter to lay out and generate a print document, in preparation for final output.', '11186', '11186_20', '11186_20_2');
INSERT INTO `EntitiesRelation` VALUES (143, 'The TvTrackInfo class', 'holds', 'information', 'Handle Track Selection', 'https://developer.android.com/training/tv/tif/ui.html', 'The TvTrackInfo class holds information about media tracks such as the track type (video, audio, or subtitle) and so forth.', '11290', '11290_29', '11290_29_1');
INSERT INTO `EntitiesRelation` VALUES (144, 'the system', 'assumes as', 'GestureDetector.SimpleOnGestureListener', 'Capturing touch events for an Activity or View', 'https://developer.android.com/training/gestures/detector.html', 'If you return false from onDown() , as GestureDetector.SimpleOnGestureListener does by default, the system assumes that you want to ignore the rest of the gesture, and the other methods of GestureDetector.OnGestureListener never get called.', '11099', '11099_53', '11099_53_1');
INSERT INTO `EntitiesRelation` VALUES (145, 'Auto', 'invokes', 'onLoadChildren', 'Building your content hierarchy', 'https://developer.android.com/training/auto/audio/index.html', 'If the user selects a submenu, Auto invokes onLoadChildren() again to retrieve the child nodes of the selected menu item.', '11027', '11027_74', '11027_74_2');
INSERT INTO `EntitiesRelation` VALUES (146, 'the channel', 'works with', 'program information presenter', 'Register Channels in the Database', 'https://developer.android.com/training/tv/tif/channel.html', 'To make sure the channel and program information works with the system TV app\'s channel and program information presenter, follow the guidelines below.', '11285', '11285_20', '11285_20_5');
INSERT INTO `EntitiesRelation` VALUES (147, 'the following layout', 'uses', 'a DrawerLayout', 'Creating a Navigation Drawer', 'https://developer.android.com/training/implementing-navigation/nav-drawer.html', 'For example, the following layout uses a DrawerLayout with two child views: a FrameLayout to contain the main content (populated by a Fragment at runtime), and a ListView for the navigation drawer.', '11118', '11118_9', '11118_9_1');
INSERT INTO `EntitiesRelation` VALUES (148, 'the result', 'is ignored', 'setResult', 'Return a Result', 'https://developer.android.com/training/basics/intents/filters.html', 'If the originating activity had called startActivityForResult() , then the system delivers it the result you supply to setResult() ; otherwise, the result is ignored.', '11049', '11049_50', '11049_50_2');
INSERT INTO `EntitiesRelation` VALUES (149, 'the AsyncTask class', 'perform', 'background operations', 'Define an intent service to fetch the address', 'https://developer.android.com/training/location/display-address.html', 'Note that the AsyncTask class also allows you to perform background operations, but it\'s designed for short operations.', '11136', '11136_24', '11136_24_1');
INSERT INTO `EntitiesRelation` VALUES (150, 'a natively-created thread', 'added to', 'ThreadGroup', 'Threads', 'https://developer.android.com/training/articles/perf-jni.html', 'Attaching a natively-created thread causes a java.lang.Thread object to be constructed and added to the \"main\" ThreadGroup , making it visible to the debugger.', '11012', '11012_25', '11012_25_2');
INSERT INTO `EntitiesRelation` VALUES (151, 'An ActionProvider', 'handles', 'behavior', 'Adding an Easy Share Action', 'https://developer.android.com/training/sharing/shareaction.html', 'An ActionProvider , once attached to a menu item in the action bar, handles both the appearance and behavior of that item.', '11214', '11214_4', '11214_4_2');
INSERT INTO `EntitiesRelation` VALUES (152, 'a thread', 'wants to execute', 'code', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'When a thread wants to execute code in the critical section, it sets the lock to 1, executes the critical code, and then changes it back to zero when done.', '11020', '11020_271', '11020_271_1');
INSERT INTO `EntitiesRelation` VALUES (153, 'View class', 'implement', 'the KeyEvent.Callback interface', 'Handling Keyboard Actions', 'https://developer.android.com/training/keyboard-input/commands.html', 'Both the Activity and View class implement the KeyEvent.Callback interface, so you should generally override the callback methods in your extension of these classes as appropriate.', '11130', '11130_3', '11130_3_2');
INSERT INTO `EntitiesRelation` VALUES (154, 'A Presenter', 'generates', 'views', 'Create a Card Presenter', 'https://developer.android.com/training/tv/playback/card.html', 'A Presenter generates views and binds objects to them on demand.', '11271', '11271_12', '11271_12_1');
INSERT INTO `EntitiesRelation` VALUES (155, 'this.lock', 'could move', 'the assignment', 'What not to do in Java', 'https://developer.android.com/training/articles/smp.html', 'You could try to ensure that the store to helper happens after the atomic_release_store() on this.lock by rearranging the code, but that won t help, because It is okay to migrate code upward   the compiler could move the assignment back above the atomic_release_store() to its original position.', '11020', '11020_431', '11020_431_1');
INSERT INTO `EntitiesRelation` VALUES (156, 'a repeating call button', 'could have', 'the same R.id', 'Matching a view next to another view', 'https://developer.android.com/training/testing/espresso/recipes.html', 'For example, a repeating call button in a table of contacts could have the same R.id , contain the same text, and have the same properties as other call buttons within the view hierarchy.', '11246', '11246_3', '11246_3_1');
INSERT INTO `EntitiesRelation` VALUES (157, 'app', 'must have', 'READ_CONTACTS permission', 'Request Permission to Read the Provider', 'https://developer.android.com/training/contacts-provider/retrieve-names.html', 'To do any type of search of the Contacts Provider, your app must have READ_CONTACTS permission.', '11078', '11078_15', '11078_15_1');
INSERT INTO `EntitiesRelation` VALUES (158, 'some data', 'be confirmed using', 'creative WHERE clauses', 'Using content providers', 'https://developer.android.com/training/articles/security-tips.html', 'The write permission allows SQL statements that make it possible for some data to be confirmed using creative WHERE clauses and parsing the results.', '11019', '11019_48', '11019_48_2');
INSERT INTO `EntitiesRelation` VALUES (159, 'A useful set', 'is available in', 'the SQLiteOpenHelper class', 'Create a Database Using a SQL Helper', 'https://developer.android.com/training/basics/data-storage/databases.html', 'A useful set of APIs is available in the SQLiteOpenHelper class.', '11036', '11036_21', '11036_21_1');
INSERT INTO `EntitiesRelation` VALUES (160, 'A ComplicationManager object', 'is passed as', 'a parameter', 'Exposing Data to Complications', 'https://developer.android.com/training/wearables/watch-faces/complications.html', 'A ComplicationManager object is passed as a parameter to the onComplicationUpdate method, and can be used to send data back to the system.', '11332', '11332_139', '11332_139_2');
INSERT INTO `EntitiesRelation` VALUES (161, 'BaseTvInputService subclass', 'creates', 'sessions', 'Declare your TV input service in the manifest', 'https://developer.android.com/training/tv/tif/tvinput.html', 'Your BaseTvInputService subclass creates sessions which handle tuning requests.', '11289', '11289_59', '11289_59_1');
INSERT INTO `EntitiesRelation` VALUES (162, 'ARM doesn t', 'provide', 'a wide variety', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'Because of this, and because ARM doesn t provide a wide variety of barrier choices, many atomic primitives use full barrier instructions when a barrier is required.', '11020', '11020_226', '11020_226_1');
INSERT INTO `EntitiesRelation` VALUES (163, 'the Toolbar widget', 'provides', 'a material design experience', 'Setting Up the App Bar', 'https://developer.android.com/training/appbar/setting-up.html', 'For example, the Toolbar widget provides a material design experience on devices running Android 2.1 (API level 7) or later, but the native action bar doesn\'t support material design unless the device is running Android 5.0 (API level 21) or later.', '11006', '11006_12', '11006_12_1');
INSERT INTO `EntitiesRelation` VALUES (164, 'The TextRenderer class', 'eases', 'the drawing', 'Rendering complications', 'https://developer.android.com/training/wearables/watch-faces/complications.html', 'The TextRenderer class is intended for use in complications, and eases the drawing of text on a canvas.', '11332', '11332_40', '11332_40_1');
INSERT INTO `EntitiesRelation` VALUES (165, 'BasicNetwork', 'provides', 'a network transport', 'Set Up a Network and Cache', 'https://developer.android.com/training/volley/requestqueue.html', 'There are standard implementations of these available in the Volley toolbox: DiskBasedCache provides a one-file-per-response cache with an in-memory index, and BasicNetwork provides a network transport based on your preferred HTTP client.', '11294', '11294_7', '11294_7_2');
INSERT INTO `EntitiesRelation` VALUES (166, 'activity layout', 'contains', 'a TabWidget', 'Create a Version-Aware Activity Layout', 'https://developer.android.com/training/backward-compatible-ui/using-component.html', 'For the older implementation ( TabHelperEclair ), you need to ensure that your activity layout contains a TabWidget and TabHost , along with a container for tab contents: res/layout/mainxml: For the TabHelperHoneycomb implementation, all you need is a FrameLayout to contain the tab contents, since the tab indicators are provided by the ActionBar : res/layout-v11/mainxml: At runtime, Android will decide which version of the main.xml layout to inflate depending on the platform version.', '11035', '11035_7', '11035_7_1');
INSERT INTO `EntitiesRelation` VALUES (167, 'an app', 'calls', 'startActivityForResult', 'Allowing Other Apps to Start Your Activity', 'https://developer.android.com/training/basics/intents/filters.html', 'When an app calls startActivity() or startActivityForResult() , with an implicit intent, the system finds which activity (or activities) can respond to the intent.', '11049', '11049_8', '11049_8_2');
INSERT INTO `EntitiesRelation` VALUES (168, 'the content URI', 'call', 'assignContactUri', 'Set the Contact URI', 'https://developer.android.com/training/contacts-provider/display-contact-badge.html', 'To set the content URI for the contact, call getLookupUri(id,lookupKey) to get a CONTENT_LOOKUP_URI , then call assignContactUri() to set the contact.', '11074', '11074_30', '11074_30_1');
INSERT INTO `EntitiesRelation` VALUES (169, 'a particular data item', 'is not within', 'an AdapterView', 'Asserting that a data item is not in an adapter', 'https://developer.android.com/training/testing/espresso/recipes.html', 'To prove a particular data item is not within an AdapterView you have to do things a little differently.', '11246', '11246_20', '11246_20_1');
INSERT INTO `EntitiesRelation` VALUES (170, 'The above snippet', 'intercepted', 'the MotionEvent actions', 'Drag an Object', 'https://developer.android.com/training/gestures/scale.html', 'The above snippet directly intercepted the MotionEvent actions to implement dragging.', '11103', '11103_29', '11103_29_1');
INSERT INTO `EntitiesRelation` VALUES (171, 'ELAPSED_REALTIME_WAKEUP', 'fires', 'the pending intent', 'Choose an alarm type', 'https://developer.android.com/training/scheduling/alarms.html', 'ELAPSED_REALTIME_WAKEUP  Wakes up the device and fires the pending intent after the specified length of time has elapsed since device boot.', '11199', '11199_75', '11199_75_2');
INSERT INTO `EntitiesRelation` VALUES (172, 'The FileProvider class', 'is', 'part', 'Setting Up File Sharing', 'https://developer.android.com/training/secure-file-sharing/setup-sharing.html', 'Note: The FileProvider class is part of the v4 Support Library.', '11209', '11209_6', '11209_6_1');
