INSERT INTO `EntitiesRelation` VALUES (175, 'methods', 'invoke', 'captureValues', 'Capture Ending Values', 'https://developer.android.com/training/transitions/custom-transitions.html', 'The following code snippet shows an implementation of the captureEndValues() method: In this example, both the captureStartValues() and captureEndValues() methods invoke captureValues() to retrieve and store values.', '11259', '11259_25', '11259_25_2');
INSERT INTO `EntitiesRelation` VALUES (176, 'the system', 'is able with', 'a custom TrustManager', 'Unknown certificate authority', 'https://developer.android.com/training/articles/security-ssl.html', 'Here is the example in full using an organizational CA from the University of Washington: With a custom TrustManager that knows about your CAs, the system is able to validate that your server certificate come from a trusted issuer.', '11018', '11018_49', '11018_49_1');
INSERT INTO `EntitiesRelation` VALUES (177, 'The RecyclerView widget', 'is', 'flexible version', 'Creating Lists and Cards', 'https://developer.android.com/training/material/lists-cards.html', 'The RecyclerView widget is a more advanced and flexible version of ListView.', '11148', '11148_5', '11148_5_1');
INSERT INTO `EntitiesRelation` VALUES (178, 'the write-through cache', 'has', 'a policy', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', '(While the write-through cache has a policy of immediately forwarding the data to main memory, it only initiates the write.', '11020', '11020_78', '11020_78_1');
INSERT INTO `EntitiesRelation` VALUES (179, 'The following example code', 'populate', 'a projection transformation Matrix', 'Define a Projection', 'https://developer.android.com/training/graphics/opengl/projection.html', 'The following example code takes the height and width of the GLSurfaceView and uses it to populate a projection transformation Matrix using the Matrix.frustumM() method: This code populates a projection matrix, mProjectionMatrix which you can then combine with a camera view transformation in the onDrawFrame() method, which is shown in the next section.', '11110', '11110_15', '11110_15_3');
INSERT INTO `EntitiesRelation` VALUES (180, 'The SearchManager class', 'includes', 'several columns', 'Identify Columns', 'https://developer.android.com/training/tv/discovery/searchable.html', 'The SearchManager class includes several columns for Android TV.', '11268', '11268_23', '11268_23_1');
INSERT INTO `EntitiesRelation` VALUES (181, 's_client command', 'looks at', 'Wikipedia \'s server certificate information', 'Concepts', 'https://developer.android.com/training/articles/security-ssl.html', 'In the snippet below from a command line, the openssl tool\'s s_client command looks at Wikipedia\'s server certificate information.', '11018', '11018_26', '11018_26_2');
INSERT INTO `EntitiesRelation` VALUES (182, 'screens', 'will select', 'the layout/main', 'Use Layout Aliases', 'https://developer.android.com/training/multiscreen/screensizes.html', 'This means that devices whose smallest width is greater than or equal to 600dp will select the layout-sw600dp/main.xml (two-pane) layout, while smaller screens will select the layout/main.xml (single-pane) layout.', '11170', '11170_43', '11170_43_1');
INSERT INTO `EntitiesRelation` VALUES (183, 'Web', 'give', 'an Espresso-like feel', 'Espresso Web', 'https://developer.android.com/training/testing/espresso/web.html', 'Web and WebInteraction wrap this boilerplate and give an Espresso-like feel to interacting with WebView objects.', '11248', '11248_5', '11248_5_3');
INSERT INTO `EntitiesRelation` VALUES (184, 'the correct dependencies', 'are imported in', 'the appropriate module \'s build.gradle file', 'Including Libraries', 'https://developer.android.com/training/wearables/apps/creating.html', 'As part of the Project Wizard, the correct dependencies are imported for you in the appropriate module\'s build.gradle file.', '11301', '11301_113', '11301_113_2');
INSERT INTO `EntitiesRelation` VALUES (185, 'an operation', 'is running in', 'an IntentService', 'Creating a Background Service', 'https://developer.android.com/training/run-background-service/create-service.html', 'If an operation is running in an IntentService , and you send it another request, the request waits until the first operation is finished.', '11190', '11190_10', '11190_10_1');
INSERT INTO `EntitiesRelation` VALUES (186, 'the onData', 'takes', 'care', 'Accessing UI Components', 'https://developer.android.com/training/testing/ui-testing/espresso-testing.html', 'For views that extend AdapterView (for example, ListView ), the onData() method takes care of scrolling for you.', '11253', '11253_77', '11253_77_1');
INSERT INTO `EntitiesRelation` VALUES (187, 'The SearchManager', 'describes', 'the data fields', 'Identify Columns', 'https://developer.android.com/training/tv/discovery/searchable.html', 'The SearchManager describes the data fields it expects by representing them as columns of an SQLite database.', '11268', '11268_20', '11268_20_1');
INSERT INTO `EntitiesRelation` VALUES (188, 'single BroadcastReceiver', 'can handle', 'one type', 'Receive Status Broadcasts from an IntentService', 'https://developer.android.com/training/run-background-service/report-status.html', 'This next snippet shows how to register the BroadcastReceiver and its IntentFilter : A single BroadcastReceiver can handle more than one type of broadcast Intent object, each with its own action.', '11192', '11192_21', '11192_21_1');
INSERT INTO `EntitiesRelation` VALUES (189, 'onView', 'does not find', 'the target view', 'Finding a view', 'https://developer.android.com/training/testing/espresso/basics.html', 'If onView() does not find the target view, a NoMatchingViewException is thrown.', '11240', '11240_97', '11240_97_1');
INSERT INTO `EntitiesRelation` VALUES (190, 'code', 'can move across', 'release barriers', 'What not to do in C', 'https://developer.android.com/training/articles/smp.html', 'The basic principle is that code can move across acquire and release barriers, but only in one direction.', '11020', '11020_316', '11020_316_2');
INSERT INTO `EntitiesRelation` VALUES (191, 'the native ActionBar', 'behaves differently depending as', 'a result', 'Setting Up the App Bar', 'https://developer.android.com/training/appbar/setting-up.html', 'As a result, the native ActionBar behaves differently depending on what version of the Android system a device may be using.', '11006', '11006_8', '11006_8_1');
INSERT INTO `EntitiesRelation` VALUES (192, 'the custom timer', 'is implemented as', 'a Handler instance', 'Declare variables', 'https://developer.android.com/training/wearables/watch-faces/drawing.html', 'The following snippet shows how to define these variables: In the example above, the custom timer is implemented as a Handler instance that sends and processes delayed messages using the thread\'s message queue.', '11335', '11335_26', '11335_26_1');
INSERT INTO `EntitiesRelation` VALUES (193, 'An intent filter', 'replaces', 'BIND_LISTENER action', 'Using filters with WearableListenerService', 'https://developer.android.com/training/wearables/data-layer/events.html', 'An intent filter for the WearableListenerService example shown in the previous section might look like this: In this filter, the DATA_CHANGED action replaces the previously recommended BIND_LISTENER action so that only specific events wake or launch your app.', '11312', '11312_38', '11312_38_1');
INSERT INTO `EntitiesRelation` VALUES (194, 'news reader', 'use', 'the IMMERSIVE flag', 'Use Non-Sticky Immersion', 'https://developer.android.com/training/system-ui/immersive.html', 'If you\'re building a book reader, news reader, or a magazine, use the IMMERSIVE flag in conjunction with SYSTEM_UI_FLAG_FULLSCREEN and SYSTEM_UI_FLAG_HIDE_NAVIGATION.', '11228', '11228_35', '11228_35_1');
INSERT INTO `EntitiesRelation` VALUES (195, 'the sync adapter framework', 'does n\'t automatically connect to', 'a server', 'Declare the Sync Adapter in the Manifest', 'https://developer.android.com/training/sync-adapters/creating-sync-adapter.html', 'The following snippet shows the overall structure of onPerformSync() : While the actual implementation of onPerformSync() is specific to your app\'s data synchronization requirements and server connection protocols, there are a few general tasks your implementation should perform: Connecting to a server Although you can assume that the network is available when your data transfer starts, the sync adapter framework doesn\'t automatically connect to a server.', '11224', '11224_42', '11224_42_4');
INSERT INTO `EntitiesRelation` VALUES (196, 'This notification', 'provides', 'a StorageVolume object', 'Accessing an External Storage Directory', 'https://developer.android.com/training/articles/scoped-directory-access.html', 'This notification provides a StorageVolume object in the intent data that you can use to access directories on the removable media.', '11014', '11014_22', '11014_22_1');
INSERT INTO `EntitiesRelation` VALUES (197, 'the Safetynet API \'s SafetyNet.SafetyNetApi.attest', 'verify', 'the integrity', 'nonce)', 'Abuse detection: Identifying bots and DDoS attacks', 'You can verify that a request comes from a genuine Android device (as opposed to an emulator or other code spoofing another device) using the Safetynet API\'s SafetyNet.SafetyNetApi.attest(mGoogleApiClient, nonce) method to verify the integrity of a device making a request.', '11021', '11021_158', '11021_158_1');
INSERT INTO `EntitiesRelation` VALUES (198, 'application', 'is not using', 'a WebView', 'Printing HTML Documents', 'https://developer.android.com/training/printing/html-docs.html', 'However, if your application is not using a WebView , you can create an instance of the class specifically for printing purposes.', '11187', '11187_10', '11187_10_1');
INSERT INTO `EntitiesRelation` VALUES (199, 'individual content panes', 'can be implemented as', 'Fragment subclasses', 'Group Screens with Multi-pane Layouts', 'https://developer.android.com/training/design-navigation/multiple-sizes.html', 'Implementation Note: While a single screen is implemented as an Activity subclass, individual content panes can be implemented as Fragment subclasses.', '11087', '11087_20', '11087_20_2');
INSERT INTO `EntitiesRelation` VALUES (200, 'that TypedArray objects', 'are', 'a shared resource', 'Apply Custom Attributes', 'https://developer.android.com/training/custom-views/create-view.html', 'Here\'s how the PieChart class reads its attributes: Note that TypedArray objects are a shared resource and must be recycled after use.', '11079', '11079_48', '11079_48_1');
INSERT INTO `EntitiesRelation` VALUES (201, 'the following layout', 'uses', 'a WearableDrawerLayout', 'Wear Navigation and Actions', 'https://developer.android.com/training/wearables/ui/ui-nav-actions.html', 'For example, the following layout uses a WearableDrawerLayout with three child views: a LinearLayout to contain the main content, a navigation drawer, and an action drawer.', '11328', '11328_19', '11328_19_1');
INSERT INTO `EntitiesRelation` VALUES (202, 'the system', 'calls', 'the onDraw', 'Draw your watch face', 'https://developer.android.com/training/wearables/watch-faces/drawing.html', 'When the timer ticks, the handler calls the invalidate() method and the system then calls the onDraw() method to redraw the watch face.', '11335', '11335_28', '11335_28_3');
INSERT INTO `EntitiesRelation` VALUES (203, 'The uiautomatorviewer tool', 'provides', 'a convenient visual interface', 'Inspecting the UI on a device', 'https://developer.android.com/training/testing/ui-testing/uiautomator-testing.html', 'The uiautomatorviewer tool provides a convenient visual interface to inspect the layout hierarchy and view the properties of UI components that are visible on the foreground of the device.', '11255', '11255_21', '11255_21_1');
INSERT INTO `EntitiesRelation` VALUES (204, 'the atomic_store operation', 'is', 'a simple assignment', 'Atomic operations', 'https://developer.android.com/training/articles/smp.html', 'As mentioned earlier, the atomic_store operation is a simple assignment on ARM and x86.', '11020', '11020_297', '11020_297_1');
INSERT INTO `EntitiesRelation` VALUES (205, 'Information', 'is stored in', 'a Transition object', 'Transitions', 'https://developer.android.com/training/transitions/overview.html', 'Information about the animation is stored in a Transition object.', '11261', '11261_45', '11261_45_1');
INSERT INTO `EntitiesRelation` VALUES (206, 'The load/load barrier', 'makes', 'a similar guarantee', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'The load/load barrier in thread 2 makes a similar guarantee for the loads there.', '11020', '11020_149', '11020_149_1');
INSERT INTO `EntitiesRelation` VALUES (207, 'A LinearLayout', 'handled as', 'a compound drawable', 'Optimizing Layout Hierarchies', 'https://developer.android.com/training/improving-layouts/optimizing-layout.html', 'Use compound drawables - A LinearLayout which contains an ImageView and a TextView can be more efficiently handled as a compound drawable.', '11122', '11122_38', '11122_38_1');
INSERT INTO `EntitiesRelation` VALUES (208, 'This class', 'initialize', 'a print job', 'Connect to the Print Manager', 'https://developer.android.com/training/printing/custom-docs.html', 'This class allows you to initialize a print job and begin the printing lifecycle.', '11186', '11186_9', '11186_9_1');
INSERT INTO `EntitiesRelation` VALUES (209, 'the OnboardingFragment', 'appears', 'the first time', 'Introducing First-time Users to Your App', 'https://developer.android.com/training/tv/playback/onboarding.html', 'To ensure that the OnboardingFragment only appears the first time that the user starts your app, use a SharedPreferences object to track whether the user has already viewed the OnboardingFragment.', '11276', '11276_21', '11276_21_1');
INSERT INTO `EntitiesRelation` VALUES (210, 'way', 'is to use', 'the UiModeManager.getCurrentModeType', 'Check for a TV Device', 'https://developer.android.com/training/tv/start/hardware.html', 'The recommended way to determine if your app is running on a TV device is to use the UiModeManager.getCurrentModeType() method to check if the device is running in television mode.', '11280', '11280_10', '11280_10_1');
INSERT INTO `EntitiesRelation` VALUES (211, 'the client app', 'gets', 'the FileDescriptor', 'Access the Requested File', 'https://developer.android.com/training/secure-file-sharing/request-file.html', 'The next snippet demonstrates how the client app handles the Intent sent from the server app, and how the client app gets the FileDescriptor using the content URI: The method openFileDescriptor() returns a ParcelFileDescriptor for the file.', '11207', '11207_17', '11207_17_1');
INSERT INTO `EntitiesRelation` VALUES (212, 'Client apps', 'start', 'this Activity', 'Sharing a File', 'https://developer.android.com/training/secure-file-sharing/share-file.html', 'Client apps start this Activity by calling startActivityForResult() with an Intent containing the action ACTION_PICK.', '11210', '11210_9', '11210_9_1');
INSERT INTO `EntitiesRelation` VALUES (213, 'The scrollTo', 'be used in', 'method', 'Espresso lists', 'https://developer.android.com/training/testing/espresso/lists.html', 'The scrollTo() method can t be used in this case because it requires an existing view.', '11245', '11245_4', '11245_4_1');
INSERT INTO `EntitiesRelation` VALUES (214, 'mCurrentViewport', 'represents', 'the portion', 'Implement Touch-Based Scrolling', 'https://developer.android.com/training/gestures/scroll.html', 'mCurrentViewport represents the portion of the chart that is currently visible in the screen.', '11104', '11104_42', '11104_42_1');
INSERT INTO `EntitiesRelation` VALUES (215, 'The print output', 'requires', 'precise control', 'Connect to the Print Manager', 'https://developer.android.com/training/printing/custom-docs.html', 'The print output for these types of applications requires precise control of everything that goes into a page, including fonts, text flow, page breaks, headers, footers, and graphic elements.', '11186', '11186_3', '11186_3_1');
INSERT INTO `EntitiesRelation` VALUES (216, 'the sync adapter framework', 'can run', 'the data transfer', 'Declare the Sync Adapter in the Manifest', 'https://developer.android.com/training/sync-adapters/creating-sync-adapter.html', 'Instead, it encapsulates your data transfer code, so that the sync adapter framework can run the data transfer in the background, without involvement from your app.', '11224', '11224_28', '11224_28_1');
INSERT INTO `EntitiesRelation` VALUES (217, 'ELAPSED_REALTIME_WAKEUP', 'Wakes', 'the device', 'Choose an alarm type', 'https://developer.android.com/training/scheduling/alarms.html', 'ELAPSED_REALTIME_WAKEUP  Wakes up the device and fires the pending intent after the specified length of time has elapsed since device boot.', '11199', '11199_75', '11199_75_1');
INSERT INTO `EntitiesRelation` VALUES (218, 'Palette.Swatch objects', 'contain', 'population', 'Selecting Colors with the Palette API', 'https://developer.android.com/training/material/palette-colors.html', 'Palette.Swatch objects contain the associated color for that profile, as well as the color s population in pixels.', '11149', '11149_53', '11149_53_2');
INSERT INTO `EntitiesRelation` VALUES (219, 'all activities', 'have', 'an ActionBar', 'Setting Up the App Bar', 'https://developer.android.com/training/appbar/setting-up.html', 'Beginning with Android 3.0 (API level 11), all activities that use the default theme have an ActionBar as an app bar.', '11006', '11006_6', '11006_6_1');
INSERT INTO `EntitiesRelation` VALUES (220, 'the data', 'is read with', 'a reservation', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'To perform an LL/SC, the data is read with a reservation, modified, and then a conditional store instruction is used to try to write the data back.', '11020', '11020_256', '11020_256_2');
INSERT INTO `EntitiesRelation` VALUES (221, 'the View class', 'throws', 'a runtime exception', 'Handle Layout Events', 'https://developer.android.com/training/custom-views/custom-drawing.html', 'If you omit this call, the View class throws a runtime exception.', '11080', '11080_48', '11080_48_1');
INSERT INTO `EntitiesRelation` VALUES (222, 'method', 'takes', 'a PrintAttributes object', 'Connect to the Print Manager', 'https://developer.android.com/training/printing/custom-docs.html', 'Note: The last parameter in the print() method takes a PrintAttributes object.', '11186', '11186_13', '11186_13_1');
INSERT INTO `EntitiesRelation` VALUES (223, 'The user', 'sees', 'this Activity', 'Set Up a Regular Activity PendingIntent', 'https://developer.android.com/training/notify-user/navigation.html', 'Special activity The user only sees this Activity if it\'s started from a notification.', '11176', '11176_6', '11176_6_1');
INSERT INTO `EntitiesRelation` VALUES (224, 'Thread objects', 'are controlled by', 'the system', 'Interrupt Running Code', 'https://developer.android.com/training/multiple-threads/run-code.html', 'Notice that Thread objects are controlled by the system, which can modify them outside of your app\'s process.', '11166', '11166_21', '11166_21_1');
INSERT INTO `EntitiesRelation` VALUES (225, 'these files', 'have', 'sw600dp selectors', 'Use the Smallest-width Qualifier', 'https://developer.android.com/training/multiscreen/screensizes.html', 'Since these files have large and sw600dp selectors, they are applied to tablets and TVs regardless of Android version (pre-3.2 tablets and TVs match large , and post-3.2 will match sw600dp ).', '11170', '11170_60', '11170_60_1');
INSERT INTO `EntitiesRelation` VALUES (226, 'the RECEIVE_COMPLICATION_DATA permission', 'must be granted for', 'providers', 'Setting default providers', 'https://developer.android.com/training/wearables/watch-faces/complications.html', 'For most providers, the RECEIVE_COMPLICATION_DATA permission must be granted to a watch face before data can flow to it.', '11332', '11332_109', '11332_109_1');
INSERT INTO `EntitiesRelation` VALUES (227, 'The JNI_OnLoad function', 'should look', 'something', 'Native Libraries', 'https://developer.android.com/training/articles/perf-jni.html', 'The JNI_OnLoad function should look something like this if written in C++: You can also call System.load with the full path name of the shared library.', '11012', '11012_171', '11012_171_1');
INSERT INTO `EntitiesRelation` VALUES (228, 'a JobScheduler object', 'activates', 'MyJobService', 'Scheduling with constraints', 'https://developer.android.com/training/wearables/data-layer/network-access.html', 'In the example below, a JobScheduler object activates MyJobService when the following constraints are met:.', '11315', '11315_94', '11315_94_1');
INSERT INTO `EntitiesRelation` VALUES (229, 'This directive', 'assigns', 'the alias custom', 'Define Custom Attributes', 'https://developer.android.com/training/custom-views/create-view.html', 'This directive assigns the alias custom to the namespace http://schemas.android.com/apk/res/com.example.customviews.', '11079', '11079_31', '11079_31_1');
INSERT INTO `EntitiesRelation` VALUES (230, 'AXIS_HAT_X', 'include', 'BUTTON_A', 'Process Gamepad Button Presses', 'https://developer.android.com/training/game-controllers/controller-input.html', 'The callouts in the figure refer to the following: AXIS_HAT_X , AXIS_HAT_Y , DPAD_UP , DPAD_DOWN , DPAD_LEFT , DPAD_RIGHT AXIS_X , AXIS_Y , BUTTON_THUMBL AXIS_Z , AXIS_RZ , BUTTON_THUMBR BUTTON_X BUTTON_A BUTTON_Y BUTTON_B BUTTON_R1 AXIS_RTRIGGER , AXIS_THROTTLE AXIS_LTRIGGER , AXIS_BRAKE BUTTON_L1 Common key codes generated by gamepad button presses include BUTTON_A , BUTTON_B , BUTTON_SELECT , and BUTTON_START.', '11096', '11096_47', '11096_47_1');
INSERT INTO `EntitiesRelation` VALUES (231, 'The ViewAssertions class', 'provides', 'a list', 'Verifying Results', 'https://developer.android.com/training/testing/ui-testing/espresso-testing.html', 'The ViewAssertions class provides a list of helper methods for specifying common assertions.', '11253', '11253_105', '11253_105_1');
INSERT INTO `EntitiesRelation` VALUES (232, 'the showAsAction attribute', 'do not need', 'a separate version', 'Check System Version at Runtime', 'https://developer.android.com/training/basics/supporting-devices/platforms.html', 'It\'s safe to do this in a cross-version XML file, because the older versions of Android simply ignore the showAsAction attribute (that is, you do not need a separate version in res/menu-v11/ ).', '11060', '11060_20', '11060_20_1');
INSERT INTO `EntitiesRelation` VALUES (233, 'the service', 'extends', 'IntentService', 'Define an intent service to fetch the address', 'https://developer.android.com/training/location/display-address.html', 'Because the service extends IntentService , it shuts down automatically after all intents are processed.', '11136', '11136_72', '11136_72_1');
INSERT INTO `EntitiesRelation` VALUES (234, 'the News Reader app \'s HeadlinesFragment', 'does precisely for', 'example', 'Reuse Fragments in Other Activities', 'https://developer.android.com/training/multiscreen/adaptui.html', 'You can usually do that by defining an interface that abstracts all the ways in which the fragment needs to interact with its host activity, and then the host activity implements that interface: For example, the News Reader app\'s HeadlinesFragment does precisely that: Then, when the user selects a headline, the fragment notifies the listener specified by the host activity (as opposed to notifying a specific hard-coded activity): This technique is discussed further in the guide to Supporting Tablets and Handsets.', '11167', '11167_21', '11167_21_5');
INSERT INTO `EntitiesRelation` VALUES (235, 'The metadata', 'declares', 'other sync-related flags', 'Declare the Sync Adapter in the Manifest', 'https://developer.android.com/training/sync-adapters/creating-sync-adapter.html', 'The metadata specifies the account type you\'ve created for your sync adapter, declares a content provider authority associated with your app, controls a part of the system user interface related to sync adapters, and declares other sync-related flags.', '11224', '11224_72', '11224_72_3');
INSERT INTO `EntitiesRelation` VALUES (236, 'BasicNetwork', 'is', 'Volley \'s default network implementation', 'Set Up a Network and Cache', 'https://developer.android.com/training/volley/requestqueue.html', 'BasicNetwork is Volley\'s default network implementation.', '11294', '11294_8', '11294_8_1');
INSERT INTO `EntitiesRelation` VALUES (237, 'The sync adapter framework', 'is designed with', 'sync adapter components', 'Declare the Sync Adapter in the Manifest', 'https://developer.android.com/training/sync-adapters/creating-sync-adapter.html', 'Note: The sync adapter framework is designed to work with sync adapter components that are singleton instances.', '11224', '11224_24', '11224_24_1');
INSERT INTO `EntitiesRelation` VALUES (238, 'Sort order', 'do n\'t group', 'Cursor', 'Set up a projection', 'https://developer.android.com/training/contacts-provider/retrieve-details.html', 'Sort order Since you\'re only selecting a single detail type, don\'t group the returned Cursor by Data.MIMETYPE.', '11077', '11077_60', '11077_60_1');
INSERT INTO `EntitiesRelation` VALUES (239, 'Headers', 'using', 'the addHeaderView', 'Matching a header or footer in a list view', 'https://developer.android.com/training/testing/espresso/recipes.html', 'Headers and footers are added to ListViews using the addHeaderView() and addFooterView() methods.', '11246', '11246_39', '11246_39_1');
INSERT INTO `EntitiesRelation` VALUES (240, 'The examples', 'are based on', 'the NotificationCompat.Builder class', 'Building a Notification', 'https://developer.android.com/training/notify-user/build-notification.html', 'The examples in this class are based on the NotificationCompat.Builder class.', '11171', '11171_4', '11171_4_1');
INSERT INTO `EntitiesRelation` VALUES (241, 'The Intent', 'represents', 'intent', 'Build an Intent', 'https://developer.android.com/training/basics/firstapp/starting-activity.html', 'The Intent represents an app s \"intent to do something.\" You can use intents for a wide variety of tasks, but in this lesson, your intent starts another activity.', '11044', '11044_17', '11044_17_1');
INSERT INTO `EntitiesRelation` VALUES (242, 'This example', 'calls', 'the getHintHideIcon', 'Add Wearable Specific-features to a Notification', 'https://developer.android.com/training/wearables/notifications/creating.html', 'This example calls the getHintHideIcon() method to get whether or not this notification hides the icon: Specify Wearable-only Actions.', '11318', '11318_76', '11318_76_1');
INSERT INTO `EntitiesRelation` VALUES (243, 'Descendant navigation', 'is often implemented using', 'an Intent', 'Implementing Descendant Navigation', 'https://developer.android.com/training/implementing-navigation/descendant.html', 'Descendant navigation in this case is often implemented using an Intent that starts an activity representing the detail screen.', '11115', '11115_12', '11115_12_1');
INSERT INTO `EntitiesRelation` VALUES (244, 'the startActivityForResult', 'is protected by', 'a condition', 'Take a Photo with the Camera App', 'https://developer.android.com/training/camera/photobasics.html', 'Notice that the startActivityForResult() method is protected by a condition that calls resolveActivity() , which returns the first activity component that can handle the intent.', '11067', '11067_20', '11067_20_1');
