INSERT INTO `EntitiesRelation` VALUES (540, 'Android Beam file transfer', 'is only available in', 'API level', 'Specify the Files to Send', 'https://developer.android.com/training/beam-files/send-files.html', 'Since Android Beam file transfer is only available in Android 4.1 (API level 16) and later, if your app depends on Android Beam file transfer for a key part of its functionality you must specify the <uses-sdk> element with the android:minSdkVersion =\"16\" attribute.', '11064', '11064_25', '11064_25_1');
INSERT INTO `EntitiesRelation` VALUES (541, 'a camera app', 'might list', 'READ_CONTACTS', 'Don\'t Overwhelm the User', 'https://developer.android.com/training/permissions/usage-notes.html', 'For example, a camera app might list CAMERA , READ_CONTACTS , and ACCESS_FINE_LOCATION in its manifest.', '11180', '11180_72', '11180_72_2');
INSERT INTO `EntitiesRelation` VALUES (542, 'the framework', 'takes', 'the final print document', 'Connect to the Print Manager', 'https://developer.android.com/training/printing/custom-docs.html', 'Once a user taps the print button, the framework takes the final print document and passes it to a print provider for output.', '11186', '11186_21', '11186_21_1');
INSERT INTO `EntitiesRelation` VALUES (543, 'Android Auto', 'commands through', 'MediaSession', 'Build a Browser Service', 'https://developer.android.com/training/auto/audio/index.html', 'Android Auto sends playback control commands through your MediaSession.', '11027', '11027_108', '11027_108_2');
