INSERT INTO `EntitiesRelation` VALUES (546, 'the sample app \'s activity SettingsActivity', 'has', 'an intent filter', 'Implement a Preferences Activity', 'https://developer.android.com/training/basics/network-ops/managing.html', 'As you can see in the manifest excerpt above, the sample app\'s activity SettingsActivity has an intent filter for the ACTION_MANAGE_NETWORK_USAGE action.', '11056', '11056_41', '11056_41_1');
INSERT INTO `EntitiesRelation` VALUES (547, 'This Intent', 'determines', 'the type', 'Define an Intent for geofence transitions', 'https://developer.android.com/training/location/geofencing.html', 'This Intent is received by a service like GeofenceTransitionsIntentService , which obtains the geofencing event from the intent, determines the type of Geofence transition(s), and determines which of the defined geofences was triggered.', '11137', '11137_43', '11137_43_1');
