INSERT INTO `EntitiesRelation` VALUES (549, 'GestureDetector.SimpleOnGestureListener', 'provides', 'an implementation', 'Capturing touch events for an Activity or View', 'https://developer.android.com/training/gestures/detector.html', 'GestureDetector.SimpleOnGestureListener provides an implementation for all of the on <TouchEvent> methods by returning false for all of them.', '11099', '11099_48', '11099_48_1');
