INSERT INTO `EntitiesRelation` VALUES (554, 'Canvas', 'defines', 'shapes', 'Override onDraw()', 'https://developer.android.com/training/custom-views/custom-drawing.html', 'Simply put, Canvas defines shapes that you can draw on the screen, while Paint defines the color, style, font, and so forth of each shape you draw.', '11080', '11080_19', '11080_19_1');
INSERT INTO `EntitiesRelation` VALUES (555, 'method', 'sets', 'a Toolbar', 'Enable the Up Button', 'https://developer.android.com/training/appbar/up-action.html', 'For example, the following onCreate() method sets a Toolbar as the app bar for MyChildActivity , then enables that app bar\'s Up button: You do not need to catch the up action in the activity\'s onOptionsItemSelected() method.', '11007', '11007_16', '11007_16_1');
INSERT INTO `EntitiesRelation` VALUES (556, 'The following example code', 'using', 'the Matrix.frustumM', 'Define a Projection', 'https://developer.android.com/training/graphics/opengl/projection.html', 'The following example code takes the height and width of the GLSurfaceView and uses it to populate a projection transformation Matrix using the Matrix.frustumM() method: This code populates a projection matrix, mProjectionMatrix which you can then combine with a camera view transformation in the onDrawFrame() method, which is shown in the next section.', '11110', '11110_15', '11110_15_4');
INSERT INTO `EntitiesRelation` VALUES (557, 'footers', 'are added to', 'ListViews', 'Matching a header or footer in a list view', 'https://developer.android.com/training/testing/espresso/recipes.html', 'Headers and footers are added to ListViews using the addHeaderView() and addFooterView() methods.', '11246', '11246_39', '11246_39_6');
INSERT INTO `EntitiesRelation` VALUES (558, 'The PieChart example', 'does this in', 'an important optimization', 'Create Drawing Objects', 'https://developer.android.com/training/custom-views/custom-drawing.html', 'The PieChart example does this in a method called init , which is called from the constructor: Creating objects ahead of time is an important optimization.', '11080', '11080_21', '11080_21_1');
INSERT INTO `EntitiesRelation` VALUES (559, 'A proper spin lock implementation', 'spin', 'a few times', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'A proper spin lock implementation would optimistically spin a few times and then fall back on an OS primitive (such as a Linux futex) that allows the current thread to sleep while waiting for the other thread to finish up.', '11020', '11020_285', '11020_285_1');
INSERT INTO `EntitiesRelation` VALUES (560, 'The SharedPreferences APIs', 'are only for', 'reading', 'Saving Key-Value Sets', 'https://developer.android.com/training/basics/data-storage/shared-preferences.html', 'Note: The SharedPreferences APIs are only for reading and writing key-value pairs and you should not confuse them with the Preference APIs, which help you build a user interface for your app settings (although they use SharedPreferences as their implementation to save the app settings).', '11039', '11039_7', '11039_7_1');
INSERT INTO `EntitiesRelation` VALUES (561, 'Both classes', 'are based on', 'the common base class JsonRequest', 'Request JSON', 'https://developer.android.com/training/volley/request.html', 'Both classes are based on the common base class JsonRequest.', '11293', '11293_15', '11293_15_1');
INSERT INTO `EntitiesRelation` VALUES (562, 'Android KeyStore', 'mitigates', 'unauthorized use', 'Using Android Keystore Provider', 'https://developer.android.com/training/articles/keystore.html', 'Secondly, Android KeyStore mitigates unauthorized use of key material on the Android device by making apps specify authorized uses of their keys and then enforcing these restrictions outside of the apps\' processes.', '11010', '11010_11', '11010_11_1');
INSERT INTO `EntitiesRelation` VALUES (563, 'the ProviderInstaller', 'is unable to install', 'Provider', 'Updating Your Security Provider to Protect Against SSL Exploits', 'https://developer.android.com/training/articles/security-gms-provider.html', 'Warning: If the ProviderInstaller is unable to install an updated Provider , your device\'s security provider might be vulnerable to known exploits.', '11016', '11016_29', '11016_29_1');
INSERT INTO `EntitiesRelation` VALUES (564, 'CardView widgets', 'are', 'part', 'Creating Lists and Cards', 'https://developer.android.com/training/material/lists-cards.html', 'The RecyclerView and CardView widgets are part of the v7 Support Libraries.', '11148', '11148_45', '11148_45_2');
INSERT INTO `EntitiesRelation` VALUES (565, 'WebView', 'does not execute', 'JavaScript', 'Using IP networking', 'https://developer.android.com/training/articles/security-tips.html', 'By default, WebView does not execute JavaScript, so cross-site-scripting is not possible.', '11019', '11019_149', '11019_149_1');
