INSERT INTO `EntitiesRelation` VALUES (569, 'the user', 'has already viewed', 'the OnboardingFragment', 'Introducing First-time Users to Your App', 'https://developer.android.com/training/tv/playback/onboarding.html', 'To ensure that the OnboardingFragment only appears the first time that the user starts your app, use a SharedPreferences object to track whether the user has already viewed the OnboardingFragment.', '11276', '11276_21', '11276_21_3');
