INSERT INTO `EntitiesRelation` VALUES (573, 'ComplicationData', 'would be sent to', 'a watch face', 'User interactions with complications', 'https://developer.android.com/training/wearables/watch-faces/complications.html', 'If none of the above is true, then when ComplicationData normally would be sent by a provider to a watch face, the system instead sends data of the type TYPE_NO_PERMISSION.', '11332', '11332_88', '11332_88_3');
