INSERT INTO `EntitiesRelation` VALUES (582, 'The AndroidJUnitRunner class', 'is', 'a JUnit test runner', 'AndroidJUnitRunner', 'https://developer.android.com/training/testing/junit-runner.html', 'Writing JUnit tests Accessing instrumentation information Filtering tests Sharding tests Resources The AndroidJUnitRunner class is a JUnit test runner that lets you run JUnit 3- or JUnit 4-style test classes on Android devices, including those using the Espresso and UI Automator testing frameworks.', '11235', '11235_0', '11235_0_1');
INSERT INTO `EntitiesRelation` VALUES (583, 'this IntentService', 'gets', 'the geofence transition type', 'Creating and Monitoring Geofences', 'https://developer.android.com/training/location/geofencing.html', 'When the user clicks the notification, the app\'s main activity appears: After detecting the transition event via the PendingIntent , this IntentService gets the geofence transition type and tests whether it is one of the events the app uses to trigger notifications -- either GEOFENCE_TRANSITION_ENTER or GEOFENCE_TRANSITION_EXIT in this case.', '11137', '11137_46', '11137_46_2');
