INSERT INTO `EntitiesRelation` VALUES (836, 'ArticleFragment', 'is used for', 'example', 'Reuse Fragments in Other Activities', 'https://developer.android.com/training/multiscreen/adaptui.html', 'For example, ArticleFragment is used in the dual-pane layout: And reused (without a layout) in the activity layout for smaller screens ( ArticleActivity ): Naturally, this has the same effect as declaring the fragment in an XML layout, but in this case an XML layout is unnecessary work because the article fragment is the only component of this activity.', '11167', '11167_19', '11167_19_3');
INSERT INTO `EntitiesRelation` VALUES (837, 'method', 'returns', 'a ViewInteraction object', 'Accessing UI Components', 'https://developer.android.com/training/testing/ui-testing/espresso-testing.html', 'The onView() method returns a ViewInteraction object that allows your test to interact with the view.', '11253', '11253_37', '11253_37_1');
INSERT INTO `EntitiesRelation` VALUES (838, 'CardView', 'falls back to', 'a programmatic shadow implementation', 'Lists and Cards', 'https://developer.android.com/training/material/compatibility.html', 'CardView falls back to a programmatic shadow implementation using additional padding.', '11143', '11143_32', '11143_32_2');
