INSERT INTO `EntitiesRelation` VALUES (840, 'a content URI', 'should provide', 'a file selection Activity', 'Sharing a File', 'https://developer.android.com/training/secure-file-sharing/share-file.html', 'To receive requests for files from client apps and respond with a content URI, your app should provide a file selection Activity.', '11210', '11210_8', '11210_8_1');
INSERT INTO `EntitiesRelation` VALUES (841, 'This intent', 'must be used with', 'startActivityForResult', 'Opening the provider chooser', 'https://developer.android.com/training/wearables/watch-faces/complications.html', 'This intent must be used with startActivityForResult().', '11332', '11332_54', '11332_54_1');
