INSERT INTO `EntitiesRelation` VALUES (844, 'an onView', 'throws', 'a NoMatchingViewException', 'Finding a view', 'https://developer.android.com/training/testing/espresso/basics.html', 'When an onView() operation throws a NoMatchingViewException and AdapterView widgets are present in the view hierarchy, the most common solution is to use onData().', '11240', '11240_104', '11240_104_1');
