INSERT INTO `EntitiesRelation` VALUES (847, 'the Canvas object', 'place', 'print elements', 'Connect to the Print Manager', 'https://developer.android.com/training/printing/custom-docs.html', 'Tip: While the Canvas object allows you to place print elements on the edge of a PDF document, many printers are not able to print to the edge of a physical piece of paper.', '11186', '11186_72', '11186_72_1');
INSERT INTO `EntitiesRelation` VALUES (848, 'ArticleFragment', 'reused', 'the activity layout', 'Reuse Fragments in Other Activities', 'https://developer.android.com/training/multiscreen/adaptui.html', 'For example, ArticleFragment is used in the dual-pane layout: And reused (without a layout) in the activity layout for smaller screens ( ArticleActivity ): Naturally, this has the same effect as declaring the fragment in an XML layout, but in this case an XML layout is unnecessary work because the article fragment is the only component of this activity.', '11167', '11167_19', '11167_19_6');
INSERT INTO `EntitiesRelation` VALUES (849, 'the message', 'contains', 'some text', 'Return the address to the requestor', 'https://developer.android.com/training/location/display-address.html', 'In the case of a failure, the message contains some text describing the reason for the failure.', '11136', '11136_65', '11136_65_1');
INSERT INTO `EntitiesRelation` VALUES (850, 'intent', 'has', 'extra media_connection_status', 'Determine if Your App is Connected', 'https://developer.android.com/training/auto/audio/index.html', 'The broadcasted intent has a String extra media_connection_status , that contains either media_connected or media_disconnected string that represents the current connection status.', '11027', '11027_48', '11027_48_1');
INSERT INTO `EntitiesRelation` VALUES (851, 'API level', 'extends', 'the ConnectivityManager API', 'Optimizing Network Data Usage', 'https://developer.android.com/training/basics/network-ops/data-saver.html', 'Android 7.0 (API level 24) extends the ConnectivityManager API to provide apps with a way to retrieve the user s Data Saver preferences and monitor preference changes.', '11054', '11054_8', '11054_8_1');
INSERT INTO `EntitiesRelation` VALUES (852, 'The MotionEvent object', 'contains', 'multiple historical positions', 'Handling Controller Actions', 'https://developer.android.com/training/game-controllers/controller-input.html', 'The MotionEvent object contains the current position for each joystick axis as well as multiple historical positions for each axis.', '11096', '11096_85', '11096_85_2');
INSERT INTO `EntitiesRelation` VALUES (853, 'the notification action', 'has', 'a RemoteInput', 'Smart Reply', 'https://developer.android.com/training/wearables/notifications/noti-styles.html', 'Ensure that the notification action has a RemoteInput (where the responses will reside).', '11320', '11320_19', '11320_19_1');
INSERT INTO `EntitiesRelation` VALUES (854, 'an onView', 'throws', 'AdapterView widgets', 'Finding a view', 'https://developer.android.com/training/testing/espresso/basics.html', 'When an onView() operation throws a NoMatchingViewException and AdapterView widgets are present in the view hierarchy, the most common solution is to use onData().', '11240', '11240_104', '11240_104_3');
INSERT INTO `EntitiesRelation` VALUES (855, 'the channel', 'follow', 'the guidelines', 'Register Channels in the Database', 'https://developer.android.com/training/tv/tif/channel.html', 'To make sure the channel and program information works with the system TV app\'s channel and program information presenter, follow the guidelines below.', '11285', '11285_20', '11285_20_1');
