INSERT INTO `EntitiesRelation` VALUES (858, 'The nested LinearLayout', 'serves', 'no real purpose', 'Use the <merge> Tag', 'https://developer.android.com/training/improving-layouts/reusing-layouts.html', 'The nested LinearLayout serves no real purpose other than to slow down your UI performance.', '11123', '11123_21', '11123_21_1');
