INSERT INTO `EntitiesRelation` VALUES (860, 'a FileProvider', 'determines', 'the file \'s MIME type', 'Retrieving File Information', 'https://developer.android.com/training/secure-file-sharing/retrieve-info.html', 'By default, a FileProvider determines the file\'s MIME type from its filename extension.', '11208', '11208_10', '11208_10_1');
INSERT INTO `EntitiesRelation` VALUES (861, 'The complete fix', 'requires', 'a barrier', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'The complete fix also requires a barrier after the load: Now we know the ordering will be correct.', '11020', '11020_366', '11020_366_1');
INSERT INTO `EntitiesRelation` VALUES (862, 'The system', 'does not show', 'multiple Snackbar objects', 'Building and Displaying a Pop-Up Message', 'https://developer.android.com/training/snackbar/showing.html', 'Once you have created the Snackbar , call its show() method to display the Snackbar to the user: The system does not show multiple Snackbar objects at the same time, so if the view is currently displaying another Snackbar , the system queues your Snackbar and displays it after the current Snackbar expires or is dismissed.', '11218', '11218_34', '11218_34_1');
INSERT INTO `EntitiesRelation` VALUES (863, 'Volley', 'provides', 'a convenience method Volley.newRequestQueue', 'Sending a Simple Request', 'https://developer.android.com/training/volley/simple.html', 'Volley provides a convenience method Volley.newRequestQueue that sets up a RequestQueue for you, using default values, and starts the queue.', '11295', '11295_12', '11295_12_1');
INSERT INTO `EntitiesRelation` VALUES (864, 'That notification', 'is associated with', 'a CarExtender object', 'Sending Messages', 'https://developer.android.com/training/auto/messaging/index.html', 'That notification is associated with a CarExtender object, which indicates that the notification can be handled by Android Auto.', '11028', '11028_47', '11028_47_1');
INSERT INTO `EntitiesRelation` VALUES (865, 'a shared preferences', 'file with', 'MODE_WORLD_READABLE', 'Get a Handle to a SharedPreferences', 'https://developer.android.com/training/basics/data-storage/shared-preferences.html', 'When naming your shared preference files, you should use a name that\'s uniquely identifiable to your app, such as \"com.example.myapp.PREFERENCE_FILE_KEY\" Alternatively, if you need just one shared preference file for your activity, you can use the getPreferences() method: Caution: If you create a shared preferences file with MODE_WORLD_READABLE or MODE_WORLD_WRITEABLE , then any other apps that know the file identifier can access your data.', '11039', '11039_17', '11039_17_2');
INSERT INTO `EntitiesRelation` VALUES (866, 'The following snippet', 'uses', 'nested GeofencingRequestBuilder class', 'Specify geofences and initial triggers', 'https://developer.android.com/training/location/geofencing.html', 'The following snippet uses the GeofencingRequest class and its nested GeofencingRequestBuilder class to specify the geofences to monitor and to set how related geofence events are triggered: This example shows the use of two geofence triggers.', '11137', '11137_27', '11137_27_2');
INSERT INTO `EntitiesRelation` VALUES (867, 'An existing way', 'prevent bridging is with', 'the Notification.Builder class', 'Existing Method of Preventing Bridging', 'https://developer.android.com/training/wearables/notifications/bridger.html', 'An existing way to prevent bridging is with the Notification.Builder class; specify true in the setLocalOnly method.', '11316', '11316_29', '11316_29_1');
INSERT INTO `EntitiesRelation` VALUES (868, 'GuidedStepFragment', 'uses', 'practices', 'Adding a Guided Step', 'https://developer.android.com/training/tv/playback/guided-step.html', 'GuidedStepFragment uses TV UI best practices to make multi-step tasks easy to understand and navigate on TV devices.', '11273', '11273_8', '11273_8_1');
INSERT INTO `EntitiesRelation` VALUES (869, 'The configuration activity', 'must return', 'RESULT_CANCELED', 'Provider configuration', 'https://developer.android.com/training/wearables/watch-faces/complications.html', 'The configuration activity must return RESULT_OK or RESULT_CANCELED , to tell the system whether the provider should be set.', '11332', '11332_159', '11332_159_2');
INSERT INTO `EntitiesRelation` VALUES (870, 'Type', 'select', 'the TrivialDrive_v2 sample', 'Download the sample app', 'https://developer.android.com/training/play-billing-library/preparing-iab-app.html', 'Type Trivial Drive into the search bar and select the TrivialDrive_v2 sample.', '11183', '11183_13', '11183_13_1');
INSERT INTO `EntitiesRelation` VALUES (871, 'SHORT_TEXT', 'may be', 'a single piece', 'Using and Testing Complication Types', 'https://developer.android.com/training/wearables/watch-faces/complications.html', 'For example, SHORT_TEXT may be just a single piece of text, or a title and text, or an icon and text.', '11332', '11332_176', '11332_176_1');
INSERT INTO `EntitiesRelation` VALUES (872, 'Android 4.4 Immersive Mode Android', 'introduces', 'a new SYSTEM_UI_FLAG_IMMERSIVE flag', 'Using Immersive Full-Screen Mode', 'https://developer.android.com/training/system-ui/immersive.html', 'DevBytes: Android 4.4 Immersive Mode Android 4.4 (API Level 19) introduces a new SYSTEM_UI_FLAG_IMMERSIVE flag for setSystemUiVisibility() that lets your app go truly \"full screen.\" This flag, when combined with the SYSTEM_UI_FLAG_HIDE_NAVIGATION and SYSTEM_UI_FLAG_FULLSCREEN flags, hides the navigation and status bars and lets your app capture all touch events on the screen.', '11228', '11228_5', '11228_5_1');
INSERT INTO `EntitiesRelation` VALUES (873, 'the authority', 'is', 'com.example.myapp.fileprovider', 'Specify the FileProvider', 'https://developer.android.com/training/secure-file-sharing/setup-sharing.html', 'In the example, the authority is com.example.myapp.fileprovider.', '11209', '11209_12', '11209_12_1');
