INSERT INTO `EntitiesRelation` VALUES (875, 'the user', 'can invoke', 'the PendingIntent', 'Create a Notification with the Notification Builder', 'https://developer.android.com/training/wearables/notifications/creating.html', 'When this notification appears on a handheld device, the user can invoke the PendingIntent specified by the setContentIntent() method by touching the notification.', '11318', '11318_15', '11318_15_1');
