INSERT INTO `EntitiesRelation` VALUES (877, 'AXIS_HAT_X', 'include', 'BUTTON_START', 'Process Gamepad Button Presses', 'https://developer.android.com/training/game-controllers/controller-input.html', 'The callouts in the figure refer to the following: AXIS_HAT_X , AXIS_HAT_Y , DPAD_UP , DPAD_DOWN , DPAD_LEFT , DPAD_RIGHT AXIS_X , AXIS_Y , BUTTON_THUMBL AXIS_Z , AXIS_RZ , BUTTON_THUMBR BUTTON_X BUTTON_A BUTTON_Y BUTTON_B BUTTON_R1 AXIS_RTRIGGER , AXIS_THROTTLE AXIS_LTRIGGER , AXIS_BRAKE BUTTON_L1 Common key codes generated by gamepad button presses include BUTTON_A , BUTTON_B , BUTTON_SELECT , and BUTTON_START.', '11096', '11096_47', '11096_47_4');
INSERT INTO `EntitiesRelation` VALUES (878, 'the string', 'contains', 'the error message', 'Return the address to the requestor', 'https://developer.android.com/training/location/display-address.html', 'In the case of a failure, the string contains the error message, as shown in this code sample: Return the address to the requestor.', '11136', '11136_60', '11136_60_1');
