INSERT INTO `EntitiesRelation` VALUES (883, 'The Android way', 'is to invoke', 'an Intent', 'Record a Video with a Camera App', 'https://developer.android.com/training/camera/videobasics.html', 'The Android way of delegating actions to other applications is to invoke an Intent that describes what you want done.', '11068', '11068_15', '11068_15_1');
