INSERT INTO `EntitiesRelation` VALUES (887, 'proxying method', 'calls to', 'the ActionBar API', 'Implement TabHelperHoneycomb', 'https://developer.android.com/training/backward-compatible-ui/new-implementation.html', 'Implement TabHelperHoneycomb , proxying method calls to the ActionBar API:.', '11033', '11033_20', '11033_20_1');
