INSERT INTO `EntitiesRelation` VALUES (889, 'The RecyclerView class', 'simplifies', 'handling', 'Creating Lists and Cards', 'https://developer.android.com/training/material/lists-cards.html', 'The RecyclerView class simplifies the display and handling of large data sets by providing:.', '11148', '11148_8', '11148_8_2');
