INSERT INTO `EntitiesRelation` VALUES (891, 'The InteractiveChart sample app', 'displays', 'a chart', 'Animating a Scroll Gesture', 'https://developer.android.com/training/gestures/scroll.html', 'Note: The InteractiveChart sample app displays a chart that you can zoom, pan, scroll, and so on.', '11104', '11104_39', '11104_39_1');
