INSERT INTO `EntitiesRelation` VALUES (893, 'The UI Automator testing framework', 'launch', 'an Activity', 'Testing UI for Multiple Apps', 'https://developer.android.com/training/testing/ui-testing/uiautomator-testing.html', 'The UI Automator testing framework allows you to send an Intent or launch an Activity without using shell commands, by getting a Context object through getContext().', '11255', '11255_88', '11255_88_2');
INSERT INTO `EntitiesRelation` VALUES (894, 'The AndroidJUnitRunner class', 'requires', 'Android', 'AndroidJUnitRunner', 'https://developer.android.com/training/testing/junit-runner.html', 'Note: The AndroidJUnitRunner class requires Android 2.2 (API level 8) or higher.', '11235', '11235_1', '11235_1_1');
INSERT INTO `EntitiesRelation` VALUES (895, 'this metadata', 'is for', 'the sync adapter framework', 'Declare the Sync Adapter in the Manifest', 'https://developer.android.com/training/sync-adapters/creating-sync-adapter.html', 'The android:name attribute indicates that this metadata is for the sync adapter framework.', '11224', '11224_113', '11224_113_1');
INSERT INTO `EntitiesRelation` VALUES (896, 'BB', 'will be full at', 'the end', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'At the end of execution, AA and BB will be full of gradually-increasing integers.', '11020', '11020_501', '11020_501_2');
INSERT INTO `EntitiesRelation` VALUES (897, 'post-3 .2', 'will match', 'sw600dp', 'Use the Smallest-width Qualifier', 'https://developer.android.com/training/multiscreen/screensizes.html', 'Since these files have large and sw600dp selectors, they are applied to tablets and TVs regardless of Android version (pre-3.2 tablets and TVs match large , and post-3.2 will match sw600dp ).', '11170', '11170_60', '11170_60_2');
