INSERT INTO `EntitiesRelation` VALUES (902, 'a shared preferences', 'file with', 'MODE_WORLD_WRITEABLE', 'Get a Handle to a SharedPreferences', 'https://developer.android.com/training/basics/data-storage/shared-preferences.html', 'When naming your shared preference files, you should use a name that\'s uniquely identifiable to your app, such as \"com.example.myapp.PREFERENCE_FILE_KEY\" Alternatively, if you need just one shared preference file for your activity, you can use the getPreferences() method: Caution: If you create a shared preferences file with MODE_WORLD_READABLE or MODE_WORLD_WRITEABLE , then any other apps that know the file identifier can access your data.', '11039', '11039_17', '11039_17_3');
INSERT INTO `EntitiesRelation` VALUES (903, 'descendant navigation', 'is usually implemented using', 'a FragmentTransaction', 'Implementing Descendant Navigation', 'https://developer.android.com/training/implementing-navigation/descendant.html', 'Here, descendant navigation is usually implemented using a FragmentTransaction that adds, removes, or replaces the detail pane with new content.', '11115', '11115_14', '11115_14_1');
INSERT INTO `EntitiesRelation` VALUES (904, 'the framework', 'starts', 'this Service', 'Creating a Stub Authenticator', 'https://developer.android.com/training/sync-adapters/creating-authenticator.html', 'Since the framework starts this Service the first time it needs to access the authenticator, you can also use the service to instantiate the authenticator, by calling the authenticator constructor in the Service.onCreate() method of the service.', '11222', '11222_17', '11222_17_1');
INSERT INTO `EntitiesRelation` VALUES (905, 'TvInputService', 'provides', 'background availability', 'Declare your TV input service in the manifest', 'https://developer.android.com/training/tv/tif/tvinput.html', 'TvInputService provides long-running and background availability for the TV input TvInputService.Session maintains the TV input state and communicates with the hosting app TvContract describes the channels and programs available to the TV input TvContract.Channels represents information about a TV channel TvContract.Programs describes a TV program with data such as program title and start time TvTrackInfo represents an audio, video, or subtitle track TvContentRating describes a content rating, allows for custom content rating schemes TvInputManager provides an API to the system TV app and manages the interaction with TV inputs and apps.', '11289', '11289_71', '11289_71_1');
INSERT INTO `EntitiesRelation` VALUES (906, 'The configuration activity', 'must return', 'RESULT_OK', 'Opening the provider chooser', 'https://developer.android.com/training/wearables/watch-faces/complications.html', 'The configuration activity must return RESULT_OK or RESULT_CANCELED , to tell the system whether the provider should be set.', '11332', '11332_159', '11332_159_1');
INSERT INTO `EntitiesRelation` VALUES (907, 'that jfieldID s', 'are', 'opaque types', 'Local and Global References', 'https://developer.android.com/training/articles/perf-jni.html', 'Note that jfieldID s and jmethodID s are opaque types, not object references, and should not be passed to NewGlobalRef.', '11012', '11012_63', '11012_63_1');
INSERT INTO `EntitiesRelation` VALUES (908, 'intent filter declarations', 'include', 'the android.intent.action.VIEW intent action', 'Create an Intent Handler for URIs', 'https://developer.android.com/training/app-links/index.html', 'To enable the system to verify a host, make sure that your intent filter declarations include the android.intent.action.VIEW intent action and android.intent.category.BROWSABLE intent category.', '11002', '11002_38', '11002_38_1');
INSERT INTO `EntitiesRelation` VALUES (909, 'The next steps', 'are accessing', 'the PrintManager', 'Create a Print Job', 'https://developer.android.com/training/printing/html-docs.html', 'The next steps are accessing the PrintManager , creating a print adapter, and finally, creating a print job.', '11187', '11187_28', '11187_28_1');
INSERT INTO `EntitiesRelation` VALUES (910, 'The RequestQueue', 'manages', 'worker threads', 'Sending a Simple Request', 'https://developer.android.com/training/volley/simple.html', 'The RequestQueue manages worker threads for running the network operations, reading from and writing to the cache, and parsing responses.', '11295', '11295_3', '11295_3_1');
INSERT INTO `EntitiesRelation` VALUES (911, 'OnboardingFragment', 'attached to', 'the parent activity', 'Introducing First-time Users to Your App', 'https://developer.android.com/training/tv/playback/onboarding.html', 'Initialize page information when your OnboardingFragment is first created or attached to the parent activity, as the system requests page information when it creates the fragment\'s view.', '11276', '11276_42', '11276_42_1');
INSERT INTO `EntitiesRelation` VALUES (912, 'Activity', 'implement', 'the DownloadCallback interface', 'Introducing Network Operations on a Separate Thread', 'https://developer.android.com/training/basics/network-ops/connecting.html', 'Your Activity should also implement the DownloadCallback interface, allowing the fragment to call back to the Activity in case it needs connectivity status or needs to send an update back to the UI.', '11053', '11053_18', '11053_18_1');
INSERT INTO `EntitiesRelation` VALUES (913, 'BB', 'will be full of', 'gradually-increasing integers', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'At the end of execution, AA and BB will be full of gradually-increasing integers.', '11020', '11020_501', '11020_501_4');
INSERT INTO `EntitiesRelation` VALUES (914, 'MyViewGroup', 'should handle', 'touch events', 'Intercept Touch Events in a ViewGroup', 'https://developer.android.com/training/gestures/viewgroup.html', 'If you drag your finger across a child view horizontally, the child view should no longer get touch events, and MyViewGroup should handle touch events by scrolling its contents.', '11105', '11105_14', '11105_14_2');
INSERT INTO `EntitiesRelation` VALUES (915, 'some themes', 'set', 'an ActionBar', 'Adding the App Bar', 'https://developer.android.com/training/appbar/index.html', 'There are other ways to implement an app bar for example, some themes set up an ActionBar as an app bar by default but using the appcompat Toolbar makes it easy to set up an app bar that works on the widest range of devices, and also gives you room to customize your app bar later on as your app develops.', '11005', '11005_11', '11005_11_1');
INSERT INTO `EntitiesRelation` VALUES (916, 'ComponentName.flattenToString', 'can be', 'package names', 'Receiving complication data', 'https://developer.android.com/training/wearables/watch-faces/complications.html', 'Entries in the list can be component names (of WatchFaceServices , given as if ComponentName.flattenToString() had been called), or they can be package names (of apps, in which case every watch face within a specified app is considered safe).', '11332', '11332_103', '11332_103_2');
INSERT INTO `EntitiesRelation` VALUES (917, 'BB', 'are', 'ordinary integer arrays', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'Where a and b are declared as volatile int fields, and AA and BB are ordinary integer arrays.', '11020', '11020_498', '11020_498_2');
INSERT INTO `EntitiesRelation` VALUES (918, 'The NetworkCallback interface', 'has', 'methods', 'Acquiring a High-Bandwidth Network', 'https://developer.android.com/training/wearables/data-layer/network-access.html', 'The NetworkCallback interface has methods for monitoring state changes to the bound network, such as bandwidth changes and connectivity loss.', '11315', '11315_42', '11315_42_1');
INSERT INTO `EntitiesRelation` VALUES (919, 'The LOOKUP_KEY column', 'is described in', 'detail', 'Retrieve All Details for a Contact', 'https://developer.android.com/training/contacts-provider/retrieve-details.html', 'The LOOKUP_KEY column is described in more detail in the Retrieving Contact Names lesson.', '11077', '11077_12', '11077_12_1');
INSERT INTO `EntitiesRelation` VALUES (920, 'the SMS group', 'includes', 'the READ_SMS', 'Permission Groups', 'https://developer.android.com/training/articles/user-data-overview.html', 'Under this system, permission requests are handled at the group level and a single permission group corresponds to several permission declarations in the app manifest; for example, the SMS group includes both the READ_SMS and the RECEIVE_SMS declarations.', '11022', '11022_13', '11022_13_1');
INSERT INTO `EntitiesRelation` VALUES (921, 'ActivityTestRule ServiceTestRule The Android Testing Support Library', 'includes', 'a set', 'JUnit4 Rules with Testing Support Library', 'https://developer.android.com/training/testing/junit-rules.html', 'ActivityTestRule ServiceTestRule The Android Testing Support Library includes a set of JUnit rules to be used with the AndroidJUnitRunner.', '11234', '11234_0', '11234_0_1');
INSERT INTO `EntitiesRelation` VALUES (922, 'This Intent', 'is passed to', 'the client app', 'Send a Request for the File', 'https://developer.android.com/training/secure-file-sharing/request-file.html', 'This Intent is passed to the client app in its override of onActivityResult().', '11207', '11207_11', '11207_11_1');
INSERT INTO `EntitiesRelation` VALUES (923, 'The system', 'calls', 'onRequestPermissionsResult', 'Handle the permissions request response', 'https://developer.android.com/training/permissions/requesting.html', 'The system calls your onRequestPermissionsResult() callback method and passes PERMISSION_DENIED , the same way it would if the user had explicitly rejected your request again.', '11179', '11179_76', '11179_76_1');
INSERT INTO `EntitiesRelation` VALUES (924, 'the view', 'is also assignable from', 'TextView', 'View assertion simple test', 'https://developer.android.com/training/testing/espresso/basics.html', 'For example, if a view is uniquely identifiable by its text, you need not specify that the view is also assignable from TextView.', '11240', '11240_44', '11240_44_2');
INSERT INTO `EntitiesRelation` VALUES (925, 'The Keystore system', 'is used by', 'the KeyChain API', 'Android Keystore System', 'https://developer.android.com/training/articles/keystore.html', 'The Keystore system is used by the KeyChain API as well as the Android Keystore provider feature that was introduced in Android 4.3 (API level 18).', '11010', '11010_6', '11010_6_1');
INSERT INTO `EntitiesRelation` VALUES (926, 'the onPlayFromSearch', 'results such_as', 'Play jazz', 'Parse the voice query to build the playback queue', 'https://developer.android.com/training/auto/audio/index.html', 'When a user searches for a specific criteria, such as  Play jazz on [your app name]  or  Listen to [song title]  , the onPlayFromSearch() callback method receives the voice search results in the query parameter and an extras bundle.', '11027', '11027_179', '11027_179_2');
INSERT INTO `EntitiesRelation` VALUES (927, 'use PagerAdapter', 's as', 'a supply', 'Add a ViewPager', 'https://developer.android.com/training/animation/screen-slide.html', 'ViewPager s use PagerAdapter s as a supply for new pages to display, so the PagerAdapter will use the fragment class that you created earlier.', '10997', '10997_15', '10997_15_2');
INSERT INTO `EntitiesRelation` VALUES (928, 'Android Auto', 'calls', 'the browser service \'s onGetRoot', 'Building your content hierarchy', 'https://developer.android.com/training/auto/audio/index.html', 'Android Auto calls the browser service\'s onGetRoot() method to get the top node of your content hierarchy.', '11027', '11027_70', '11027_70_1');
INSERT INTO `EntitiesRelation` VALUES (929, 'The Canvas class', 'defines', 'methods', 'Override onDraw()', 'https://developer.android.com/training/custom-views/custom-drawing.html', 'The Canvas class defines methods for drawing text, lines, bitmaps, and many other graphics primitives.', '11080', '11080_10', '11080_10_1');
INSERT INTO `EntitiesRelation` VALUES (930, 'grantUriPermissions', 'using', 'the FLAG_GRANT_READ_URI_PERMISSION', 'Using content providers', 'https://developer.android.com/training/articles/security-tips.html', 'Content providers can also provide more granular access by declaring the android:grantUriPermissions attribute and using the FLAG_GRANT_READ_URI_PERMISSION and FLAG_GRANT_WRITE_URI_PERMISSION flags in the Intent object that activates the component.', '11019', '11019_43', '11019_43_2');
INSERT INTO `EntitiesRelation` VALUES (931, 'phone app', 'can use', 'the CapabilityApi', 'Detecting Your App on Another Device', 'https://developer.android.com/training/wearables/apps/standalone-apps.html', 'Your phone app or watch app can use the CapabilityApi to advertise the app\'s presence to a paired device.', '11307', '11307_39', '11307_39_1');
INSERT INTO `EntitiesRelation` VALUES (932, 'a ViewGroup', 'receives', 'a MotionEvent', 'Managing Touch Events in a ViewGroup', 'https://developer.android.com/training/gestures/viewgroup.html', 'If a ViewGroup receives a MotionEvent with an ACTION_OUTSIDE , the event will not be dispatched to its children by default.', '11105', '11105_20', '11105_20_1');
INSERT INTO `EntitiesRelation` VALUES (933, 'the data layer', 'sends', 'data', 'Using filters with WearableListenerService', 'https://developer.android.com/training/wearables/data-layer/events.html', 'Because the data layer synchronizes and sends data across the handheld and wearable, it is usually necessary to listen for important events.', '11312', '11312_14', '11312_14_1');
INSERT INTO `EntitiesRelation` VALUES (934, 'A GuidedStepFragment', 'represents', 'a single step', 'Adding a Guided Step', 'https://developer.android.com/training/tv/playback/guided-step.html', 'A GuidedStepFragment represents a single step in a series of steps.', '11273', '11273_10', '11273_10_1');
INSERT INTO `EntitiesRelation` VALUES (935, 'CardView', 'does not clip', 'children views', 'Lists and Cards', 'https://developer.android.com/training/material/compatibility.html', 'CardView does not clip its children views that intersect with rounded corners.', '11143', '11143_33', '11143_33_1');
INSERT INTO `EntitiesRelation` VALUES (936, 'the IabHelper', 'completes', 'the asynchronous setup operation', 'Initiate a Connection with Google Play', 'https://developer.android.com/training/in-app-billing/preparing-iab-app.html', 'Pass the method an OnIabSetupFinishedListener instance, which is called once the IabHelper completes the asynchronous setup operation.', '11127', '11127_66', '11127_66_1');
INSERT INTO `EntitiesRelation` VALUES (937, 'the Snackbar', 'is attached to', 'a CoordinatorLayout', 'Building and Displaying a Pop-Up Message', 'https://developer.android.com/training/snackbar/showing.html', 'However, if the Snackbar is attached to a CoordinatorLayout , the Snackbar gains additional features:.', '11218', '11218_10', '11218_10_1');
INSERT INTO `EntitiesRelation` VALUES (938, 'an app link', 'needs to match', 'channel changes', 'Register Channels in the Database', 'https://developer.android.com/training/tv/tif/channel.html', 'You can update these app link details at any point, so if an app link needs to match channel changes, update app link details and call ContentResolver.update() as needed.', '11285', '11285_82', '11285_82_1');
INSERT INTO `EntitiesRelation` VALUES (939, 'the handler', 'calls', 'the invalidate', 'Declare variables', 'https://developer.android.com/training/wearables/watch-faces/drawing.html', 'When the timer ticks, the handler calls the invalidate() method and the system then calls the onDraw() method to redraw the watch face.', '11335', '11335_28', '11335_28_1');
INSERT INTO `EntitiesRelation` VALUES (940, 'the Preview', 'Stop', 'the Preview', 'Stop the Preview and Release the Camera', 'https://developer.android.com/training/camera/cameradirect.html', 'Open the Camera Object Create the Camera Preview Modify Camera Settings Set the Preview Orientation Take a Picture Restart the Preview Stop the Preview and Release the Camera You should also read.', '11065', '11065_1', '11065_1_2');
INSERT INTO `EntitiesRelation` VALUES (941, 'the child view', 'receives', 'an ACTION_CANCEL', 'Intercept Touch Events in a ViewGroup', 'https://developer.android.com/training/gestures/viewgroup.html', 'If you return true from onInterceptTouchEvent() , the child view that was previously handling touch events receives an ACTION_CANCEL , and the events from that point forward are sent to the parent\'s onTouchEvent() method for the usual handling.', '11105', '11105_10', '11105_10_1');
INSERT INTO `EntitiesRelation` VALUES (942, 'the atomic ops', 'used', 'a full barrier', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'If the atomic ops used a full barrier, this sort of migration would not be possible.', '11020', '11020_329', '11020_329_1');
INSERT INTO `EntitiesRelation` VALUES (943, 'Android', 'provides', 'the VelocityTrackerCompat class', 'Track Velocity', 'https://developer.android.com/training/gestures/movement.html', 'To make velocity calculation easier, Android provides the VelocityTracker class and the VelocityTrackerCompat class in the Support Library.', '11101', '11101_23', '11101_23_2');
INSERT INTO `EntitiesRelation` VALUES (944, 'The BatchAnnotateImagesResponse', 'returned from', 'the API', 'Upload the image for processing', 'https://developer.android.com/things/training/doorbell/cloud-vision.html', 'The BatchAnnotateImagesResponse returned from the API wraps the annotation data in a few layers.', '10896', '10896_18', '10896_18_2');
INSERT INTO `EntitiesRelation` VALUES (945, 'ACTION_MANAGE_NETWORK_USAGE', 'shows', 'settings', 'Implement a Preferences Activity', 'https://developer.android.com/training/basics/network-ops/managing.html', 'ACTION_MANAGE_NETWORK_USAGE shows settings for managing the network data usage of a specific application.', '11056', '11056_37', '11056_37_1');
INSERT INTO `EntitiesRelation` VALUES (946, 'The Android way', 'is to invoke', 'an Intent', 'Take a Photo with the Camera App', 'https://developer.android.com/training/camera/photobasics.html', 'The Android way of delegating actions to other applications is to invoke an Intent that describes what you want done.', '11067', '11067_17', '11067_17_1');
INSERT INTO `EntitiesRelation` VALUES (947, 'the Contact URI', 'Add', 'a QuickContactBadge', 'Displaying the Quick Contact Badge', 'https://developer.android.com/training/contacts-provider/display-contact-badge.html', 'Add a QuickContactBadge View Set the Contact URI and Thumbnail Add a QuickContactBadge to a ListView You should also read.', '11074', '11074_1', '11074_1_1');
INSERT INTO `EntitiesRelation` VALUES (948, 'the system', 'calls', 'onTimeShiftGetStartPosition', 'Track playback times', 'https://developer.android.com/training/tv/tif/time-shifting.html', 'Typically, you can use your playback engine to determine this value; for example: Ensure that the start time you provide when the system calls your onTimeShiftGetStartPosition() is never greater than the current time position you provide in onTimeShiftGetCurrentPosition().', '11288', '11288_53', '11288_53_1');
INSERT INTO `EntitiesRelation` VALUES (949, 'Any FindClass', 'calls made as', 'part', 'Local and Global References', 'https://developer.android.com/training/articles/perf-jni.html', 'Any FindClass calls made as part of executing JNI_OnLoad will use the class loader associated with the function that called System.loadLibrary (this is a special rule, provided to make library initialization more convenient).', '11012', '11012_246', '11012_246_1');
INSERT INTO `EntitiesRelation` VALUES (950, 'the channel data', 'does n\'t specify', 'app link information', 'Register Channels in the Database', 'https://developer.android.com/training/tv/tif/channel.html', 'If the channel data doesn\'t specify app link information, the system creates a default app link.', '11285', '11285_70', '11285_70_1');
INSERT INTO `EntitiesRelation` VALUES (951, 'activity layout', 'contains', 'TabHost', 'Create a Version-Aware Activity Layout', 'https://developer.android.com/training/backward-compatible-ui/using-component.html', 'For the older implementation ( TabHelperEclair ), you need to ensure that your activity layout contains a TabWidget and TabHost , along with a container for tab contents: res/layout/mainxml: For the TabHelperHoneycomb implementation, all you need is a FrameLayout to contain the tab contents, since the tab indicators are provided by the ActionBar : res/layout-v11/mainxml: At runtime, Android will decide which version of the main.xml layout to inflate depending on the platform version.', '11035', '11035_7', '11035_7_2');
INSERT INTO `EntitiesRelation` VALUES (952, 'The framework', 'calls', 'the setExitAction', 'Create Scene Actions', 'https://developer.android.com/training/transitions/scenes.html', 'The framework calls the setExitAction() method on the starting scene before running the transition animation and the setEnterAction() method on the ending scene after running the transition animation.', '11262', '11262_48', '11262_48_1');
INSERT INTO `EntitiesRelation` VALUES (953, 'EC keys', 'can be generated using', 'KeyPairGenerator', 'Using Android Keystore Provider', 'https://developer.android.com/training/articles/keystore.html', 'Prior to API Level 23, EC keys can be generated using KeyPairGenerator of algorithm \"RSA\" initialized KeyPairGeneratorSpec whose key type is set to \"EC\" using setKeyType(String).', '11010', '11010_119', '11010_119_1');
INSERT INTO `EntitiesRelation` VALUES (954, 'Android', 'provides', 'ScaleGestureDetector', 'Use Touch to Perform Scaling', 'https://developer.android.com/training/gestures/scale.html', 'For scaling, Android provides ScaleGestureDetector.', '11103', '11103_38', '11103_38_1');
INSERT INTO `EntitiesRelation` VALUES (955, 'AbstractAccountAuthenticator', 'has', 'seven abstract methods', 'Extend AbstractAccountAuthenticator', 'https://developer.android.com/training/id-auth/custom_auth.html', 'First, AbstractAccountAuthenticator has seven abstract methods that you must override.', '11113', '11113_33', '11113_33_1');
INSERT INTO `EntitiesRelation` VALUES (956, 'a Uri', 'pointing to', 'the video location', 'View the Video', 'https://developer.android.com/training/camera/videobasics.html', 'The Android Camera application returns the video in the Intent delivered to onActivityResult() as a Uri pointing to the video location in storage.', '11068', '11068_22', '11068_22_2');
INSERT INTO `EntitiesRelation` VALUES (957, 'ScaleGestureDetector', 'uses', 'ScaleGestureDetector.OnScaleGestureListener', 'Use Touch to Perform Scaling', 'https://developer.android.com/training/gestures/scale.html', 'ScaleGestureDetector uses ScaleGestureDetector.OnScaleGestureListener.', '11103', '11103_41', '11103_41_1');
INSERT INTO `EntitiesRelation` VALUES (958, 'a simple implementation', 'displayed using', 'TextView widgets', 'Examples', 'https://developer.android.com/training/material/lists-cards.html', 'The following code example shows a simple implementation for a data set that consists of an array of strings displayed using TextView widgets: Figure 3.', '11148', '11148_31', '11148_31_1');
INSERT INTO `EntitiesRelation` VALUES (959, 'The first part', 'is set in', 'the searchable.xml file', 'Making TV Apps Searchable', 'https://developer.android.com/training/tv/discovery/searchable.html', 'The first part of the URI, when it is common to all of the rows in the table, is set in the searchable.xml file as the android:searchSuggestIntentData attribute, as described in Handle Search Suggestions , below.', '11268', '11268_42', '11268_42_1');
INSERT INTO `EntitiesRelation` VALUES (960, 'The new intent', 'can be used with', 'startActivityForResult', 'Opening the provider chooser', 'https://developer.android.com/training/wearables/watch-faces/complications.html', 'The new intent can be used with either startActivity or startActivityForResult to launch the chooser.', '11332', '11332_77', '11332_77_3');
INSERT INTO `EntitiesRelation` VALUES (961, 'the user', 'views', 'the OnboardingFragment', 'Introducing First-time Users to Your App', 'https://developer.android.com/training/tv/playback/onboarding.html', 'The following example shows an override of onCreate() that checks for a SharedPreferences value and, if not set to true, calls startActivity() to show the OnboardingFragment : After the user views the OnboardingFragment , mark it as viewed using the SharedPreferences object.', '11276', '11276_24', '11276_24_2');
INSERT INTO `EntitiesRelation` VALUES (962, 'Permissions', 'are organized into', 'permission groups', 'Permission Groups', 'https://developer.android.com/training/articles/user-data-overview.html', 'Permissions in Android are organized into permission groups that organize, and group, permissions related to a device\'s capabilities or features.', '11022', '11022_12', '11022_12_1');
INSERT INTO `EntitiesRelation` VALUES (963, 'the SMS group', 'includes', 'the RECEIVE_SMS declarations', 'Permission Groups', 'https://developer.android.com/training/articles/user-data-overview.html', 'Under this system, permission requests are handled at the group level and a single permission group corresponds to several permission declarations in the app manifest; for example, the SMS group includes both the READ_SMS and the RECEIVE_SMS declarations.', '11022', '11022_13', '11022_13_2');
INSERT INTO `EntitiesRelation` VALUES (964, 't', 'move', 'release barrier', 'What not to do in C', 'https://developer.android.com/training/articles/smp.html', 'Stores may not be reordered with respect to each other, because you can t move a store  downward  across another store s release barrier.', '11020', '11020_334', '11020_334_2');
INSERT INTO `EntitiesRelation` VALUES (965, 'The automotive_app_desc.xml file', 'contains', 'the following metadata', 'Declare Auto capabilities', 'https://developer.android.com/training/auto/start/index.html', 'The automotive_app_desc.xml file contains the following metadata: The <uses> element declares the Auto capability your app intends to use.', '11029', '11029_36', '11029_36_1');
INSERT INTO `EntitiesRelation` VALUES (966, 'A dp', 'is', 'a density-independent pixel', 'Use Density-independent Pixels', 'https://developer.android.com/training/multiscreen/screendensities.html', 'A dp is a density-independent pixel that corresponds to the physical size of a pixel at 160 dpi.', '11169', '11169_9', '11169_9_1');
INSERT INTO `EntitiesRelation` VALUES (967, 'the Activity', 'extends', 'the notification', 'Set Up a Regular Activity PendingIntent', 'https://developer.android.com/training/notify-user/navigation.html', 'In a sense, the Activity extends the notification by providing information that would be hard to display in the notification itself.', '11176', '11176_7', '11176_7_1');
INSERT INTO `EntitiesRelation` VALUES (968, 'The WearableRecyclerView class', 'supports', 'wrist gestures', 'Using a Curved Layout to Support Wrist Gestures', 'https://developer.android.com/training/wearables/ui/wrist-gestures.html', 'The WearableRecyclerView class provides a curved layout for lists and automatically supports wrist gestures.', '11331', '11331_18', '11331_18_2');
INSERT INTO `EntitiesRelation` VALUES (969, 'the ad_id column', 'could be joined to', 'PII', 'Working with Advertising IDs', 'https://developer.android.com/training/articles/user-data-ids.html', 'In this example, the ad_id column could be joined to PII via the account_id column in both tables, which would be a violation of the Google Play Developer Content Policy , if you did not get explicit permission from your users.', '11021', '11021_38', '11021_38_2');
INSERT INTO `EntitiesRelation` VALUES (970, 'AXIS_HAT_X', 'include', 'BUTTON_B', 'Process Gamepad Button Presses', 'https://developer.android.com/training/game-controllers/controller-input.html', 'The callouts in the figure refer to the following: AXIS_HAT_X , AXIS_HAT_Y , DPAD_UP , DPAD_DOWN , DPAD_LEFT , DPAD_RIGHT AXIS_X , AXIS_Y , BUTTON_THUMBL AXIS_Z , AXIS_RZ , BUTTON_THUMBR BUTTON_X BUTTON_A BUTTON_Y BUTTON_B BUTTON_R1 AXIS_RTRIGGER , AXIS_THROTTLE AXIS_LTRIGGER , AXIS_BRAKE BUTTON_L1 Common key codes generated by gamepad button presses include BUTTON_A , BUTTON_B , BUTTON_SELECT , and BUTTON_START.', '11096', '11096_47', '11096_47_2');
INSERT INTO `EntitiesRelation` VALUES (971, 'a unique R.id', 'will narrow', 'the view search', 'Finding a view', 'https://developer.android.com/training/testing/espresso/basics.html', 'Often the desired view has a unique R.id and a simple withId matcher will narrow down the view search.', '11240', '11240_27', '11240_27_1');
INSERT INTO `EntitiesRelation` VALUES (972, 'The sync adapter', 'calls', 'installIfNeeded', 'Patching the Security Provider with ProviderInstaller', 'https://developer.android.com/training/articles/security-gms-provider.html', 'The sync adapter calls installIfNeeded() to update the security provider.', '11016', '11016_38', '11016_38_1');
INSERT INTO `EntitiesRelation` VALUES (973, 'channel metadata', 'map', 'the values', 'Register Channels in the Database', 'https://developer.android.com/training/tv/tif/channel.html', 'Pull your channel metadata (in XML, JSON, or whatever) from your backend server, and in your setup activity map the values to the system database as follows: In the example above, channel is an object which holds channel metadata from the backend server.', '11285', '11285_17', '11285_17_2');
INSERT INTO `EntitiesRelation` VALUES (974, 'Binder', 'are not declared within', 'the application', 'Using interprocess communication', 'https://developer.android.com/training/articles/security-tips.html', 'Binder and Messenger objects are not declared within the application manifest, and therefore you cannot apply declarative permissions directly to them.', '11019', '11019_232', '11019_232_1');
INSERT INTO `EntitiesRelation` VALUES (975, 'The QuickContactBadge view', 'provides', 'instant access', 'Displaying the Quick Contact Badge', 'https://developer.android.com/training/contacts-provider/display-contact-badge.html', 'The QuickContactBadge view provides instant access to a contact\'s details, as well as a fast way of communicating with the contact.', '11074', '11074_12', '11074_12_1');
INSERT INTO `EntitiesRelation` VALUES (976, 'This test program', 'succeed on', 'a broken VM', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'This test program could very well succeed on a broken VM if things just happen to work out.', '11020', '11020_522', '11020_522_1');
INSERT INTO `EntitiesRelation` VALUES (977, 'This XML', 'uses', 'the built-in Android TextView widget android', 'Define ListView and item layouts', 'https://developer.android.com/training/contacts-provider/retrieve-names.html', 'Define the item layout file contacts_list_item.xml with the following XML: This XML uses the built-in Android TextView widget android:text1.', '11078', '11078_22', '11078_22_1');
INSERT INTO `EntitiesRelation` VALUES (978, 'the incoming Intent', 'contains', 'a file URI', 'Respond to a Request to Display Data', 'https://developer.android.com/training/beam-files/receive-files.html', 'If the incoming Intent contains a file URI, the URI contains the absolute file name of a file, including the full directory path and file name.', '11063', '11063_32', '11063_32_1');
INSERT INTO `EntitiesRelation` VALUES (979, 'common solution', 'is to use', 'onData', 'Checking data loading in adapter views', 'https://developer.android.com/training/testing/espresso/basics.html', 'When an onView() operation throws a NoMatchingViewException and AdapterView widgets are present in the view hierarchy, the most common solution is to use onData().', '11240', '11240_104', '11240_104_5');
INSERT INTO `EntitiesRelation` VALUES (980, 'SyncService', 'is', 'this example', 'Declare the Sync Adapter in the Manifest', 'https://developer.android.com/training/sync-adapters/creating-sync-adapter.html', 'When the filter is triggered, the system starts the bound service you\'ve created, which in this example is SyncService.', '11224', '11224_108', '11224_108_2');
INSERT INTO `EntitiesRelation` VALUES (981, 'The WearableRecyclerView class', 'provides', 'a curved layout', 'Using a Curved Layout to Support Wrist Gestures', 'https://developer.android.com/training/wearables/ui/wrist-gestures.html', 'The WearableRecyclerView class provides a curved layout for lists and automatically supports wrist gestures.', '11331', '11331_18', '11331_18_1');
INSERT INTO `EntitiesRelation` VALUES (982, 'won t work', 'have', 'WRITE_EXTERNAL_STORAGE', 'Grant Permissions for the File', 'https://developer.android.com/training/secure-file-sharing/share-file.html', 'It forces receiving apps to have the READ_EXTERNAL_STORAGE permission, won t work at all if you are trying to share across users, and in versions of Android lower than 4.4 (API level 19), would require your app to have WRITE_EXTERNAL_STORAGE.', '11210', '11210_43', '11210_43_3');
INSERT INTO `EntitiesRelation` VALUES (983, 'The system', 'calls', 'listener \'s onClick', 'Adding an Action to a Message', 'https://developer.android.com/training/snackbar/action.html', 'The system calls your listener\'s onClick() method if the user clicks on the message action.', '11216', '11216_8', '11216_8_1');
INSERT INTO `EntitiesRelation` VALUES (984, 'Snackbar', 'is', 'the preferred way', 'Showing Pop-Up Messages', 'https://developer.android.com/training/snackbar/index.html', 'While Toast is currently still supported, Snackbar is now the preferred way to display brief, transient messages to the user.', '11217', '11217_15', '11217_15_1');
INSERT INTO `EntitiesRelation` VALUES (985, 'the following code', 'calls', 'the setHintHideIcon', 'Add Wearable Specific-features to a Notification', 'https://developer.android.com/training/wearables/notifications/creating.html', 'For example, the following code calls the setHintHideIcon() method to remove the app icon from the notification card.', '11318', '11318_70', '11318_70_1');
INSERT INTO `EntitiesRelation` VALUES (986, 'CardView widgets', 'can have', 'rounded corners', 'Creating Lists and Cards', 'https://developer.android.com/training/material/lists-cards.html', 'CardView widgets can have shadows and rounded corners.', '11148', '11148_35', '11148_35_2');
INSERT INTO `EntitiesRelation` VALUES (987, 'Intent filters', 'inform', 'the system', 'Handle the Incoming Content', 'https://developer.android.com/training/sharing/receive.html', 'Intent filters inform the system what intents an application component is willing to accept.', '11212', '11212_9', '11212_9_1');
INSERT INTO `EntitiesRelation` VALUES (988, 'An Intent', 'start', 'a specific component', 'Interacting with Other Apps', 'https://developer.android.com/training/basics/intents/index.html', 'An Intent can be explicit in order to start a specific component (a specific Activity instance) or implicit in order to start any component that can handle the intended action (such as \"capture a photo\").', '11050', '11050_9', '11050_9_1');
INSERT INTO `EntitiesRelation` VALUES (989, 'an app', 'calls', 'startActivity', 'Allowing Other Apps to Start Your Activity', 'https://developer.android.com/training/basics/intents/filters.html', 'When an app calls startActivity() or startActivityForResult() , with an implicit intent, the system finds which activity (or activities) can respond to the intent.', '11049', '11049_8', '11049_8_1');
INSERT INTO `EntitiesRelation` VALUES (990, 'An AsyncTask', 'keep', 'a reference', 'Define an intent service to fetch the address', 'https://developer.android.com/training/location/display-address.html', 'An AsyncTask shouldn\'t keep a reference to the UI if the activity is re-created, such as when the device is rotated.', '11136', '11136_25', '11136_25_1');
INSERT INTO `EntitiesRelation` VALUES (991, 'the loader framework', 'destroy', 'the old Cursor', 'Set up a projection', 'https://developer.android.com/training/contacts-provider/retrieve-details.html', 'If you don\'t, the loader framework won\'t destroy the old Cursor , and you\'ll get a memory leak.', '11077', '11077_54', '11077_54_1');
INSERT INTO `EntitiesRelation` VALUES (992, 'A complete list', 'can be found in', 'the AccessibilityEvent reference documentation', 'Fire Accessibility Events', 'https://developer.android.com/training/accessibility/accessible-app.html', 'A complete list of the event types currently supported can be found in the AccessibilityEvent reference documentation.', '10989', '10989_34', '10989_34_1');
INSERT INTO `EntitiesRelation` VALUES (993, 'the events', 'are sent to', 'the parent \'s onTouchEvent', 'Intercept Touch Events in a ViewGroup', 'https://developer.android.com/training/gestures/viewgroup.html', 'If you return true from onInterceptTouchEvent() , the child view that was previously handling touch events receives an ACTION_CANCEL , and the events from that point forward are sent to the parent\'s onTouchEvent() method for the usual handling.', '11105', '11105_10', '11105_10_2');
INSERT INTO `EntitiesRelation` VALUES (994, 'the first step', 'is to', 'the Android print framework', 'Connect to the Print Manager', 'https://developer.android.com/training/printing/custom-docs.html', 'When your application manages the printing process directly, the first step after receiving a print request from your user is to connect to the Android print framework and obtain an instance of the PrintManager class.', '11186', '11186_8', '11186_8_3');
INSERT INTO `EntitiesRelation` VALUES (995, 'The following code snippets', 'use', 'the method loadContactPhotoThumbnail', 'Set the photo thumbnail', 'https://developer.android.com/training/contacts-provider/display-contact-badge.html', 'Note: The following code snippets use the method loadContactPhotoThumbnail() , which is defined in the section Set the Contact URI and Thumbnail For example: Set up the ListView.', '11074', '11074_58', '11074_58_1');
INSERT INTO `EntitiesRelation` VALUES (996, 'the sync adapter framework', 'runs', 'the code', 'Declare the Sync Adapter in the Manifest', 'https://developer.android.com/training/sync-adapters/creating-sync-adapter.html', 'Based on the scheduling and triggers you provide in your app, the sync adapter framework runs the code in the sync adapter component.', '11224', '11224_5', '11224_5_1');
INSERT INTO `EntitiesRelation` VALUES (997, 'The NewGlobalRef function', 'takes', 'the local reference', 'jclass', 'jmethodID', 'The NewGlobalRef function takes the local reference as an argument and returns a global one.', '11012', '11012_51', '11012_51_1');
INSERT INTO `EntitiesRelation` VALUES (998, 'the data', 'calls', 'setRefreshing', 'Respond to the Refresh Gesture', 'https://developer.android.com/training/swipe/respond-refresh-request.html', 'The method which actually refreshes the data calls setRefreshing(false) to signal that the update is finished.', '11221', '11221_23', '11221_23_1');
INSERT INTO `EntitiesRelation` VALUES (999, 'the view', 'is currently displaying', 'another Snackbar', 'Building and Displaying a Pop-Up Message', 'https://developer.android.com/training/snackbar/showing.html', 'Once you have created the Snackbar , call its show() method to display the Snackbar to the user: The system does not show multiple Snackbar objects at the same time, so if the view is currently displaying another Snackbar , the system queues your Snackbar and displays it after the current Snackbar expires or is dismissed.', '11218', '11218_34', '11218_34_2');
INSERT INTO `EntitiesRelation` VALUES (1000, 'WebView interactions', 'are actually composed of', 'several View Atoms', 'Espresso Web', 'https://developer.android.com/training/testing/espresso/web.html', 'Similar to onData() , WebView interactions are actually composed of several View Atoms.', '11248', '11248_2', '11248_2_1');
INSERT INTO `EntitiesRelation` VALUES (1001, 'An app', 'can customize', 'own connections using base-config', 'Customizing Trusted CAs', 'https://developer.android.com/training/articles/security-config.html', 'An app can customize its own connections using base-config (for app-wide customization) or domain-config (for per-domain customization).', '11015', '11015_18', '11015_18_1');
INSERT INTO `EntitiesRelation` VALUES (1002, 'Android', 'provides', 'ScaleGestureDetector.SimpleOnScaleGestureListener', 'Use Touch to Perform Scaling', 'https://developer.android.com/training/gestures/scale.html', 'Android provides ScaleGestureDetector.SimpleOnScaleGestureListener as a helper class that you can extend if you don t care about all of the reported events.', '11103', '11103_42', '11103_42_1');
INSERT INTO `EntitiesRelation` VALUES (1003, 'intent filter declarations', 'include', 'the android.intent.action.VIEW intent action', 'Create an Intent Handler for URIs', 'https://developer.android.com/training/app-links/index.html', 'To enable the system to verify a host, make sure that your intent filter declarations include the android.intent.action.VIEW intent action and android.intent.category.BROWSABLE intent category.', '11002', '11002_38', '11002_38_2');
INSERT INTO `EntitiesRelation` VALUES (1004, 'Providers', 'send', 'TYPE_EMPTY', 'Types and fields', 'https://developer.android.com/training/wearables/watch-faces/complications.html', 'Providers should not send TYPE_EMPTY in response to update requests.', '11332', '11332_218', '11332_218_1');
INSERT INTO `EntitiesRelation` VALUES (1005, 'faces', 'can call', 'the createProviderChooserIntent method', 'Receiving data', 'https://developer.android.com/training/wearables/watch-faces/complications.html', 'Watch faces can call the createProviderChooserIntent method to obtain an intent that can be used to show the chooser interface.', '11332', '11332_53', '11332_53_1');
INSERT INTO `EntitiesRelation` VALUES (1006, 'parseNetworkResponse', 'takes as', 'parameter', 'parseNetworkResponse', 'https://developer.android.com/training/volley/request-custom.html', 'parseNetworkResponse() takes as its parameter a NetworkResponse , which contains the response payload as a byte[], HTTP status code, and response headers.', '11292', '11292_13', '11292_13_1');
INSERT INTO `EntitiesRelation` VALUES (1007, 'media player code', 'should implement', 'TvPlayer', 'Handle tuning requests and media playback', 'https://developer.android.com/training/tv/tif/tvinput.html', 'Your media player code should implement TvPlayer to handle specific playback events.', '11289', '11289_65', '11289_65_1');
INSERT INTO `EntitiesRelation` VALUES (1008, 'operations', 'preceded by', 'a barrier', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'This inspires a particular naming convention: operations followed by a barrier are  acquiring  operations, while operations preceded by a barrier are  releasing  operations.', '11020', '11020_307', '11020_307_2');
INSERT INTO `EntitiesRelation` VALUES (1009, 'the sample app', 'launches', 'own LeanbackDetailsFragment', 'Deep Link to Your App in the Details Screen', 'https://developer.android.com/training/tv/discovery/searchable.html', 'Note that the sample app launches its own LeanbackDetailsFragment to show the details for the selected media, but you should launch the activity that plays the media immediately to save the user another click or two.', '11268', '11268_82', '11268_82_1');
INSERT INTO `EntitiesRelation` VALUES (1010, 'A Palette object', 'gives', 'access', 'Selecting Colors with the Palette API', 'https://developer.android.com/training/material/palette-colors.html', 'A Palette object gives you access to the primary colors in an image, as well as the corresponding colors for overlaid text.', '11149', '11149_12', '11149_12_1');
INSERT INTO `EntitiesRelation` VALUES (1011, 'a store', 'happen in', 'thread', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'The fact that a store in thread 1 causes something to happen in thread 2 which causes something to happen in thread 3 does not mean that thread 3 will observe the stores in that order.', '11020', '11020_222', '11020_222_3');
INSERT INTO `EntitiesRelation` VALUES (1012, 'the native ActionBar', 'behaves differently depending on', 'version', 'Setting Up the App Bar', 'https://developer.android.com/training/appbar/setting-up.html', 'As a result, the native ActionBar behaves differently depending on what version of the Android system a device may be using.', '11006', '11006_8', '11006_8_2');
INSERT INTO `EntitiesRelation` VALUES (1013, 'FindClass', 'finds', 'the ClassLoader object', 'Local and Global References', 'https://developer.android.com/training/articles/perf-jni.html', 'FindClass finds the ClassLoader object associated with the Foo class and uses that.', '11012', '11012_239', '11012_239_1');
INSERT INTO `EntitiesRelation` VALUES (1014, 'IMEI', 'requires', 'PHONE permission group', 'Managing telephony and carrier functionality', 'https://developer.android.com/training/articles/user-data-ids.html', 'We Recommend : IMEI, IMSI, and Line1 (requires PHONE permission group in Android 6.0 (API level 23) and higher).', '11021', '11021_149', '11021_149_1');
INSERT INTO `EntitiesRelation` VALUES (1015, 'The InputStream', 'is passed to', 'the readStream', 'Using HttpsUrlConnection to Fetch Data', 'https://developer.android.com/training/basics/network-ops/connecting.html', 'The InputStream is passed to the readStream() method, which converts the stream to a string.', '11053', '11053_41', '11053_41_1');
INSERT INTO `EntitiesRelation` VALUES (1016, 'the Adapter', 'returns', 'an inflated view', 'Hold View Objects in a View Holder', 'https://developer.android.com/training/improving-layouts/smooth-scrolling.html', 'Even when the Adapter returns an inflated view for recycling, you still need to look up the elements and update them.', '11124', '11124_18', '11124_18_1');
INSERT INTO `EntitiesRelation` VALUES (1017, 'test', 'has obtained', 'a UiObject object', 'Accessing UI Components', 'https://developer.android.com/training/testing/ui-testing/uiautomator-testing.html', 'Once your test has obtained a UiObject object, you can call the methods in the UiObject class to perform user interactions on the UI component represented by that object.', '11255', '11255_80', '11255_80_1');
INSERT INTO `EntitiesRelation` VALUES (1018, 'the data', 'might be', 'a Uri', 'Build an Implicit Intent', 'https://developer.android.com/training/basics/intents/sending.html', 'Depending on the intent you want to create, the data might be a Uri , one of several other data types, or the intent might not need data at all.', '11052', '11052_16', '11052_16_1');
INSERT INTO `EntitiesRelation` VALUES (1019, 'The animation definitions', 'represent', 'AnimatorSet objects', 'Animate Vector Drawables', 'https://developer.android.com/training/material/animations.html', 'For example: The animated vector drawable definition refers to the groups and paths in the vector drawable by their names: The animation definitions represent ObjectAnimator or AnimatorSet objects.', '11142', '11142_93', '11142_93_1');
INSERT INTO `EntitiesRelation` VALUES (1020, 'an broadcast Intent', 'does n\'t start', 'an Activity', 'Reporting Work Status', 'https://developer.android.com/training/run-background-service/report-status.html', 'For example: Sending an broadcast Intent doesn\'t start or resume an Activity.', '11192', '11192_24', '11192_24_1');
INSERT INTO `EntitiesRelation` VALUES (1021, 'the Contacts Provider', 'join between', 'the ContactsContract.Data table', 'Retrieve All Details for a Contact', 'https://developer.android.com/training/contacts-provider/retrieve-details.html', 'This column is available in the ContactsContract.Data table, because the Contacts Provider makes an implicit join between the ContactsContract.Contacts table and the ContactsContract.Data table.', '11077', '11077_11', '11077_11_3');
INSERT INTO `EntitiesRelation` VALUES (1022, 'PhotoTask', 'is', 'object', 'Store data in the task object', 'https://developer.android.com/training/multiple-threads/communicate-ui.html', 'PhotoTask is the next higher object in the hierarchy.', '11162', '11162_35', '11162_35_1');
INSERT INTO `EntitiesRelation` VALUES (1023, 'Paint', 'defines', 'font', 'Override onDraw()', 'https://developer.android.com/training/custom-views/custom-drawing.html', 'Simply put, Canvas defines shapes that you can draw on the screen, while Paint defines the color, style, font, and so forth of each shape you draw.', '11080', '11080_19', '11080_19_3');
INSERT INTO `EntitiesRelation` VALUES (1024, 'The threads', 'run side-by-side in', 'a predictable way', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'The threads will not run side-by-side in a predictable way, but we can assert a relationship between the array contents.', '11020', '11020_502', '11020_502_1');
