INSERT INTO `EntitiesRelation` VALUES (1026, 'common use case', 'is to create', 'the RequestQueue', 'Setting Up a RequestQueue', 'https://developer.android.com/training/volley/requestqueue.html', 'But the more common use case is to create the RequestQueue as a singleton to keep it running for the lifetime of your app, as described in the next section.', '11294', '11294_12', '11294_12_1');
INSERT INTO `EntitiesRelation` VALUES (1027, 'every hour', 'use', 'setRepeating', 'Decide how precise your alarm needs to be', 'https://developer.android.com/training/scheduling/alarms.html', 'For the rare app that has rigid time requirements for example, the alarm needs to fire precisely at 8:30 a.m., and every hour on the hour thereafter use setRepeating().', '11199', '11199_88', '11199_88_1');
INSERT INTO `EntitiesRelation` VALUES (1028, 'AdapterView', 'is', 'a special type', 'Checking data loading in adapter views', 'https://developer.android.com/training/testing/espresso/basics.html', 'AdapterView is a special type of widget that loads its data dynamically from an Adapter.', '11240', '11240_69', '11240_69_1');
INSERT INTO `EntitiesRelation` VALUES (1029, 'users', 'click', 'the QuickContactBadge icon', 'Displaying the Quick Contact Badge', 'https://developer.android.com/training/contacts-provider/display-contact-badge.html', 'For example: When users click the QuickContactBadge icon, the contact\'s details automatically appear in the dialog.', '11074', '11074_31', '11074_31_1');
INSERT INTO `EntitiesRelation` VALUES (1030, 'the base address', 'could be', 'a field', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'If A is the base address of an object or array, [A+8] could be a field in the object or an element in the array.', '11020', '11020_196', '11020_196_1');
