INSERT INTO `EntitiesRelation` VALUES (1032, 'sync adapter component', 'is created from', 'scratch', 'Declare the Sync Adapter in the Manifest', 'https://developer.android.com/training/sync-adapters/creating-sync-adapter.html', 'Use the constructors to run setup tasks each time your sync adapter component is created from scratch, just as you use Activity.onCreate() to set up an activity.', '11224', '11224_21', '11224_21_1');
INSERT INTO `EntitiesRelation` VALUES (1033, 'the native tab implementation', 'can be provided by', 'TabHelperHoneycomb classes', 'Implement Tabs Using New APIs', 'https://developer.android.com/training/backward-compatible-ui/new-implementation.html', 'For example, the native tab implementation can be provided by CompatTabHoneycomb and TabHelperHoneycomb classes, since they rely on APIs available in Android 3.0 (API level 11) or later.', '11033', '11033_13', '11033_13_3');
