INSERT INTO `EntitiesRelation` VALUES (1035, 'app', 'uses', 'ACCESS_FINE_LOCATION permission', 'Declaring permissions that imply hardware features', 'https://developer.android.com/training/tv/start/hardware.html', 'Note: If your app targets Android 5.0 (API level 21) or higher and uses the ACCESS_COARSE_LOCATION or ACCESS_FINE_LOCATION permission, users can still install your app on a TV device, even if the TV device doesn\'t have a network card or a GPS receiver.', '11280', '11280_53', '11280_53_3');
INSERT INTO `EntitiesRelation` VALUES (1036, 'this IntentService', 'gets', 'tests', 'Creating and Monitoring Geofences', 'https://developer.android.com/training/location/geofencing.html', 'When the user clicks the notification, the app\'s main activity appears: After detecting the transition event via the PendingIntent , this IntentService gets the geofence transition type and tests whether it is one of the events the app uses to trigger notifications -- either GEOFENCE_TRANSITION_ENTER or GEOFENCE_TRANSITION_EXIT in this case.', '11137', '11137_46', '11137_46_3');
INSERT INTO `EntitiesRelation` VALUES (1037, 'VM', 'make', 'a couple', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'The pthread library and VM make a couple of useful guarantees: all accesses previously performed by a thread that creates a new thread are observable by that new thread as soon as it starts, and all accesses performed by a thread that is exiting are observable when a join() on that thread returns.', '11020', '11020_468', '11020_468_2');
INSERT INTO `EntitiesRelation` VALUES (1038, 'AndroidKeyStore', 'is registered as', 'a KeyStore type', 'Using Android Keystore Provider', 'https://developer.android.com/training/articles/keystore.html', 'AndroidKeyStore is registered as a KeyStore type for use with the KeyStore.getInstance(type) method and as a provider for use with the KeyPairGenerator.getInstance(algorithm, provider) and KeyGenerator.getInstance(algorithm, provider) methods.', '11010', '11010_43', '11010_43_1');
INSERT INTO `EntitiesRelation` VALUES (1039, 'The PHOTO_THUMBNAIL_URI column', 'is n\'t available in', 'platform versions', 'Set the photo thumbnail', 'https://developer.android.com/training/contacts-provider/display-contact-badge.html', 'Note: The PHOTO_THUMBNAIL_URI column isn\'t available in platform versions prior to 3.0.', '11074', '11074_35', '11074_35_1');
INSERT INTO `EntitiesRelation` VALUES (1040, 'the PagerAdapter', 'will use', 'the fragment class', 'Add a ViewPager', 'https://developer.android.com/training/animation/screen-slide.html', 'ViewPager s use PagerAdapter s as a supply for new pages to display, so the PagerAdapter will use the fragment class that you created earlier.', '10997', '10997_15', '10997_15_1');
INSERT INTO `EntitiesRelation` VALUES (1041, 'channel', 'is', 'an object', 'Register Channels in the Database', 'https://developer.android.com/training/tv/tif/channel.html', 'Pull your channel metadata (in XML, JSON, or whatever) from your backend server, and in your setup activity map the values to the system database as follows: In the example above, channel is an object which holds channel metadata from the backend server.', '11285', '11285_17', '11285_17_1');
INSERT INTO `EntitiesRelation` VALUES (1042, 'A DataItem', 'defines', 'the data interface', 'Syncing Data Items', 'https://developer.android.com/training/wearables/data-layer/data-items.html', 'Sync Data with a Data Map Listen for Data Item Events A DataItem defines the data interface that the system uses to synchronize data between handhelds and wearables.', '11311', '11311_1', '11311_1_1');
INSERT INTO `EntitiesRelation` VALUES (1043, 'The incoming argument', 'contains', 'a list Location object', 'Receiving Location Updates', 'https://developer.android.com/training/location/receive-location-updates.html', 'The incoming argument contains a list Location object containing the location\'s latitude and longitude.', '11139', '11139_31', '11139_31_1');
INSERT INTO `EntitiesRelation` VALUES (1044, 'The FileProvider class', 'has', 'a default implementation', 'Retrieving File Information', 'https://developer.android.com/training/secure-file-sharing/retrieve-info.html', 'The FileProvider class has a default implementation of the query() method that returns the name and size of the file associated with a content URI in a Cursor.', '11208', '11208_12', '11208_12_1');
INSERT INTO `EntitiesRelation` VALUES (1045, 'The TextView', 'verify has', 'a unique R.id', 'Finding a view', 'https://developer.android.com/training/testing/espresso/basics.html', 'The TextView with the text to verify has a unique R.id too: Now to verify the content text: Checking data loading in adapter views.', '11240', '11240_68', '11240_68_1');
INSERT INTO `EntitiesRelation` VALUES (1046, 'a conditional store instruction', 'write', 'the data', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'To perform an LL/SC, the data is read with a reservation, modified, and then a conditional store instruction is used to try to write the data back.', '11020', '11020_256', '11020_256_1');
