INSERT INTO `EntitiesRelation` VALUES (1048, 'Android Auto apps', 'support', 'ACTION_PLAY_FROM_MEDIA_ID', 'Providing custom actions', 'https://developer.android.com/training/auto/audio/index.html', 'Android Auto apps must also support ACTION_PLAY_FROM_MEDIA_ID and ACTION_PLAY_FROM_SEARCH.', '11027', '11027_145', '11027_145_1');
INSERT INTO `EntitiesRelation` VALUES (1049, 'The Activity', 'passes in', 'URL', 'Introducing Network Operations on a Separate Thread', 'https://developer.android.com/training/basics/network-ops/connecting.html', 'This is how you would convert the InputStream to a string so that the Activity can display it in the UI: The sequence of events in the code so far is as follows: The Activity starts a NetworkFragment and passes in a specified URL.', '11053', '11053_36', '11053_36_2');
INSERT INTO `EntitiesRelation` VALUES (1050, 'a store', 'causes', 'something', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'The fact that a store in thread 1 causes something to happen in thread 2 which causes something to happen in thread 3 does not mean that thread 3 will observe the stores in that order.', '11020', '11020_222', '11020_222_1');
INSERT INTO `EntitiesRelation` VALUES (1051, 'The AsyncTask method doInBackground', 'runs on', 'the background thread', 'Implementing a Headless Fragment to Encapsulate Network Operations', 'https://developer.android.com/training/basics/network-ops/connecting.html', 'The AsyncTask method doInBackground() then runs on the background thread and calls the downloadUrl() method.', '11053', '11053_39', '11053_39_1');
INSERT INTO `EntitiesRelation` VALUES (1052, 'the ImageView', 'sets', 'visibility', 'Create the Views', 'https://developer.android.com/training/animation/zoom.html', 'When clicked, the ImageView minimizes back down to the size of the image thumbnail and sets its visibility to GONE to hide it.', '10998', '10998_22', '10998_22_1');
INSERT INTO `EntitiesRelation` VALUES (1053, 'the channel', 'works with', 'the system TV app \'s channel', 'Register Channels in the Database', 'https://developer.android.com/training/tv/tif/channel.html', 'To make sure the channel and program information works with the system TV app\'s channel and program information presenter, follow the guidelines below.', '11285', '11285_20', '11285_20_3');
INSERT INTO `EntitiesRelation` VALUES (1054, 'stores', 'are observed before', 'the release', 'What not to do in C', 'https://developer.android.com/training/articles/smp.html', 'The full version of the simple spin lock is: We perform our second CPU/compiler memory barrier immediately before we release the lock, so that loads and stores in the critical section are observed before the release of the lock.', '11020', '11020_296', '11020_296_2');
INSERT INTO `EntitiesRelation` VALUES (1055, 'activity', 'contains', 'GuidedStepFragment objects', 'Adding a Guided Step', 'https://developer.android.com/training/tv/playback/guided-step.html', 'If your activity contains only GuidedStepFragment objects, use GuidedStepFragment.addAsRoot() instead of add() to add the first GuidedStepFragment.', '11273', '11273_17', '11273_17_1');
INSERT INTO `EntitiesRelation` VALUES (1056, 'channel metadata', 'map', 'the values', 'Register Channels in the Database', 'https://developer.android.com/training/tv/tif/channel.html', 'Pull your channel metadata (in XML, JSON, or whatever) from your backend server, and in your setup activity map the values to the system database as follows: In the example above, channel is an object which holds channel metadata from the backend server.', '11285', '11285_17', '11285_17_4');
INSERT INTO `EntitiesRelation` VALUES (1057, 'The CustomFailureHandler', 'can be registered with', 'Espresso', 'Using a custom failure handler', 'https://developer.android.com/training/testing/espresso/recipes.html', 'The CustomFailureHandler can be registered with Espresso in the setUp() method of the test: For more information, see the FailureHandler interface and Espresso.setFailureHandler().', '11246', '11246_29', '11246_29_1');
INSERT INTO `EntitiesRelation` VALUES (1058, 'a gauge', 'might support', 'the RANGED_VALUE type', 'Using and Testing Complication Types', 'https://developer.android.com/training/wearables/watch-faces/complications.html', 'For example, a round complication on a watch face might support the SHORT_TEXT , ICON and RANGED_VALUE types, whereas a gauge on the watch face might support only the RANGED_VALUE type.', '11332', '11332_171', '11332_171_2');
INSERT INTO `EntitiesRelation` VALUES (1059, 'PieChart', 'exposes', 'a custom event', 'Define Custom Attributes', 'https://developer.android.com/training/custom-views/create-view.html', 'For instance, PieChart exposes a custom event called OnCurrentItemChanged to notify listeners that the user has rotated the pie chart to focus on a new pie slice.', '11079', '11079_58', '11079_58_1');
INSERT INTO `EntitiesRelation` VALUES (1060, 'a one-dimensional array', 'would be', 'Ljava/lang/String', 'Region Calls', 'https://developer.android.com/training/articles/perf-jni.html', 'If you\'re looking up an array class, you need to start with the appropriate number of square brackets and must also wrap the class with \'L\' and \';\', so a one-dimensional array of String would be [Ljava/lang/String;.', '11012', '11012_230', '11012_230_1');
INSERT INTO `EntitiesRelation` VALUES (1061, 'main layout', 'is', 'a vertical LinearLayout', 'Use the <merge> Tag', 'https://developer.android.com/training/improving-layouts/reusing-layouts.html', 'For example, if your main layout is a vertical LinearLayout in which two consecutive views can be re-used in multiple layouts, then the re-usable layout in which you place the two views requires its own root view.', '11123', '11123_19', '11123_19_1');
INSERT INTO `EntitiesRelation` VALUES (1062, 'android.permission.INTERNET', 'Allows', 'the sync adapter code', 'Declare the Sync Adapter in the Manifest', 'https://developer.android.com/training/sync-adapters/creating-sync-adapter.html', 'To request these permissions, add the following to your app manifest as child elements of <manifest> : android.permission.INTERNET Allows the sync adapter code to access the Internet so that it can download or upload data from the device to a server.', '11224', '11224_99', '11224_99_1');
INSERT INTO `EntitiesRelation` VALUES (1063, 'Well-written custom views', 'styled via', 'XML', 'Define Custom Attributes', 'https://developer.android.com/training/custom-views/create-view.html', 'Well-written custom views can also be added and styled via XML.', '11079', '11079_17', '11079_17_1');
INSERT INTO `EntitiesRelation` VALUES (1064, 't', 'happen', 'a sequentially-consistent machine', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'On a sequentially-consistent machine, that can t happen.', '11020', '11020_47', '11020_47_1');
INSERT INTO `EntitiesRelation` VALUES (1065, 'ConstraintLayout', 'is', 'a layout', 'Open the Layout Editor', 'https://developer.android.com/training/basics/firstapp/building-ui.html', 'ConstraintLayout is a layout that defines the position for each view based on constraints to sibling views and the parent layout.', '11040', '11040_26', '11040_26_1');
INSERT INTO `EntitiesRelation` VALUES (1066, 'the framework', 'provides', 'a TransitionValues object', 'Capturing Starting Values', 'https://developer.android.com/training/transitions/custom-transitions.html', 'For target views that only exist in the starting or the ending scene, the framework provides a TransitionValues object for the corresponding argument and null for the other.', '11259', '11259_35', '11259_35_1');
INSERT INTO `EntitiesRelation` VALUES (1067, 'The RequestQueue', 'reading from', 'parsing responses', 'Sending a Simple Request', 'https://developer.android.com/training/volley/simple.html', 'The RequestQueue manages worker threads for running the network operations, reading from and writing to the cache, and parsing responses.', '11295', '11295_3', '11295_3_2');
INSERT INTO `EntitiesRelation` VALUES (1068, 'res/layout/my _ activity.xml', 'is', 'an alternative layout', 'Provide Alternative Layouts', 'https://developer.android.com/training/material/compatibility.html', 'For example, res/layout/my_activity.xml is an alternative layout for res/layout-v21/my_activity.xml.', '11143', '11143_15', '11143_15_1');
INSERT INTO `EntitiesRelation` VALUES (1069, 'The dock state', 'is also broadcast as', 'a sticky Intent', 'Determining and Monitoring the Docking State and Type', 'https://developer.android.com/training/monitoring-device-state/docking-monitoring.html', 'The dock state is also broadcast as a sticky Intent , allowing you to query if the device is docked or not, and if so, in which kind of dock.', '11154', '11154_9', '11154_9_1');
INSERT INTO `EntitiesRelation` VALUES (1070, 'individual FragmentTransaction objects', 'may represent', 'context changes', 'Implement Back Navigation for Fragments', 'https://developer.android.com/training/implementing-navigation/temporal.html', 'When using fragments in your app, individual FragmentTransaction objects may represent context changes that should be added to the back stack.', '11119', '11119_33', '11119_33_1');
INSERT INTO `EntitiesRelation` VALUES (1071, 'the target view', 'is inside', 'an AdapterView', 'Checking data loading in adapter views', 'https://developer.android.com/training/testing/espresso/basics.html', 'If the target view is inside an AdapterView  such as ListView , GridView , or Spinner  the onView() method might not work.', '11240', '11240_46', '11240_46_1');
INSERT INTO `EntitiesRelation` VALUES (1072, 'the system', 'calls', 'getProgramsForChannel', 'Define channels and create your setup activity', 'https://developer.android.com/training/tv/tif/tvinput.html', 'For each channel, the system calls getProgramsForChannel() when it needs a list of programs that can be viewed within a given time window on the channel.', '11289', '11289_40', '11289_40_1');
INSERT INTO `EntitiesRelation` VALUES (1073, 'View B', 'is aligned to', 'the top', 'Build a Simple User Interface', 'https://developer.android.com/training/basics/firstapp/building-ui.html', 'View B is aligned to the top of view A.', '11040', '11040_34', '11040_34_1');
INSERT INTO `EntitiesRelation` VALUES (1074, 'Foo', 'are', 'different classes', 'Consider Package Instead of Private Access with Private Inner Classes', 'https://developer.android.com/training/articles/perf-tips.html', 'The problem is that the VM considers direct access to Foo \'s private members from Foo$Inner to be illegal because Foo and Foo$Inner are different classes, even though the Java language allows an inner class to access an outer class\' private members.', '11013', '11013_59', '11013_59_1');
INSERT INTO `EntitiesRelation` VALUES (1075, 'the system', 'calls', 'onActivityResult', 'Accessing an External Storage Directory', 'https://developer.android.com/training/articles/scoped-directory-access.html', 'If the user doesn\'t grant access, the system calls your onActivityResult() override with a result code of RESULT_CANCELED , and null intent data.', '11014', '11014_18', '11014_18_2');
INSERT INTO `EntitiesRelation` VALUES (1076, 'jmethodID s', 'are', 'opaque types', 'Local and Global References', 'https://developer.android.com/training/articles/perf-jni.html', 'Note that jfieldID s and jmethodID s are opaque types, not object references, and should not be passed to NewGlobalRef.', '11012', '11012_63', '11012_63_2');
INSERT INTO `EntitiesRelation` VALUES (1077, 'An error', 'remains for', 'DisplayMessageActivity', 'Build an Intent', 'https://developer.android.com/training/basics/firstapp/starting-activity.html', 'Your imports should end up as the following: An error remains for DisplayMessageActivity , but that\'s okay; you\'ll fix that in the next section.', '11044', '11044_19', '11044_19_2');
INSERT INTO `EntitiesRelation` VALUES (1078, 'CardView widgets', 'are available in', 'versions', 'Lists and Cards', 'https://developer.android.com/training/material/compatibility.html', 'The RecyclerView and CardView widgets are available in earlier versions of Android through the Android v7 Support Library with these limitations:.', '11143', '11143_31', '11143_31_2');
INSERT INTO `EntitiesRelation` VALUES (1079, 'implementation', 'must return', 'a Response <T>', 'parseNetworkResponse', 'https://developer.android.com/training/volley/request-custom.html', 'Your implementation must return a Response<T> , which contains your typed response object and cache metadata or an error, such as in the case of a parse failure.', '11292', '11292_14', '11292_14_1');
INSERT INTO `EntitiesRelation` VALUES (1080, 'the JNI_COMMIT flag', 'does not release', 'the array', 'Primitive Arrays', 'https://developer.android.com/training/articles/perf-jni.html', 'Also note that the JNI_COMMIT flag does not release the array, and you will need to call Release again with a different flag eventually.', '11012', '11012_116', '11012_116_1');
INSERT INTO `EntitiesRelation` VALUES (1081, 'the search dialog', 'fires', 'the ACTION_SEARCH intent', 'Handle Search Terms', 'https://developer.android.com/training/tv/discovery/searchable.html', 'As soon as the search dialog has a word which matches the value in one of your app\'s columns (described in Identifying Columns , above), the system fires the ACTION_SEARCH intent.', '11268', '11268_70', '11268_70_2');
INSERT INTO `EntitiesRelation` VALUES (1082, 'startActivityForResult', 'was used with', 'the intent', 'Opening the provider chooser', 'https://developer.android.com/training/wearables/watch-faces/complications.html', 'If startActivityForResult was used with the intent, the result delivered back to the calling Activity will have a result code of RESULT_OK if a provider was successfully set, or a result code of RESULT_CANCELLED if no provider was set.', '11332', '11332_81', '11332_81_2');
INSERT INTO `EntitiesRelation` VALUES (1083, 'a jclass', 'returned from', 'FindClass', 'jclass', 'jmethodID', 'This pattern is commonly used when caching a jclass returned from FindClass , e.g.: All JNI methods accept both local and global references as arguments.', '11012', '11012_53', '11012_53_2');
INSERT INTO `EntitiesRelation` VALUES (1084, 'A Service', 'is often used to supply', 'functionality', 'Using IP networking', 'https://developer.android.com/training/articles/security-tips.html', 'A Service is often used to supply functionality for other applications to use.', '11019', '11019_216', '11019_216_1');
INSERT INTO `EntitiesRelation` VALUES (1085, 'OnboardingFragment', 'uses', 'practices', 'Introducing First-time Users to Your App', 'https://developer.android.com/training/tv/playback/onboarding.html', 'OnboardingFragment uses TV UI best practices to present the information in a way that matches TV UI styles, and is easy to navigate on TV devices.', '11276', '11276_10', '11276_10_1');
INSERT INTO `EntitiesRelation` VALUES (1086, 'the wear.xml file', 'could include', 'the following', 'Specifying capability names for detecting your apps', 'https://developer.android.com/training/wearables/apps/standalone-apps.html', 'For example, in your mobile module, the wear.xml file could include the following: In your wear module, the wear.xml file would include a different value for the capability name, such as the following: For more information, see Advertise capabilities.', '11307', '11307_54', '11307_54_1');
INSERT INTO `EntitiesRelation` VALUES (1087, 'a thread', 'started with', 'pthread_create', 'Threads', 'https://developer.android.com/training/articles/perf-jni.html', 'For example, a thread started with pthread_create can be attached with the JNI AttachCurrentThread or AttachCurrentThreadAsDaemon functions.', '11012', '11012_23', '11012_23_2');
INSERT INTO `EntitiesRelation` VALUES (1088, 'the CardPresenter', 'is created in', 'callback', 'Create a Card Presenter', 'https://developer.android.com/training/tv/playback/card.html', 'In the following code, the CardPresenter is created in the onLoadFinished() callback of the LoaderManager.', '11271', '11271_14', '11271_14_2');
INSERT INTO `EntitiesRelation` VALUES (1089, 'the notification', 'fires', 'the contentIntent', 'Launch Notifications From Standalone Wearable Apps', 'https://developer.android.com/training/wearables/notifications/creating.html', 'Whereas, if the notification is originating from a standalone watch app, then tapping the notification fires the contentIntent to open your Wear app.', '11318', '11318_97', '11318_97_1');
INSERT INTO `EntitiesRelation` VALUES (1090, 'Developers', 'can use', 'the PlaybackState.Builder', 'Providing custom actions', 'https://developer.android.com/training/auto/audio/index.html', 'Developers can use the PlaybackState.Builder to add additional playback custom actions.', '11027', '11027_146', '11027_146_1');
INSERT INTO `EntitiesRelation` VALUES (1091, 'the content', 'is rendered to', 'the Surface', 'Integrate Player with Surface', 'https://developer.android.com/training/tv/tif/ui.html', 'Then, when the content is rendered to the Surface , you call TvInputService.Session.notifyVideoAvailable() to allow the video to display, like so: This transition lasts only for fractions of a second, but presenting a blank screen is visually better than allowing the picture to flash odd blips and jitters.', '11290', '11290_21', '11290_21_1');
INSERT INTO `EntitiesRelation` VALUES (1092, 'ThrowNew instructions', 'set', 'an exception pointer', 'Exceptions', 'https://developer.android.com/training/articles/perf-jni.html', 'The JNI Throw and ThrowNew instructions just set an exception pointer in the current thread.', '11012', '11012_135', '11012_135_2');
INSERT INTO `EntitiesRelation` VALUES (1093, 'The Handler', 'will start', 'a loop', 'Implementing the Interface on Android 3.1 up to Android 4.0', 'https://developer.android.com/training/game-controllers/compatibility.html', 'The Handler will start a loop to check each known connected game controller and see if a device ID is returned.', '11095', '11095_70', '11095_70_1');
INSERT INTO `EntitiesRelation` VALUES (1094, 'The Palette object', 'gives', 'access', 'Selecting Colors with the Palette API', 'https://developer.android.com/training/material/palette-colors.html', 'The Palette object gives you access to the colors in a Bitmap image while also providing six main color profiles from the bitmap to help inform your design choices.', '11149', '11149_7', '11149_7_1');
INSERT INTO `EntitiesRelation` VALUES (1095, 'game', 'calls', 'an InputManagerCompat method', 'Supporting Controllers Across Android Versions', 'https://developer.android.com/training/game-controllers/compatibility.html', 'If your game is running on Android 4.1 or higher and calls an InputManagerCompat method, the proxy implementation calls the equivalent method in InputManager.', '11095', '11095_58', '11095_58_1');
INSERT INTO `EntitiesRelation` VALUES (1096, 'The Wearable UI Library', 'includes', 'the WearableRecyclerView class', 'Creating Lists', 'https://developer.android.com/training/wearables/ui/lists.html', 'The Wearable UI Library includes the WearableRecyclerView class, which is a RecyclerView implementation for creating lists optimized for wearable devices.', '11325', '11325_4', '11325_4_1');
INSERT INTO `EntitiesRelation` VALUES (1097, 'the GuidedActionsStylist class', 'uses', 'theme information', 'Customize Step Presentation', 'https://developer.android.com/training/tv/playback/guided-step.html', 'The GuidanceStylist class uses theme information to control presentation of the left guidance view, while the GuidedActionsStylist class uses theme information to control presentation of the right actions view.', '11273', '11273_81', '11273_81_2');
INSERT INTO `EntitiesRelation` VALUES (1098, 'polling', 'requires', 'a Service', 'Run the Sync Adapter When Server Data Changes', 'https://developer.android.com/training/sync-adapters/running-sync-adapter.html', 'While polling requires a Service that is always active, GCM uses a BroadcastReceiver that\'s activated when a message arrives.', '11226', '11226_28', '11226_28_1');
INSERT INTO `EntitiesRelation` VALUES (1099, 'an AsyncTask', 'is used in', 'the example', 'Scheduling with constraints', 'https://developer.android.com/training/wearables/data-layer/network-access.html', 'In the example, an AsyncTask is used to run code in the background.', '11315', '11315_104', '11315_104_2');
INSERT INTO `EntitiesRelation` VALUES (1100, 'Each directory \'s name', 'should adhere to', 'the following format', 'Use the Resources in your App', 'https://developer.android.com/training/basics/supporting-devices/languages.html', 'Each directory\'s name should adhere to the following format: For example, values-b+es/ contains string resources for locales with the language code es.', '11059', '11059_16', '11059_16_2');
INSERT INTO `EntitiesRelation` VALUES (1101, 'a missing memory barrier', 'causes', 'some code', 'SMP failure example', 'https://developer.android.com/training/articles/smp.html', 'If a missing memory barrier causes some code to read stale data, you may not be able to figure out why by examining memory dumps with a debugger.', '11020', '11020_341', '11020_341_1');
INSERT INTO `EntitiesRelation` VALUES (1102, 'a Handler', 'Move', 'Data', 'Communicating with the UI Thread', 'https://developer.android.com/training/multiple-threads/communicate-ui.html', 'Define a Handler on the UI Thread Move Data from a Task to the UI Thread You should also read.', '11162', '11162_1', '11162_1_1');
INSERT INTO `EntitiesRelation` VALUES (1103, 'the system', 'calls', 'RecordingSession.onStopRecording', 'Recording a Session', 'https://developer.android.com/training/tv/tif/content-recording.html', 'Finally, the system calls RecordingSession.onStopRecording().', '11286', '11286_20', '11286_20_1');
INSERT INTO `EntitiesRelation` VALUES (1104, 'Android', 'introduces', 'two new AlarmManager methods', 'Adapting your app to Doze', 'https://developer.android.com/training/monitoring-device-state/doze-standby.html', 'To help with scheduling alarms, Android 6.0 (API level 23) introduces two new AlarmManager methods: setAndAllowWhileIdle() and setExactAndAllowWhileIdle().', '11155', '11155_38', '11155_38_1');
