INSERT INTO `EntitiesRelation` VALUES (1106, 'The TvInputService.Session', 'handles', 'event', 'Declare your TV input service in the manifest', 'https://developer.android.com/training/tv/tif/tvinput.html', 'The TvInputService.Session handles the onTune() event when the user selects a channel, and notifies the system TV app for changes in the content and content metadata.', '11289', '11289_89', '11289_89_1');
INSERT INTO `EntitiesRelation` VALUES (1107, 'a watch face', 'calls', 'createProviderChooserIntent', 'Receiving data', 'https://developer.android.com/training/wearables/watch-faces/complications.html', 'When a watch face calls createProviderChooserIntent , the watch face supplies a watch face complication ID and a list of supported types.', '11332', '11332_55', '11332_55_1');
INSERT INTO `EntitiesRelation` VALUES (1108, 'this intent filter', 'recognizes', 'launches StartRunActivity', 'Declare App-provided Voice Actions', 'https://developer.android.com/training/wearables/apps/voice.html', 'For example, this intent filter recognizes the \"Start MyRunningApp\" voice action and launches StartRunActivity.', '11308', '11308_40', '11308_40_2');
INSERT INTO `EntitiesRelation` VALUES (1109, 'a round complication', 'might support', 'RANGED_VALUE types', 'Using and Testing Complication Types', 'https://developer.android.com/training/wearables/watch-faces/complications.html', 'For example, a round complication on a watch face might support the SHORT_TEXT , ICON and RANGED_VALUE types, whereas a gauge on the watch face might support only the RANGED_VALUE type.', '11332', '11332_171', '11332_171_1');
INSERT INTO `EntitiesRelation` VALUES (1110, 'the value', 'is one of', 'the base View properties', 'Make Your Transitions Smooth', 'https://developer.android.com/training/custom-views/making-interactive.html', 'If the value you want to change is one of the base View properties, doing the animation is even easier, because Views have a built-in ViewPropertyAnimator that is optimized for simultaneous animation of multiple properties.', '11082', '11082_67', '11082_67_2');
INSERT INTO `EntitiesRelation` VALUES (1111, 'The following Activity snippet', 'uses', 'a headless Fragment', 'Introducing Network Operations on a Separate Thread', 'https://developer.android.com/training/basics/network-ops/connecting.html', 'The following Activity snippet uses a headless Fragment to encapsulate asynchronous network operations.', '11053', '11053_16', '11053_16_1');
INSERT INTO `EntitiesRelation` VALUES (1112, 'NetworkReceiver', 'intercepts', 'the action CONNECTIVITY_ACTION', 'Detect Connection Changes', 'https://developer.android.com/training/basics/network-ops/managing.html', 'When the device\'s network connection changes, NetworkReceiver intercepts the action CONNECTIVITY_ACTION , determines what the network connection status is, and sets the flags wifiConnected and mobileConnected to true/false accordingly.', '11056', '11056_56', '11056_56_1');
INSERT INTO `EntitiesRelation` VALUES (1113, 'the fragment', 'has been added to', 'the FrameLayout container', 'Add a Fragment to an Activity at Runtime', 'https://developer.android.com/training/basics/fragments/fragment-ui.html', 'For example, here\'s how to add a fragment to the previous layout: Because the fragment has been added to the FrameLayout container at runtime instead of defining it in the activity\'s layout with a <fragment> element the activity can remove the fragment and replace it with a different one.', '11047', '11047_23', '11047_23_2');
INSERT INTO `EntitiesRelation` VALUES (1114, 'The Espresso testing framework', 'works with', 'the AndroidJUnitRunner test runner', 'Testing UI for a Single App', 'https://developer.android.com/training/testing/ui-testing/espresso-testing.html', 'The Espresso testing framework is an instrumentation-based API and works with the AndroidJUnitRunner test runner.', '11253', '11253_14', '11253_14_2');
INSERT INTO `EntitiesRelation` VALUES (1115, 'Custom themes', 'must inherit from', 'Theme_Leanback_GuidedStep', 'Customize Step Presentation', 'https://developer.android.com/training/tv/playback/guided-step.html', 'Custom themes must inherit from Theme_Leanback_GuidedStep , and can provide overriding values for attributes defined in GuidanceStylist and GuidedActionsStylist.', '11273', '11273_72', '11273_72_2');
INSERT INTO `EntitiesRelation` VALUES (1116, 'OverScroller', 'includes', 'methods', 'Animating a Scroll Gesture', 'https://developer.android.com/training/gestures/scroll.html', 'They are similar, but OverScroller includes methods for indicating to users that they\'ve reached the content edges after a pan or fling gesture.', '11104', '11104_9', '11104_9_1');
INSERT INTO `EntitiesRelation` VALUES (1117, 'Calls', 'return', 'a PendingResult', 'Wait for the Status of Data Layer Calls', 'https://developer.android.com/training/wearables/data-layer/events.html', 'Calls to the Data Layer API sometimes return a PendingResult , such as putDataItem().', '11312', '11312_5', '11312_5_1');
INSERT INTO `EntitiesRelation` VALUES (1118, 'The BrowseFragment methods', 'set', 'the layout parameters', 'Create a Media Browse Layout', 'https://developer.android.com/training/tv/playback/browse.html', 'The following example shows how to create a layout that contains a BrowseFragment object: The application\'s main activity sets this view, as shown in the following example: The BrowseFragment methods populate the view with the video data and UI elements and set the layout parameters such as the icon, title, and whether category headers are enabled.', '11270', '11270_10', '11270_10_2');
INSERT INTO `EntitiesRelation` VALUES (1119, 'the searchable configuration', 'is correctly associated with', 'SearchView', 'Setting Up the Search Interface', 'https://developer.android.com/training/search/setup.html', 'When the searchable configuration is correctly associated with your SearchView , the SearchView starts an activity with the ACTION_SEARCH intent when a user submits a query.', '11205', '11205_20', '11205_20_3');
