INSERT INTO `EntitiesRelation` VALUES (1225, 'TvInputService', 'allows for', 'custom content rating schemes TvInputManager', 'Declare your TV input service in the manifest', 'https://developer.android.com/training/tv/tif/tvinput.html', 'TvInputService provides long-running and background availability for the TV input TvInputService.Session maintains the TV input state and communicates with the hosting app TvContract describes the channels and programs available to the TV input TvContract.Channels represents information about a TV channel TvContract.Programs describes a TV program with data such as program title and start time TvTrackInfo represents an audio, video, or subtitle track TvContentRating describes a content rating, allows for custom content rating schemes TvInputManager provides an API to the system TV app and manages the interaction with TV inputs and apps.', '11289', '11289_71', '11289_71_8');
