INSERT INTO `Warning` VALUES (1, 'must', 'Introducing First-time Users to Your App', 'Any OnboardingFragment implementation must use either the Theme_Leanback_Onboarding theme or a theme that inherits from Theme_Leanback_Onboarding.', 'Must', 'https://developer.android.com/training/tv/playback/onboarding.html', '11276_65');
INSERT INTO `Warning` VALUES (2, 'can', 'Create the Virtual Table', 'The SQLiteOpenHelper class defines abstract methods that you must override so that your database table can be created and upgraded when necessary.', 'Can', 'https://developer.android.com/training/search/search.html', '11204_9');
INSERT INTO `Warning` VALUES (3, 'could', 'Specifying capability names for detecting your apps', 'For example, in your mobile module, the wear.xml file could include the following: In your wear module, the wear.xml file would include a different value for the capability name, such as the following: For more information, see Advertise capabilities.', 'Can', 'https://developer.android.com/training/wearables/apps/standalone-apps.html', '11307_54');
INSERT INTO `Warning` VALUES (4, 'if', 'Adding a Guided Step', 'If your activity already uses a custom theme and you don t want to apply GuidedStepFragment styles to other views in the activity, add the LeanbackGuidedStepTheme_guidedStepTheme attribute to your existing custom activity theme.', 'Condition', 'https://developer.android.com/training/tv/playback/guided-step.html', '11273_76');
INSERT INTO `Warning` VALUES (5, 'must', 'Concepts and objects', 'The UnreadConversation object you create must also include a RemoteInput object.', 'Must', 'https://developer.android.com/training/auto/messaging/index.html', '11028_110');
INSERT INTO `Warning` VALUES (6, 'can', 'Create a Transition', 'The TransitionSet class extends from the Transition class, so you can use it with a transition manager just like any other Transition instance.', 'Can', 'https://developer.android.com/training/transitions/transitions.html', '11263_53');
INSERT INTO `Warning` VALUES (7, 'can', 'Add a Fragment to an Activity at Runtime', 'An important rule when dealing with fragments especially when adding fragments at runtime is that your activity layout must include a container View in which you can insert the fragment.', 'Can', 'https://developer.android.com/training/basics/fragments/fragment-ui.html', '11047_15');
INSERT INTO `Warning` VALUES (8, 'should', 'Displaying the Quick Contact Badge', 'Add a QuickContactBadge View Set the Contact URI and Thumbnail Add a QuickContactBadge to a ListView You should also read.', 'Should', 'https://developer.android.com/training/contacts-provider/display-contact-badge.html', '11074_1');
INSERT INTO `Warning` VALUES (9, 'can', 'Verifying Results', 'The InstrumentationTestCase extends TestCase , so you can use standard JUnit Assert methods to test that UI components in the app return the expected results.', 'Can', 'https://developer.android.com/training/testing/ui-testing/uiautomator-testing.html', '11255_98');
INSERT INTO `Warning` VALUES (10, 'can', 'Adding a Guided Step', 'The GuidedStepFragment class can use custom themes that control presentation aspects such as title text formatting or step transition animations.', 'Can', 'https://developer.android.com/training/tv/playback/guided-step.html', '11273_71');
INSERT INTO `Warning` VALUES (11, 'whether', 'Handle Layout Events', 'This method\'s parameters are View.MeasureSpec values that tell you how big your view\'s parent wants your view to be, and whether that size is a hard maximum or just a suggestion.', 'Condition', 'https://developer.android.com/training/custom-views/custom-drawing.html', '11080_37');
INSERT INTO `Warning` VALUES (12, 'can', 'Retrieve a File\'s Name and Size', 'SIZE The size of the file in bytes, as a long This value is the same as the value returned by File.length() The client app can get both the DISPLAY_NAME and SIZE for a file by setting all of the arguments of query() to null except for the content URI.', 'Can', 'https://developer.android.com/training/secure-file-sharing/retrieve-info.html', '11208_15');
INSERT INTO `Warning` VALUES (13, 'will', 'SMP failure example', 'A write-through cache will initiate a write to memory immediately, while a write-back cache will wait until it runs out of space and has to evict some entries.', 'Will', 'https://developer.android.com/training/articles/smp.html', '11020_76');
INSERT INTO `Warning` VALUES (14, 'exception', 'Implement Tabs Using New APIs', 'Thus, as long as you don\'t instantiate the Honeycomb-specific implementations on pre-Honeycomb devices, the Dalvik VM won\'t throw any VerifyError exceptions.', 'Exception', 'https://developer.android.com/training/backward-compatible-ui/new-implementation.html', '11033_11');
INSERT INTO `Warning` VALUES (15, 'will', 'Opening the provider chooser', 'In the case where a provider was set, ComplicationProviderInfo class for the chosen provider will be included in the data intent of the result, as an extra with the key ProviderChooserIntent#EXTRA_PROVIDER_INFO.', 'Will', 'https://developer.android.com/training/wearables/watch-faces/complications.html', '11332_82');
INSERT INTO `Warning` VALUES (16, 'should', 'Using HttpsUrlConnection to Fetch Data', 'Design Secure Network Communication Choose an HTTP Client Perform Network Operations Asynchronously Implement a Headless Fragment to Manage Network Operations Using an AsyncTask Connect and Download Data Convert the InputStream to a String Persist Background Work during Configuration Changes You should also read.', 'Should', 'https://developer.android.com/training/basics/network-ops/connecting.html', '11053_1');
INSERT INTO `Warning` VALUES (17, 'should', 'Display a Fixed-duration Progress Indicator', 'Display a Fixed-duration progress Indicator Display a Continuing Activity Indicator You should also read.', 'Should', 'https://developer.android.com/training/notify-user/display-progress.html', '11172_1');
INSERT INTO `Warning` VALUES (18, 'can', 'Wear app requests permission for an app running on the wearable device', 'An app or service can only call the requestPermissions() method from an activity.', 'Can', 'https://developer.android.com/training/articles/wear-permissions.html', '11025_22');
INSERT INTO `Warning` VALUES (19, 'must', 'Retrieving a List of Contacts', 'To use this class, include the following statement: Since the code uses a CursorLoader to retrieve data from the provider, you must specify that it implements the loader interface LoaderManager.LoaderCallbacks.', 'Must', 'https://developer.android.com/training/contacts-provider/retrieve-names.html', '11078_34');
INSERT INTO `Warning` VALUES (20, 'can', 'Define an Intent for geofence transitions', 'The Intent sent from Location Services can trigger various actions in your app, but you should not have it start an activity or fragment, because components should only become visible in response to a user action.', 'Can', 'https://developer.android.com/training/location/geofencing.html', '11137_35');
INSERT INTO `Warning` VALUES (21, 'should', 'Handling credentials', 'Services that are accessible to multiple applications should be accessed using AccountManager.', 'Should', 'https://developer.android.com/training/articles/security-tips.html', '11019_165');
INSERT INTO `Warning` VALUES (22, 'should', 'Processing ACTION_OUTSIDE events', 'Intercept Touch Events in a ViewGroup Use ViewConfiguration Constants Extend a Child View\'s Touchable Area You should also read.', 'Should', 'https://developer.android.com/training/gestures/viewgroup.html', '11105_1');
INSERT INTO `Warning` VALUES (23, 'should', 'Saving Files', 'Choose Internal or External Storage Obtain Permissions for External Storage Save a File on Internal Storage Save a File on External Storage Query Free Space Delete a File You should also read.', 'Should', 'https://developer.android.com/training/basics/data-storage/files.html', '11037_1');
INSERT INTO `Warning` VALUES (24, 'may', 'Respond to a Request to Display Data', 'However, your app may also receive an ACTION_VIEW intent from a source other than Android Beam file transfer.', 'May', 'https://developer.android.com/training/beam-files/receive-files.html', '11063_28');
INSERT INTO `Warning` VALUES (25, 'can', 'Specify custom transitions', 'You can also specify enter, exit, and shared element transitions in your style definition: The change_image_transform transition in this example is defined as follows: The changeImageTransform element corresponds to the ChangeImageTransform class.', 'Can', 'https://developer.android.com/training/material/animations.html', '11142_46');
INSERT INTO `Warning` VALUES (26, 'if', 'Accessing an External Storage Directory', 'If the user grants access, the system calls your onActivityResult() override with a result code of RESULT_OK , and intent data that contains the URI.', 'Condition', 'https://developer.android.com/training/articles/scoped-directory-access.html', '11014_16');
INSERT INTO `Warning` VALUES (27, 'if', 'Query purchased items', 'If the purchase order is successful, the response data from Google Play is stored in a Purchase object that is passed back to the appropriate listener.', 'Condition', 'https://developer.android.com/training/play-billing-library/purchase-iab-products.html', '11184_14');
INSERT INTO `Warning` VALUES (28, 'would', 'Warnings About Using SSLSocket Directly', 'In those cases, the app would want to use SSLSocket directly, much the same way that HttpsURLConnection does internally.', 'Will', 'https://developer.android.com/training/articles/security-ssl.html', '11018_106');
INSERT INTO `Warning` VALUES (29, 'can', 'Introducing Network Operations on a Separate Thread', 'At the minimum, your DownloadCallback interface can consist of the following: Now, add the following implementations of the DownloadCallback interface methods to your Activity : Implementing a Headless Fragment to Encapsulate Network Operations.', 'Can', 'https://developer.android.com/training/basics/network-ops/connecting.html', '11053_19');
INSERT INTO `Warning` VALUES (30, 'should', 'Reduce the size of your bitmap assets', 'The system calls the Engine.onDraw() method every time it redraws your watch face, so you should only include operations that are strictly required to update the watch face inside this method to improve performance.', 'Should', 'https://developer.android.com/training/wearables/watch-faces/performance.html', '11339_61');
INSERT INTO `Warning` VALUES (31, 'if', 'Using interprocess communication', 'If your BroadcastReceiver is intended for use by other applications, you may want to apply security permissions to receivers using the <receiver> element within the application manifest.', 'Condition', 'https://developer.android.com/training/articles/security-tips.html', '11019_244');
INSERT INTO `Warning` VALUES (32, 'note that', 'Accessing UI Components', 'Note that the UI Automator test framework searches the current display for a match every time your test uses a UiObject instance to click on a UI element or query a property.', 'Note', 'https://developer.android.com/training/testing/ui-testing/uiautomator-testing.html', '11255_63');
INSERT INTO `Warning` VALUES (33, 'whether', 'Create a custom drawer view', 'The action drawer peeks when the user reaches the top or bottom of the scrolling content, whether from normal scrolling or from flings.', 'Condition', 'https://developer.android.com/training/wearables/ui/wear-ui-library.html', '11330_38');
INSERT INTO `Warning` VALUES (34, 'will', 'SMP failure example', 'While a series of atomic RMW operations on a single address will be observed in program order by other cores, there are no guarantees when it comes to the ordering of atomic and non-atomic operations.', 'Will', 'https://developer.android.com/training/articles/smp.html', '11020_264');
INSERT INTO `Warning` VALUES (35, 'can', 'Specify Sharable Directories', 'This entry specifies the authority to use in generating content URIs, as well as the name of an XML file that specifies the directories your app can share.', 'Can', 'https://developer.android.com/training/secure-file-sharing/setup-sharing.html', '11209_10');
INSERT INTO `Warning` VALUES (36, 'whether', 'Create a Media Browse Layout', 'The following example shows how to create a layout that contains a BrowseFragment object: The application\'s main activity sets this view, as shown in the following example: The BrowseFragment methods populate the view with the video data and UI elements and set the layout parameters such as the icon, title, and whether category headers are enabled.', 'Condition', 'https://developer.android.com/training/tv/playback/browse.html', '11270_10');
INSERT INTO `Warning` VALUES (37, 'if', 'SMP failure example', 'If  A  refers to a memory address,  A+n  refers to a memory address offset by 8 bytes from A.', 'Condition', 'https://developer.android.com/training/articles/smp.html', '11020_195');
INSERT INTO `Warning` VALUES (38, 'if', 'What not to do in Java', 'The most glaring problem is that mValue++ is actually three operations: reg = mValue reg = reg + 1 mValue = reg If two threads execute in incr() simultaneously, one of the updates could be lost.', 'Condition', 'https://developer.android.com/training/articles/smp.html', '11020_404');
INSERT INTO `Warning` VALUES (39, 'if', 'Analyze the Feed', 'For the link tag, the parser extracts data for links by first determining if the link is the kind it\'s interested in.', 'Condition', 'https://developer.android.com/training/basics/network-ops/xml.html', '11057_43');
INSERT INTO `Warning` VALUES (40, 'must', 'Interacting with Other Apps', 'To take the user from one activity to another, your app must use an Intent to define your app\'s \"intent\" to do something.', 'Must', 'https://developer.android.com/training/basics/intents/index.html', '11050_6');
INSERT INTO `Warning` VALUES (41, 'must', 'Run Recommendations Service', 'The following code example extends the BroadcastReceiver class to start periodic execution of a recommendation service every half hour: This implementation of the BroadcastReceiver class must run after start up of the TV device where it is installed.', 'Must', 'https://developer.android.com/training/tv/discovery/recommendations.html', '11267_55');
INSERT INTO `Warning` VALUES (42, 'note that', 'Using content providers', 'Note that using parameterized methods is not sufficient if the selection argument is built by concatenating user data prior to submitting it to the method.', 'Note', 'https://developer.android.com/training/articles/security-tips.html', '11019_46');
INSERT INTO `Warning` VALUES (43, 'note:', 'Configure your app to use the correct version of Google Play Services', 'The following example shows how to do so: The build.gradle file of your wear module must also use this version of the client library, for example: Note: If you are using any other Google Play services APIs in your wearable app, you must selectively add those Google Play service APIs into your app and explicitly specify the 10.2.0 version.', 'Note', 'https://developer.android.com/training/wearables/apps/creating-app-china.html', '11299_12');
INSERT INTO `Warning` VALUES (44, 'note that', 'Choose an HTTP Client', 'The following snippet uses the HttpsURLConnection API to accomplish this: Note that the method getResponseCode() returns the connection\'s status code.', 'Note', 'https://developer.android.com/training/basics/network-ops/connecting.html', '11053_29');
INSERT INTO `Warning` VALUES (45, 'if', 'Query Items Available for Purchase', 'If the query is successful, the query results are stored in an Inventory object that is passed back to the listener.', 'Condition', 'https://developer.android.com/training/in-app-billing/list-iab-products.html', '11126_30');
INSERT INTO `Warning` VALUES (46, 'can', 'SMP failure example', 'On x86 and ARM SMP, the store to A and the load from B in thread 1 can be  observed  in a different order by thread 2.', 'Can', 'https://developer.android.com/training/articles/smp.html', '11020_60');
INSERT INTO `Warning` VALUES (47, 'will', 'Implement Touch-Based Scrolling', 'In the following snippet, mContentRect represents the rectangle coordinates within the view that the chart will be drawn into.', 'Will', 'https://developer.android.com/training/gestures/scroll.html', '11104_40');
INSERT INTO `Warning` VALUES (48, 'if', 'Capturing touch events for a single view', 'If you do this, the listener will not be called for the subsequent ACTION_MOVE and ACTION_UP string of events.', 'Condition', 'https://developer.android.com/training/gestures/detector.html', '11099_31');
INSERT INTO `Warning` VALUES (49, 'if', 'Setting Up the Search Interface', 'If you run your app now, the SearchView can accept the user\'s query and start your searchable activity with the ACTION_SEARCH intent.', 'Condition', 'https://developer.android.com/training/search/setup.html', '11205_29');
INSERT INTO `Warning` VALUES (50, 'will', 'SMP failure example', 'While the architecture guarantees that loads are not reordered with respect to other loads, and stores are not reordered with respect to other stores, it does not guarantee that a store followed by a load will be observed in the expected order.', 'Will', 'https://developer.android.com/training/articles/smp.html', '11020_52');
INSERT INTO `Warning` VALUES (51, 'could', 'SMP failure example', 'Misaligned data could straddle a cache line, so other cores could see the halves update independently.', 'Can', 'https://developer.android.com/training/articles/smp.html', '11020_245');
INSERT INTO `Warning` VALUES (52, 'can', 'Access the Requested File', 'From this object, the client app gets a FileDescriptor object, which it can then use to read the file.', 'Can', 'https://developer.android.com/training/secure-file-sharing/request-file.html', '11207_18');
INSERT INTO `Warning` VALUES (53, 'if', 'Create an Intent Handler for URIs', 'For example, an app with the following intent filters would fail verification if an assetlinks.json file were not found at both https://www.example.com/.well-known/assetlinks.json and https://www.example.net/.well-known/assetlinks.json : Supporting app linking for multiple subdomains.', 'Condition', 'https://developer.android.com/training/app-links/index.html', '11002_45');
INSERT INTO `Warning` VALUES (54, 'would', 'Creating a Background Service', 'Also, an IntentService isn\'t affected by most user interface lifecycle events, so it continues to run in circumstances that would shut down an AsyncTask An IntentService has a few limitations:.', 'Will', 'https://developer.android.com/training/run-background-service/create-service.html', '11190_6');
INSERT INTO `Warning` VALUES (55, 'can', 'Connect to the Print Manager', 'During the printing process, users can choose to cancel the print action, so your print adapter must also listen for and react to a cancellation requests.', 'Can', 'https://developer.android.com/training/printing/custom-docs.html', '11186_22');
INSERT INTO `Warning` VALUES (56, 'note that', 'Create a Floating Action Button', 'Note that as FloatingActionButton extends ImageButton , and in turn ImageView , you can set the icon which is displayed either via android:src as illustrated in the example above, or using the setImageDrawable() method.', 'Note', 'https://developer.android.com/training/material/design-library.html', '11144_13');
INSERT INTO `Warning` VALUES (57, 'if', 'Capturing touch events for an Activity or View', 'If you return false from onDown() , as GestureDetector.SimpleOnGestureListener does by default, the system assumes that you want to ignore the rest of the gesture, and the other methods of GestureDetector.OnGestureListener never get called.', 'Condition', 'https://developer.android.com/training/gestures/detector.html', '11099_53');
INSERT INTO `Warning` VALUES (58, 'if', 'Building your content hierarchy', 'If the user selects a submenu, Auto invokes onLoadChildren() again to retrieve the child nodes of the selected menu item.', 'Condition', 'https://developer.android.com/training/auto/audio/index.html', '11027_74');
INSERT INTO `Warning` VALUES (59, 'if', 'Return a Result', 'If the originating activity had called startActivityForResult() , then the system delivers it the result you supply to setResult() ; otherwise, the result is ignored.', 'Condition', 'https://developer.android.com/training/basics/intents/filters.html', '11049_50');
INSERT INTO `Warning` VALUES (60, 'note that', 'Define an intent service to fetch the address', 'Note that the AsyncTask class also allows you to perform background operations, but it\'s designed for short operations.', 'Note', 'https://developer.android.com/training/location/display-address.html', '11136_24');
INSERT INTO `Warning` VALUES (61, 'should', 'Handling Keyboard Actions', 'Both the Activity and View class implement the KeyEvent.Callback interface, so you should generally override the callback methods in your extension of these classes as appropriate.', 'Should', 'https://developer.android.com/training/keyboard-input/commands.html', '11130_3');
INSERT INTO `Warning` VALUES (62, 'could', 'What not to do in Java', 'You could try to ensure that the store to helper happens after the atomic_release_store() on this.lock by rearranging the code, but that won t help, because It is okay to migrate code upward   the compiler could move the assignment back above the atomic_release_store() to its original position.', 'Can', 'https://developer.android.com/training/articles/smp.html', '11020_431');
INSERT INTO `Warning` VALUES (63, 'could', 'Matching a view next to another view', 'For example, a repeating call button in a table of contacts could have the same R.id , contain the same text, and have the same properties as other call buttons within the view hierarchy.', 'Can', 'https://developer.android.com/training/testing/espresso/recipes.html', '11246_3');
INSERT INTO `Warning` VALUES (64, 'must', 'Request Permission to Read the Provider', 'To do any type of search of the Contacts Provider, your app must have READ_CONTACTS permission.', 'Must', 'https://developer.android.com/training/contacts-provider/retrieve-names.html', '11078_15');
INSERT INTO `Warning` VALUES (65, 'can', 'Exposing Data to Complications', 'A ComplicationManager object is passed as a parameter to the onComplicationUpdate method, and can be used to send data back to the system.', 'Can', 'https://developer.android.com/training/wearables/watch-faces/complications.html', '11332_139');
INSERT INTO `Warning` VALUES (66, 'will', 'Create a Version-Aware Activity Layout', 'For the older implementation ( TabHelperEclair ), you need to ensure that your activity layout contains a TabWidget and TabHost , along with a container for tab contents: res/layout/mainxml: For the TabHelperHoneycomb implementation, all you need is a FrameLayout to contain the tab contents, since the tab indicators are provided by the ActionBar : res/layout-v11/mainxml: At runtime, Android will decide which version of the main.xml layout to inflate depending on the platform version.', 'Will', 'https://developer.android.com/training/backward-compatible-ui/using-component.html', '11035_7');
INSERT INTO `Warning` VALUES (67, 'can', 'Allowing Other Apps to Start Your Activity', 'When an app calls startActivity() or startActivityForResult() , with an implicit intent, the system finds which activity (or activities) can respond to the intent.', 'Can', 'https://developer.android.com/training/basics/intents/filters.html', '11049_8');
INSERT INTO `Warning` VALUES (68, 'note:', 'Setting Up File Sharing', 'Note: The FileProvider class is part of the v4 Support Library.', 'Note', 'https://developer.android.com/training/secure-file-sharing/setup-sharing.html', '11209_6');
INSERT INTO `Warning` VALUES (69, 'can', 'Wear app requests permission for an app running on the wearable device', 'An app or service can only call the requestPermissions() method from an activity.', 'Can', 'https://developer.android.com/training/articles/wear-permissions.html', '11025_22');
INSERT INTO `Warning` VALUES (70, 'can', 'Define a Projection', 'The following example code takes the height and width of the GLSurfaceView and uses it to populate a projection transformation Matrix using the Matrix.frustumM() method: This code populates a projection matrix, mProjectionMatrix which you can then combine with a camera view transformation in the onDrawFrame() method, which is shown in the next section.', 'Can', 'https://developer.android.com/training/graphics/opengl/projection.html', '11110_15');
INSERT INTO `Warning` VALUES (71, 'will', 'Use Layout Aliases', 'This means that devices whose smallest width is greater than or equal to 600dp will select the layout-sw600dp/main.xml (two-pane) layout, while smaller screens will select the layout/main.xml (single-pane) layout.', 'Will', 'https://developer.android.com/training/multiscreen/screensizes.html', '11170_43');
INSERT INTO `Warning` VALUES (72, 'if', 'Creating a Background Service', 'If an operation is running in an IntentService , and you send it another request, the request waits until the first operation is finished.', 'Condition', 'https://developer.android.com/training/run-background-service/create-service.html', '11190_10');
INSERT INTO `Warning` VALUES (73, 'can', 'Receive Status Broadcasts from an IntentService', 'This next snippet shows how to register the BroadcastReceiver and its IntentFilter : A single BroadcastReceiver can handle more than one type of broadcast Intent object, each with its own action.', 'Can', 'https://developer.android.com/training/run-background-service/report-status.html', '11192_21');
