INSERT INTO `Warning` VALUES (530, 'note:', 'Build a Renderer Class', 'Note: You may wonder why these methods have a GL10 parameter, when you are using the OpengGL ES 2.0 APIs.', 'Note', 'https://developer.android.com/training/graphics/opengl/environment.html', '11107_37');
INSERT INTO `Warning` VALUES (531, 'must', 'Add Intent Filters for Your Deep Links', 'At minimum, the <data> tag must include the android:scheme attribute.', 'Must', 'https://developer.android.com/training/app-indexing/deep-linking.html', '10999_9');
INSERT INTO `Warning` VALUES (532, 'if', 'Working with Advertising IDs', 'In this example, the ad_id column could be joined to PII via the account_id column in both tables, which would be a violation of the Google Play Developer Content Policy , if you did not get explicit permission from your users.', 'Condition', 'https://developer.android.com/training/articles/user-data-ids.html', '11021_38');
INSERT INTO `Warning` VALUES (533, 'might', 'Allow Google to Crawl URLs Requested By Your App', 'For example, the following robots.txt directive shows how you might allow access to a specific directory in your web site (for example, /api/ ) that your app needs to access, while restricting Googlebot\'s access to other parts of your site.', 'May', 'https://developer.android.com/training/app-indexing/enabling-app-indexing.html', '11000_23');
INSERT INTO `Warning` VALUES (534, 'note:', 'Show the Input Method On Demand', 'For example, the following method takes a View in which the user should type something, calls requestFocus() to give it focus, then showSoftInput() to open the input method: Note: Once the input method is visible, you should not programmatically hide it.', 'Note', 'https://developer.android.com/training/keyboard-input/visibility.html', '11134_15');
INSERT INTO `Warning` VALUES (535, 'must', 'Exposing Data to Complications', 'To respond to update requests from the system, your data provider must implement the onComplicationUpdate() method of the ComplicationProviderService class.', 'Must', 'https://developer.android.com/training/wearables/watch-faces/complications.html', '11332_137');
INSERT INTO `Warning` VALUES (536, 'can', 'Introducing Network Operations on a Separate Thread', 'At the minimum, your DownloadCallback interface can consist of the following: Now, add the following implementations of the DownloadCallback interface methods to your Activity : Implementing a Headless Fragment to Encapsulate Network Operations.', 'Can', 'https://developer.android.com/training/basics/network-ops/connecting.html', '11053_19');
INSERT INTO `Warning` VALUES (537, 'can', 'Detecting Your App on Another Device', 'Your phone app or watch app can use the CapabilityApi to advertise the app\'s presence to a paired device.', 'Can', 'https://developer.android.com/training/wearables/apps/standalone-apps.html', '11307_39');
INSERT INTO `Warning` VALUES (538, 'might', 'Accessing UI Components', 'The following snippet shows how your test might construct UiObject instances that represent a Cancel button and a OK button in an app.', 'May', 'https://developer.android.com/training/testing/ui-testing/uiautomator-testing.html', '11255_64');
INSERT INTO `Warning` VALUES (539, 'must', 'Providing custom actions', 'Android Auto apps must also support ACTION_PLAY_FROM_MEDIA_ID and ACTION_PLAY_FROM_SEARCH.', 'Must', 'https://developer.android.com/training/auto/audio/index.html', '11027_145');
INSERT INTO `Warning` VALUES (540, 'must', 'Setting Up a RequestQueue', 'A key concept is that the RequestQueue must be instantiated with the Application context, not an Activity context.', 'Must', 'https://developer.android.com/training/volley/requestqueue.html', '11294_19');
INSERT INTO `Warning` VALUES (541, 'can', 'Using content providers', 'Content providers can also provide more granular access by declaring the android:grantUriPermissions attribute and using the FLAG_GRANT_READ_URI_PERMISSION and FLAG_GRANT_WRITE_URI_PERMISSION flags in the Intent object that activates the component.', 'Can', 'https://developer.android.com/training/articles/security-tips.html', '11019_43');
INSERT INTO `Warning` VALUES (542, 'will', 'FAQ: Why didn\'t FindClass find my class?', 'It examines the call stack, which will look something like: The topmost method is Foo.myfunc.', 'Will', 'https://developer.android.com/training/articles/perf-jni.html', '11012_238');
INSERT INTO `Warning` VALUES (543, 'should', 'Initialize the Drawer List', 'How you do so depends on the content of your app, but a navigation drawer often consists of a ListView , so the list should be populated by an Adapter (such as ArrayAdapter or SimpleCursorAdapter ).', 'Should', 'https://developer.android.com/training/implementing-navigation/nav-drawer.html', '11118_19');
INSERT INTO `Warning` VALUES (544, 'can', 'Search for the Query', 'Any matching results are returned in a Cursor that you can iterate through or use to build a ListView.', 'Can', 'https://developer.android.com/training/search/search.html', '11204_20');
INSERT INTO `Warning` VALUES (545, 'can', 'Using a custom failure handler', 'The CustomFailureHandler can be registered with Espresso in the setUp() method of the test: For more information, see the FailureHandler interface and Espresso.setFailureHandler().', 'Can', 'https://developer.android.com/training/testing/espresso/recipes.html', '11246_29');
INSERT INTO `Warning` VALUES (546, 'should', 'Key Attestation', 'To do so, you should check that the attestation certificate chain contains a root certificate that is signed with the Google attestation root key and that the attestationSecurityLevel element within the key description data structure is set to the TrustedEnvironment security level.', 'Should', 'https://developer.android.com/training/articles/security-key-attestation.html', '11017_4');
INSERT INTO `Warning` VALUES (547, 'could', 'Explain Why You Need Permissions', 'The app could then call requestPermissions() to ask the user for that access.', 'Can', 'https://developer.android.com/training/permissions/usage-notes.html', '11180_61');
INSERT INTO `Warning` VALUES (548, 'if', 'Store data in the task object', 'If the status code is TASK_COMPLETE , then the task is finished, and the PhotoTask object in the Message contains both a Bitmap and an ImageView.', 'Condition', 'https://developer.android.com/training/multiple-threads/communicate-ui.html', '11162_40');
INSERT INTO `Warning` VALUES (549, 'will', 'User interactions with complications', 'This action will be specified as a PendingIntent included in the ComplicationData object.', 'Will', 'https://developer.android.com/training/wearables/watch-faces/complications.html', '11332_60');
INSERT INTO `Warning` VALUES (550, 'if', 'Settings', 'Therefore, when the user tries to do something that requires a permission, the app should always first call the checkSelfPermission() method to see if the app currently has permission to perform this operation.', 'Condition', 'https://developer.android.com/training/articles/wear-permissions.html', '11025_94');
INSERT INTO `Warning` VALUES (551, 'if', 'Setting Up File Sharing', 'For example, if you define a FileProvider according to the snippets in this lesson, and you request a content URI for the file default_image.jpg , FileProvider returns the following URI:.', 'Condition', 'https://developer.android.com/training/secure-file-sharing/setup-sharing.html', '11209_32');
INSERT INTO `Warning` VALUES (552, 'can', 'Requesting Access to Run During Direct Boot', 'Encryption aware components can register to receive a ACTION_LOCKED_BOOT_COMPLETED broadcast message from the system when the device has been restarted.', 'Can', 'https://developer.android.com/training/articles/direct-boot.html', '11009_19');
INSERT INTO `Warning` VALUES (553, 'can', 'Revise Your Layout', 'So, when this design is converted to use RelativeLayout , you can see that the layout becomes a 2-level hierarchy.', 'Can', 'https://developer.android.com/training/improving-layouts/optimizing-layout.html', '11122_26');
INSERT INTO `Warning` VALUES (554, 'must', 'Making TV Apps Searchable', 'The searchable.xml file must also include the android:searchSuggestIntentAction with the value \"android.intent.action.VIEW\" to define the intent action for providing a custom suggestion.', 'Must', 'https://developer.android.com/training/tv/discovery/searchable.html', '11268_57');
INSERT INTO `Warning` VALUES (555, 'can', 'Checking Device Policy Encryption Status', 'Device administration apps can use DevicePolicyManager.getStorageEncryptionStatus() to check the current encryption status of the device.', 'Can', 'https://developer.android.com/training/articles/direct-boot.html', '11009_53');
INSERT INTO `Warning` VALUES (556, 'if', 'Use Non-Sticky Immersion', 'If you\'re building a book reader, news reader, or a magazine, use the IMMERSIVE flag in conjunction with SYSTEM_UI_FLAG_FULLSCREEN and SYSTEM_UI_FLAG_HIDE_NAVIGATION.', 'Condition', 'https://developer.android.com/training/system-ui/immersive.html', '11228_35');
INSERT INTO `Warning` VALUES (557, 'must', 'Create a drawer layout', 'The main content layout must be placed before the NavigationView because the XML order implies z-ordering and the navigation drawer must be on top of the main content.', 'Must', 'https://developer.android.com/training/material/design-library.html', '11144_40');
INSERT INTO `Warning` VALUES (558, 'if', 'Local and Global References', 'Normally FindClass uses the loader associated with the method at the top of the interpreted stack, or if there isn\'t one (because the thread was just attached) it uses the \"system\" class loader.', 'Condition', 'https://developer.android.com/training/articles/perf-jni.html', '11012_177');
INSERT INTO `Warning` VALUES (559, 'can', 'Synchronous calls', 'In this case, you can call await() on the PendingResult object, which blocks until the request completes and returns a Result object: Listen for Data Layer Events.', 'Can', 'https://developer.android.com/training/wearables/data-layer/events.html', '11312_13');
INSERT INTO `Warning` VALUES (560, 'can', 'Implement Tabs Using New APIs', 'For example, the native tab implementation can be provided by CompatTabHoneycomb and TabHelperHoneycomb classes, since they rely on APIs available in Android 3.0 (API level 11) or later.', 'Can', 'https://developer.android.com/training/backward-compatible-ui/new-implementation.html', '11033_13');
INSERT INTO `Warning` VALUES (561, 'must', 'Display doorbell events with Firebase UI', 'Subclasses of the adapter must override populateViewHolder() and provide the logic to bind the data from the model into the provided ViewHolder.', 'Must', 'https://developer.android.com/things/training/doorbell/companion-app.html', '10897_18');
INSERT INTO `Warning` VALUES (562, 'must', 'Create a Notification Builder', 'At bare minimum, a Builder object must include the following:.', 'Must', 'https://developer.android.com/training/notify-user/build-notification.html', '11171_12');
INSERT INTO `Warning` VALUES (563, 'could', 'Match a Contact by Name and List the Results', 'For example, you could create the main layout file res/layout/contacts_list_view.xml with the following XML: This XML uses the built-in Android ListView widget android:id/list.', 'Can', 'https://developer.android.com/training/contacts-provider/retrieve-names.html', '11078_21');
INSERT INTO `Warning` VALUES (564, 'if', 'Wear app requests permission for an app running on the wearable device', 'As mentioned above, only an activity can call the requestPermissions() method, so if the user interacts with your app via a service, for example a watch face, the service must open a background activity before requesting the permission.', 'Condition', 'https://developer.android.com/training/articles/wear-permissions.html', '11025_86');
INSERT INTO `Warning` VALUES (565, 'must', 'Request permissions', 'To read from the Contacts Provider, your app must have READ_CONTACTS permission.', 'Must', 'https://developer.android.com/training/contacts-provider/retrieve-details.html', '11077_16');
INSERT INTO `Warning` VALUES (566, 'whether', 'Create a custom drawer view', 'For example: By default, the action drawer peeks when a user reaches the top or bottom of the main scrolling content (that is, the view that implements NestedScrollingChild ), whether from normal scrolling or from flings.', 'Condition', 'https://developer.android.com/training/wearables/ui/wear-ui-library.html', '11330_66');
INSERT INTO `Warning` VALUES (567, 'can', 'Accessing UI Components', 'Your test can use the UiDevice object to perform device-level actions, such as forcing the device into a specific rotation, pressing D-pad hardware buttons, and pressing the Home and Menu buttons.', 'Can', 'https://developer.android.com/training/testing/ui-testing/uiautomator-testing.html', '11255_57');
INSERT INTO `Warning` VALUES (568, 'note that', 'Accessing UI Components', 'Note that the UI Automator test framework searches the current display for a match every time your test uses a UiObject instance to click on a UI element or query a property.', 'Note', 'https://developer.android.com/training/testing/ui-testing/uiautomator-testing.html', '11255_63');
INSERT INTO `Warning` VALUES (569, 'should', 'Add an Intent Filter', 'Add an Intent Filter Handle the Intent in Your Activity Return a Result You should also read.', 'Should', 'https://developer.android.com/training/basics/intents/filters.html', '11049_1');
INSERT INTO `Warning` VALUES (570, 'if', 'Capturing touch events for a single view', 'If you do this, the listener will not be called for the subsequent ACTION_MOVE and ACTION_UP string of events.', 'Condition', 'https://developer.android.com/training/gestures/detector.html', '11099_31');
INSERT INTO `Warning` VALUES (571, 'can', 'Override onDraw()', 'Simply put, Canvas defines shapes that you can draw on the screen, while Paint defines the color, style, font, and so forth of each shape you draw.', 'Can', 'https://developer.android.com/training/custom-views/custom-drawing.html', '11080_19');
INSERT INTO `Warning` VALUES (572, 'should', 'Animating a Scroll Gesture', 'Any standard layout that might extend beyond the bounds of its container should be nested in a ScrollView to provide a scrollable view that\'s managed by the framework.', 'Should', 'https://developer.android.com/training/gestures/scroll.html', '11104_5');
INSERT INTO `Warning` VALUES (573, 'if', 'Types and fields', 'For example, if a watch face tries to access a Long text field in a SHORT_TEXT type, the default value for the Long text field is returned.', 'Condition', 'https://developer.android.com/training/wearables/watch-faces/complications.html', '11332_197');
INSERT INTO `Warning` VALUES (574, 'should', 'Draw a Shape', 'Once you have all this code in place, drawing this object just requires a call to the draw() method from within your renderer s onDrawFrame() method: When you run the application, it should look something like this: Figure 1 Triangle drawn without a projection or camera view.', 'Should', 'https://developer.android.com/training/graphics/opengl/draw.html', '11106_27');
